[400001] = {400001,	10000,	2,	2,	"0",	"0",	"一切都交給我吧！",	"全部任せて！",	"0",	"0",	"一切都交给我吧！",	"0",	"cv_rurura_2",	"0",	"0",	"0"},
[400002] = {400002,	10000,	3,	3,	"0",	"0",	"我是魂滅小隊隊長露露啦，只要有我在，無論是生活方面還是戰鬥方面，都不需要領航費心。",	"あたしは魂滅小隊の隊長、ルルラ。プライベートも、戦闘も、心配ご無用だよ。",	"0",	"0",	"我是魂灭小队队长露露啦，只要有我在，无论是生活方面还是战斗方面，都不需要领航费心。",	"0",	"cv_rurura_1",	"0",	"0",	"0"},
[400003] = {400003,	10000,	4,	4,	"0",	"idle",	"金庫啦和歐朵啦在做什麼呢……呀！我沒在發呆！對了！領航想吃什麼嗎？我可以做很多菜喔，紅燒肉、醋溜魚、辣子雞……",	"キンクラとオードラは何をしてるのかな……あっ！いや、ぼうっとしてた訳じゃなくて…...そうだ！ナビゲーターは何が食べたい？あたし、いろんな料理が作れるんだ！豚の角煮、魚の甘酢あんかけ、スパイシーチキン……その他、ご希望のものがあれば。",	"0",	"0",	"金库啦和欧朵啦在做什么呢……呀！我没在发呆！对了！领航想吃什么吗？我可以做很多菜哦，红烧肉、醋溜鱼、辣子鸡……",	"0",	"cv_rurura_3",	"0",	"0",	"0"},
[400004] = {400004,	10000,	5,	4,	"0",	"idle",	"領航您累了嗎？把工作交給我吧！有什麼心事也可以和我說，我會一直陪在您身邊。",	"お疲れ様、ナビゲーター！仕事ならあたしに任せて！相談にも乗ってあげる。ずっとあなたのそばにいるからね。",	"0",	"0",	"领航您累了吗？把工作交给我吧！有什么心事也可以和我说，我会一直陪在您身边。",	"0",	"cv_rurura_4",	"0",	"0",	"0"},
[400005] = {400005,	10000,	6,	4,	"0",	"idle",	"領航，工作結束之後，我可以和你一起玩電玩喔！我可是超厲害的，歐朵啦和金庫啦都不是我的對手！",	"ナビゲーター。仕事が終わったら一緒にゲームできるよ！あたし、めちゃくちゃ強いんだから。キンクラとオードラに勝ちまくってるし！",	"0",	"0",	"领航，工作结束之后，我可以和你一起玩电玩噢！我可是超厉害的，欧朵啦和金库啦都不是我的对手！",	"0",	"cv_rurura_30",	"0",	"0",	"0"},
[400006] = {400006,	10000,	7,	5,	"1_》_0_0.8",	"level1",	"戰爭結束之後想做什麼……？我沒有特別想做的事，不過，如果領航希望的話，我可以像現在一樣一直照顧領航喔。",	"戦争が終わったら何がしたいって……？特にないけど…...そうだなあ、ナビゲーターさえ良ければ、今みたいにずっとナビゲーターのお世話をしてあげてもいいよ。",	"0",	"0",	"战争结束之后想做什么……？我没有特别想做的事，不过，如果领航希望的话，我可以像现在一样一直照顾领航哦。",	"0",	"cv_rurura_31",	"0",	"0",	"0"},
[400007] = {400007,	10000,	8,	5,	"1_》_0_0.8",	"level1",	"嗯……我正在思考今天晚上要做的晚飯喔，還請不要打斷我的思路啦。",	"今夜の夕飯を考えているの、邪魔しないで。",	"0",	"0",	"嗯……我正在思考今天晚上要做的晚饭哦，还请不要打断我的思路啦。",	"0",	"cv_rurura_5",	"0",	"0",	"0"},
[400008] = {400008,	10000,	9,	5,	"1_》_100_1.5",	"level2",	"欸呀呀，領航是覺得寂寞了嗎？要露露啦來陪你說說話嗎？",	"ん？寂しいの？だったらルルラとおしゃべりしない？",	"0",	"0",	"哎呀呀，领航是觉得寂寞了吗？要露露啦来陪你说说话吗？",	"0",	"cv_rurura_6",	"0",	"0",	"0"},
[400009] = {400009,	10000,	10,	5,	"1_》_500_2",	"level3",	"不知不覺中已經在多瑙支部待了這麼久了……一開始的時候確實有點沒法習慣，但是好在這裡大家都非常友善，現在我已經完全適應了喔。",	"ダニューブ支局に来てからもうだいぶ経つんだね……最初はなかなか慣れなくて……ああでも、優しいみんなのお陰でもうすっかり慣れてるよ。",	"0",	"0",	"不知不觉中已经在多瑙支部呆了这么久了……一开始的时候确实有点没法习惯，但是好在这里大家都非常友善，现在我已经完全适应了哦。",	"0",	"cv_rurura_7",	"0",	"0",	"0"},
[400010] = {400010,	10000,	11,	5,	"1_》_1000_2.5",	"level4",	"領航……雖然有些不好意思，但是我覺得還是有必要當面說出來。那……那個，為了感謝這段時間你對我的照顧，我想邀請你來我這邊吃頓晚飯可以嗎？",	"ナビゲーター……あのね、ちょっと恥ずかしいけど、面と向かって言うべきだと思うの。え、えっと……最近、色々とお世話になってるじゃない？その感謝の気持ちを伝えたいと思って……良かったらあたしの部屋で一緒に夕飯を食べない？",	"0",	"0",	"领航……虽然有些不好意思，但是我觉得还是有必要当面说出来。那……那个，为了感谢这段时间你对我的照顾，我想邀请你来我这边吃顿晚饭可以吗？",	"0",	"cv_rurura_8",	"0",	"0",	"0"},
[400011] = {400011,	10000,	12,	6,	"0",	"0",	"謝謝！這樣一來就能幫上領航了！",	"ありがとう！これならナビゲーターの力になれる！",	"0",	"0",	"谢谢！这样一来就能帮上领航了！",	"0",	"cv_rurura_9",	"0",	"0",	"0"},
