[400101] = {400101,	10001,	2,	2,	"0",	"0",	"我絕對不會辜負您的期待。",	"絶対にご期待を裏切りませんわ。",	"0",	"0",	"我绝对不会辜负您的期待。",	"0",	"cv_Julius_2",	"0",	"0",	"0"},
[400102] = {400102,	10001,	3,	3,	"0",	"0",	"朱利烏斯·馮·尼采，從現在起將作為您最出色的部下，為了我們共同的榮耀而戰鬥。",	"ユリウス・フォン・ニーチェです。これからあなた様の一番の部下として、我らの栄光のため、共に戦いましょう。",	"0",	"0",	"朱利乌斯·冯·尼采，从现在起将作为您最出色的部下，为了我们共同的荣耀而战斗。",	"0",	"cv_Julius_1",	"0",	"0",	"0"},
[400103] = {400103,	10001,	4,	4,	"0",	"idle",	"我想要做的，我能做到的，只不過是笨拙地模仿前輩罷了。但是，哪怕是如此愚鈍的我還是有一點可以向您保證……賭上家族的榮耀，我一定會為您帶來光榮的勝利。",	"私のやりたいこと、そして私にできることは、ただ不器用に先人の真似をするだけです。でも、そんな不器用な私でも、一つだけ、保証できます……家名をかけて、あなた様に栄光ある勝利をもたらしましょう。",	"0",	"0",	"我想要做的，我能做到的，只不过是笨拙地模仿先人罢了。但是，哪怕是如此愚钝的我还是有一点可以向您保证……赌上家族的荣耀，我一定会为您带来光荣的胜利。",	"0",	"cv_Julius_3",	"0",	"0",	"0"},
[400104] = {400104,	10001,	5,	4,	"0",	"idle",	"在這裡停留了這麼久，難道說領航已經很累了嗎？沒關係的，您去休息好了，這裡交給我就行了。",	"ずっとここで作業が止まっているみたいですが、ひょっとしてもうお疲れでしょうか？ナビゲーター。大丈夫です。ここは私に任せて、あなた様は休憩に行ってきてください。",	"0",	"0",	"在这里停留了这么久，难道说领航已经很累了吗？没关系的，您去休息好了，这里交给我就行了。",	"0",	"cv_Julius_4",	"0",	"0",	"0"},
[400105] = {400105,	10001,	6,	4,	"0",	"idle",	"領航，你有看到查麗莎嗎？今天她又沒來訓練……每次也不請一個假，真是讓人擔心的傢伙……",	"ナビゲーター、チャリサーを見ませんでしたか？今日もトレーニングを欠席していて……まったく、困ったものです。休暇届くらい出してほしいのですが……",	"0",	"0",	"领航，你有看到查丽莎吗？今天她又没来训练……每次也不请一个假，真是让人担心的家伙……",	"0",	"cv_Julius_30",	"0",	"0",	"0"},
[400106] = {400106,	10001,	7,	5,	"1_》_0_0.8",	"level1",	"成為駕駛員的理由？啊，一方面是因為我自己本身就非常憧憬這樣的生活，另一方面則是因為我的父親……",	"ドライバーになった理由ですか？それは、私自身がこういう暮らしに憧れていたのと、父が……",	"0",	"0",	"成为驾驶员的理由？啊，一方面是因为我自己本身就非常憧憬这样的生活，另一方面则是因为我的父亲……",	"0",	"cv_Julius_31",	"0",	"0",	"0"},
[400107] = {400107,	10001,	8,	5,	"1_》_0_0.8",	"level1",	"謝謝關心，但是還請您注意形象。",	"お気遣いはありがたいのですが、少しはそうすることで、自分のイメージにどう影響するか…...気にしたほうがいいと思います。",	"0",	"0",	"谢谢关心，但是还请您注意形象。",	"0",	"cv_Julius_5",	"0",	"0",	"0"},
[400108] = {400108,	10001,	9,	5,	"1_》_100_1.5",	"level2",	"怎麼了？我的裝備穿錯了嗎？抱歉，我馬上檢討。",	"どうかしました？私の装備、着方が間違っている…...？それは失礼しまいした。",	"0",	"0",	"怎么了？我的装备穿错了吗？抱歉，我马上检讨。",	"0",	"cv_Julius_6",	"0",	"0",	"0"},
[400109] = {400109,	10001,	10,	5,	"1_》_500_2",	"level3",	"為什麼……會這麼在意我。如果我有讓您不滿意的地方還請直接指出，老用這種眼神看著我，我也會……",	"どうして……そんなに私のことを気にかけてくださるのですか？私に何か至らない点があるのなら、はっきりと言って下されば…...そんな目で見つめられたら、私だって……",	"0",	"0",	"为什么……会这么在意我。如果我有让您不满意的地方还请直接指出，老用这种眼神看着我，我也会……",	"0",	"cv_Julius_7",	"0",	"0",	"0"},
[400110] = {400110,	10001,	11,	5,	"1_》_1000_2.5",	"level4",	"原來如此，最近我已經明白您的感受了。沒錯，現在的我和您心中想的事情是一樣的……但是在沒有結束這一切之前，只是這樣看著彼此，就足夠了。",	"なるほど。最近、私もようやく、あなた様の気持ちが分かるようになってきました。そう。今、私は…...あなた様と同じことを思っていました……でも、全てが終わるまでは、ただこうしてお互い見つめ合うだけで十分です。",	"0",	"0",	"原来如此，最近我已经明白您的感受了。没错，现在的我和您心中想的事情是一样的……但是在没有结束这一切之前，只是这样看着彼此，就足够了。",	"0",	"cv_Julius_8",	"0",	"0",	"0"},
