[400127] = {400127,	10001,	29,	21,	"0",	"0",	"不用太勉強自己，能享受到領航的服務，我已經很滿足了。",	"あまり無理しないでください。ナビゲーターにもてなして頂いて、もう十分幸せです。",	"0",	"0",	"不用太勉强自己，能享受到领航的服务，我已经很满足了。",	"0",	"cv_Julius_25",	"0",	"0",	"0"},
