[400132] = {400132,	10001,	34,	26,	"0",	"0",	"歡迎回來，領航。今天也讓我們一起為了榮耀而戰鬥吧。",	"お帰りなさい、ナビゲーター。今日も一緒に、栄光のために戦いましょう。",	"0",	"0",	"欢迎回来，领航。今天也让我们一起为了荣耀而战斗吧。",	"0",	"cv_Julius_32",	"0",	"0",	"0"},
[400133] = {400133,	10001,	35,	27,	"0",	"0",	"在旅途結束之前，我都將成為您最牢固的盾以及最鋒利的劍。",	"この旅が終わるまで、あなた様の一番丈夫な盾、そして一番鋭利な剣であり続けると誓いましょう。",	"0",	"0",	"在旅途结束之前，我都将成为您最牢固的盾以及最锋利的剑。",	"0",	"cv_Julius_34",	"0",	"0",	"0"},
