[400201] = {400201,	10002,	2,	2,	"0",	"0",	"欸？這樣真的好嗎，我這種人完全不知道該怎麼處理這種情況欸。",	"え？本当にいいのか？こういうとき、どうすればいいのか全然わからないんだが。",	"0",	"0",	"哎？这样真的好吗，我这种人完全不知道该怎么处理这种情况哎。",	"0",	"cv_hank_2",	"0",	"0",	"0"},
[400202] = {400202,	10002,	3,	3,	"0",	"0",	"唷，你就是領航嗎？話先說好，我只是個傭兵喔。",	"よぉ！あんたがナビゲーターか？言っておくが、私はただの傭兵だ。",	"0",	"0",	"哟，你就是领航吗？话先说好，我只是个佣兵哦。",	"0",	"cv_hank_1",	"0",	"0",	"0"},
[400203] = {400203,	10002,	4,	4,	"0",	"idle",	"給多少錢辦多少事，不光光是為了我好也是為了雇主好喔。",	"私は報酬に応じた仕事をする。自分にとっても雇用主にとっても良いことだと思うんだがな。",	"0",	"0",	"给多少钱办多少事，不光光是为了我好也是为了雇主好哦。",	"0",	"cv_hank_3",	"0",	"0",	"0"},
[400204] = {400204,	10002,	5,	4,	"0",	"idle",	"殺戮，殺戮，殺戮，殺戮……這就是我一直以來在做的工作……早在成為駕駛員之前，我就在幹類似的事情了。",	"殺戮、殺戮、殺戮、殺戮……これが私の仕事だ……ドライバーになる前もずっと似たような事をやっていた。",	"0",	"0",	"杀戮，杀戮，杀戮，杀戮……这就是我一直以来在做的工作……早在成为驾驶员之前，我就在干类似的事情了。",	"0",	"cv_hank_4",	"0",	"0",	"0"},
[400205] = {400205,	10002,	6,	4,	"0",	"idle",	"雖然蒂娜是個蠻難相處的傢伙，不過說實話，比起刀子嘴豆腐心的人，我更喜歡像她一樣言行一致的傢伙。",	"確かにティナは扱いにくいやつだけど、でも正直なところ、口が悪いけど心根が優しいっていう女の子より、彼女みたいな言行一致のやつの方がいい。",	"0",	"0",	"虽然蒂娜是个蛮难相处的家伙，不过说实话，比起刀子嘴豆腐心的人，我更喜欢像她一样言行一致的家伙。",	"0",	"cv_hank_28",	"0",	"0",	"0"},
[400206] = {400206,	10002,	7,	5,	"1_》_0_0.8",	"level1",	"加入艾吉斯的理由…嗯……當然是因為雇主給的錢足夠多啊。還有部分原因是因為我很在意那兩個女孩，在過去，我和姐姐的關係也不太好呢。",	"アイギスに入った理由……うーん……それはもちろん、報酬がいいからに決まってるだろ。まぁ、あの二人の女の子のことが気になるからっていうのもなくはないが……昔、私も姉さんとは仲が悪かったからな。",	"0",	"0",	"加入艾吉斯的理由…嗯……当然是因为雇主给的钱足够多啊。还有部分原因是因为我很在意那两个女孩，在过去，我和姐姐的关系也不太好呢。",	"0",	"cv_hank_29",	"0",	"0",	"0"},
[400207] = {400207,	10002,	8,	5,	"1_》_0_0.8",	"level1",	"欸？這是什麼情況啊？",	"ん？どういうことだ？",	"0",	"0",	"哎？这是什么情况啊？",	"0",	"cv_hank_5",	"0",	"0",	"0"},
