[400209] = {400209,	10002,	10,	5,	"1_》_500_2",	"level3",	"還真是少見，除了敵人外，居然還會有主動靠近我的傢伙啊。難道說，你並沒有討厭我嗎？",	"珍しい。敵以外に自分から私に近づいてくるやつがいただなんて。ひょっとして、私のこと、嫌じゃないのか？",	"0",	"0",	"还真是少见，除了敌人外，居然还会有主动靠近我的家伙啊。难道说，你并没有讨厌我吗？",	"0",	"cv_hank_7",	"0",	"0",	"0"},
