[400309] = {400309,	10003,	10,	5,	"1_》_500_2",	"level3",	"領航，我最近發現每次和你獨處的時候。內心就會變得平靜下來……這到底是好事呢？還是壞事？",	"ナビゲーター、最近、あなたと二人きりになると……何だか落ち着くようになる……これは良い事？それとも悪い事？",	"0",	"0",	"领航，我最近发现每次和你独处的时候。内心就会变得平静下来……这到底是好事呢？还是坏事？",	"0",	"cv_morimura_7",	"0",	"0",	"0"},
