[400503] = {400503,	10005,	4,	4,	"0",	"idle",	"我說……你是不是已經有點累了啊？如果累了的話就趕快去休息吧，這裡有小生在就好。",	"あのね……もしかして、疲れてきた？だったら早く休んで！ここはボクに任せて。",	"0",	"0",	"我说……你是不是已经有点累了啊？如果累了的话就赶快去休息吧，这里有小生在就好。",	"0",	"cv_karenn_3",	"0",	"0",	"0"},
[400504] = {400504,	10005,	5,	4,	"0",	"idle",	"輸贏並不是關鍵，重要的是在交手時的心理交流。正所謂不打不相識，只有好好打上一架才能真正瞭解一個人啊。",	"手合わせする時は、勝敗なんかより、心の交流の方が大事だよ。「けんかをしなければ友達になれない」って言うでしょ？人を理解するにはちゃんとした手合わせが必要だってこと。",	"0",	"0",	"输赢并不是关键，重要的是在交手时的心理交流。正所谓不打不相识，只有好好打上一架才能真正了解一个人啊。",	"0",	"cv_karenn_4",	"0",	"0",	"0"},
[400505] = {400505,	10005,	6,	4,	"0",	"idle",	"華夢？啊，她是小生的姐姐，也是小生的對手。從很小的時候我們就在一起修行了。",	"華夢？ああ、あれはボクの姉で、好敵手だよ。小さい頃からずっと一緒に修行してるし。",	"0",	"0",	"华梦？啊，她是小生的姐姐，也是小生的对手。从很小的时候我们就在一起修行了。",	"0",	"cv_karenn_30",	"0",	"0",	"0"},
[400506] = {400506,	10005,	7,	5,	"1_》_0_0.8",	"level1",	"小生自己倒是沒什麼志向，加入艾吉斯也只是單純覺得這裡一定會有小生中意的強者罷了。",	"ボクには個人的な志なんかない。アイギスに入ったのも、ボクの気に入る強者がいそうだと思ったから。ただそれだけ。",	"0",	"0",	"小生自己倒是没什么志向，加入艾吉斯也只是单纯觉得这里一定会有小生中意的强者罢了。",	"0",	"cv_karenn_31",	"0",	"0",	"0"},
