[400509] = {400509,	10005,	10,	5,	"1_》_500_2",	"level3",	"不是這樣的啦，像你這樣的踢腿是沒法將情感傳遞給小生的啦。看好了喔，小生再給你演示一遍。",	"そうじゃなくて……！そんな足蹴りじゃ気持ちをボクに伝えることはできないよ。いい？ボクがもう一回手本をやって見せてあげる。",	"0",	"0",	"不是这样的啦，像你这样的踢腿是没法将情感传递给小生的啦。看好了哦，小生再给你演示一遍。",	"0",	"cv_karenn_7",	"0",	"0",	"0"},
