[400704] = {400704,	10007,	5,	4,	"0",	"idle",	"差不多該到休息的時間了……領航，午飯想吃什麼？",	"そろそろ休憩時間ですね……ナビゲーター、お昼は何がいいですか？",	"0",	"0",	"差不多该到休息的时间了……领航，午饭想吃什么？",	"0",	"cv_uki_4",	"0",	"0",	"0"},
[400705] = {400705,	10007,	6,	4,	"0",	"idle",	"默默……總是讓人不明白她在想什麼。但是那孩子似乎總是表現出一副很孤單的樣子，領航要多關心下她喔。",	"モモ……あのコが何を考えているのか全然分かりません。でも、何だか寂しそうに見えます……優しくしてあげてくださいね、ナビゲーター。",	"0",	"0",	"默默……总是让人不明白她在想什么。但是那孩子似乎总是表现出一副很孤单的样子，领航要多关心下她噢。",	"0",	"cv_uki_28",	"0",	"0",	"0"},
[400706] = {400706,	10007,	7,	5,	"1_》_0_0.8",	"level1",	"戰爭結束之後，海姬想回到故鄉，開一間旅館。每天看著來來往往的旅人，傾聽旅人的故事，治癒旅人的疲憊。",	"戦争が終わったら、私は故郷に帰って旅館をやりたいと思っています。毎日行き来する旅人たちを眺めて、彼らの物語を聞いたりして、疲れを癒してあげたいのです。",	"0",	"0",	"战争结束之后，海姬想回到故乡，开一间旅馆。每天看着来来往往的旅人，倾听旅人的故事，治愈旅人的疲惫。",	"0",	"cv_uki_29",	"0",	"0",	"0"},
