[400709] = {400709,	10007,	10,	5,	"1_》_500_2",	"level3",	"領航，等閒暇的時候，我們一起去旅行吧，只有你和我喔~",	"ナビゲーター、いつか一緒に旅行に行きましょう！私とあなた、二人きりで。",	"0",	"0",	"领航，等闲暇的时候，我们一起去旅行吧，只有你和我噢~",	"0",	"cv_uki_7",	"0",	"0",	"0"},
