[400807] = {400807,	10008,	8,	5,	"1_》_0_0.8",	"level1",	"嗯？領航找我有什麼事嗎？還是說要一起行動？",	"え？私に何かご用ですか、それとも、一緒に行動したい、…...ということでしょうか？",	"0",	"0",	"嗯？领航找我有什么事吗？还是说要一起行动？",	"0",	"cv_dororisu_5",	"0",	"0",	"0"},
[400808] = {400808,	10008,	9,	5,	"1_》_100_1.5",	"level2",	"海鷗，我最喜歡的動物就是它們。看著它們集群劃過碧空的身影，我就會不由自主地想起她們來……",	"カモメは、私の一番好きな動物です。群れで青空を飛んでいく姿を見るたびに、彼女たちのことを思い出すんです……",	"0",	"0",	"海鸥，我最喜欢的动物就是它们。看着它们集群划过碧空的身影，我就会不由自主地想起她们来……",	"0",	"cv_dororisu_6",	"0",	"0",	"0"},
[400809] = {400809,	10008,	10,	5,	"1_》_500_2",	"level3",	"領航，你聽說過北極燕鷗嗎？它們是世界上遷徙路線最長的候鳥。每年都要經歷4萬公里的旅途，往返於兩極的夏日。我總是在隱約中覺得，您也是一隻為了追尋某物而跋山涉水的燕鷗呢。",	"キョクアジサシって聞いたことありますか？最も長距離の渡りをする鳥ですよ。この鳥は年間約4万キロを飛んで、夏を追い求め、両極を往復するんです。ナビゲーターさんも、何かを追い求めるために旅をするキョクアジサシのような方なのかなって、何となくそう思ったんです。",	"0",	"0",	"领航，你听说过北极燕鸥吗？它们是世界上迁徙路线最长的候鸟。每年都要经历4万公里的旅途，往返于两极的夏日。我总是在隐约中觉得，您也是一只为了追寻某物而跋山涉水的燕鸥呢。",	"0",	"cv_dororisu_7",	"0",	"0",	"0"},
[400810] = {400810,	10008,	11,	5,	"1_》_1000_2.5",	"level4",	"大海還真是厲害啊，即便是經歷那樣的戰鬥也能將一切在一夜之間恢復成原樣。這裡已經沒有什麼讓我留戀的了……領航，不久之後也許我也會像候鳥一樣，為了尋回自己那短暫的夏日而啟航吧。",	"海って凄いですね。あんな戦いがあったっていうのに、一晩で元通りに戻りました。ここにはもう、未練はありません……ナビゲーターさん、私ももうすぐ渡り鳥のように、自分の短い夏を取り戻すために旅に出ようかと思うんです。",	"0",	"0",	"大海还真是厉害啊，即便是经历那样的战斗也能将一切在一夜之间恢复成原样。这里已经没有什么让我留恋的了……领航，不久之后也许我也会像候鸟一样，为了寻回自己那短暂的夏日而启航吧。",	"0",	"cv_dororisu_8",	"0",	"0",	"0"},
