[401002] = {401002,	10010,	3,	3,	"0",	"0",	"第三研究室防衛班，阿萊塔。我家的多洛莉絲隊長受你照顧了，謝謝~",	"第三研究室防衛班、アライタ。うちのドロリィス隊長が世話になったようね。礼を言うわ。",	"0",	"0",	"第三研究室防卫班，阿莱塔。我家的多洛莉丝队长受你照顾了，谢谢~",	"0",	"cv_alaita_1",	"0",	"0",	"0"},
[401003] = {401003,	10010,	4,	4,	"0",	"idle",	"“海妖”？的確有人這麼叫我啦…不過，我唱歌並沒有那麼好聽喔？",	"セイレーン？私をそう呼ぶ者もいるけど……私の歌はそんなに上手くないわよ？",	"0",	"0",	"“海妖”？的确有人这么叫我啦…不过，我唱歌并没有那么好听噢？",	"0",	"cv_alaita_3",	"0",	"0",	"0"},
[401004] = {401004,	10010,	5,	4,	"0",	"idle",	"你不覺得那些轉瞬即逝的美麗總是讓人著迷嗎？當然，這其中也包括我自己。",	"一瞬の美しさには、目を奪われてしまうものよ。勿論、私のことも、ね。",	"0",	"0",	"你不觉得那些转瞬即逝的美丽总是让人着迷吗？当然，这其中也包括我自己。",	"0",	"cv_alaita_4",	"0",	"0",	"0"},
[401005] = {401005,	10010,	6,	4,	"0",	"idle",	"多洛莉絲隊長~多洛莉絲隊長~啊…不在啊，那下次再把這些文檔交給她吧。偷懶？不不不，這是沒辦法的事吧。",	"ドロリィス隊長？……ドロリィス隊長？……あら、いないの。じゃあこのファイルを渡すのは今度ね。……サボり？いいえ、これは仕方のないことよ。",	"0",	"0",	"多洛莉丝队长~多洛莉丝队长~啊…不在啊，那下次再把这些文件交给她吧。偷懒？不不不，这是没办法的事吧。",	"0",	"cv_alaita_29",	"0",	"0",	"0"},
[401006] = {401006,	10010,	7,	5,	"1_》_0_0.8",	"level1",	"欸呀，我正好也在找您呢。明天早上有我的演出，要來看看嗎？等演出結束之後，我們正好可以一起去喝杯茶。",	"あら、ちょうど探していたのよ。明日、私の舞台があるの。見に来ない？それで終わったら、一緒にお茶でもどうかしら。",	"0",	"0",	"哎呀，我正好也在找您呢。明天早上有我的演出，要来看看吗？等演出结束之后，我们正好可以一起去喝杯茶。",	"0",	"cv_alaita_30",	"0",	"0",	"0"},
[401007] = {401007,	10010,	8,	5,	"1_》_0_0.8",	"level1",	"對認識不久的異性出手，可不太好喔。",	"知り合ったばかりの女性に手を出すのは感心しないわ。",	"0",	"0",	"对认识不久的异性出手，可不太好噢。",	"0",	"cv_alaita_5",	"0",	"0",	"0"},
[401008] = {401008,	10010,	9,	5,	"1_》_100_1.5",	"level2",	"據說，“海妖”在大海上可是會招來不幸的。那你最好不要和我太親近了……你不在乎嗎？是這樣啊…呵呵。",	"伝説のセイレーンは海で不幸をもたらすもの。あまり私に近づかない方がいいわよ。……そんなの気にしないって？そう……フフ。",	"0",	"0",	"据说，“海妖”在大海上可是会招来不幸的。那你最好不要和我太亲近了……你不在乎吗？是这样啊…呵呵。",	"0",	"cv_alaita_6",	"0",	"0",	"0"},
[401009] = {401009,	10010,	10,	5,	"1_》_500_2",	"level3",	"呵，連領航你也被我的美色迷惑了嗎？那麼，就請好好守護我吧，領航~我也會保護你的~",	"あら。ナビゲーターも私の美しさの虜になったのかしら。それじゃあ、ちゃんと私を守ってちょうだい。私もあなたを守るから。",	"0",	"0",	"呵，连领航你也被我的美色迷惑了吗？那么，就请好好守护我吧，领航~我也会保护你的~",	"0",	"cv_alaita_7",	"0",	"0",	"0"},
[401010] = {401010,	10010,	11,	5,	"1_》_1000_2.5",	"level4",	"我的人生只需如曇花與朝露那樣便好，畢竟，永恆只會讓美麗褪色。領航，現在，就與我一起享受這份短暫的美好吧。",	"私の人生は、花や朝露のように一瞬でいいの。美しさなんて色褪せるだけだもの。さぁナビゲーター。この束の間の美しさを、私と一緒に楽しんでちょうだい。",	"0",	"0",	"我的人生只需如昙花与朝露那样便好，毕竟，永恒只会让美丽褪色。领航，现在，就与我一起享受这份短暂的美好吧。",	"0",	"cv_alaita_8",	"0",	"0",	"0"},
[401011] = {401011,	10010,	12,	6,	"0",	"0",	"不錯的感覺。",	"いい感じね。",	"0",	"0",	"不错的感觉。",	"0",	"cv_alaita_9",	"0",	"0",	"0"},
