[401013] = {401013,	10010,	14,	8,	"0",	"0",	"呵呵……你能感受到嗎，這把劍正在發出喜悅的鳴聲呢。不，並不是在稱讚我的美麗。它一定是因為能夠再一次保護多瑙，保護薩爾而高興吧。",	"ふふ……この剣の喜びが聞こえるかしら？私の美しさはもとより、再びダニューブやサールを守ることができる喜びに違いないわ。",	"0",	"0",	"呵呵……你能感受到吗，这把剑正在发出喜悦的鸣声呢。不，并不是在称赞我的美丽。它一定是因为能够再一次保护多瑙，保护萨尔而高兴吧。",	"0",	"cv_alaita_11",	"0",	"0",	"0"},
