[401102] = {401102,	10011,	3,	3,	"0",	"0",	"我的名字是弱水…眼睛？沒關係，我能看見您的，領航哥哥。",	"私の名前は弱水です。……私の目ですか？大丈夫です。ちゃんと見えてますよ、ナビゲーターのお兄さん。",	"0",	"0",	"我的名字是弱水…眼睛？没关系，我能看见您的，领航哥哥。",	"0",	"cv_ruoshui_1",	"0",	"0",	"0"},
[401103] = {401103,	10011,	4,	4,	"0",	"idle",	"我的眼睛…雖然看得見，但是好像和大家看到的“世界”不一樣…不過這也是沒辦法的事吧？",	"見えてはいるのですが、皆さんが見ている世界とは違うのだそうです。……まあ、それも仕方ないですね。",	"0",	"0",	"我的眼睛…虽然看得见，但是好像和大家看到的“世界”不一样…不过这也是没办法的事吧？",	"0",	"cv_ruoshui_3",	"0",	"0",	"0"},
[401104] = {401104,	10011,	5,	4,	"0",	"idle",	"領航哥哥，昨天的電視劇你看了嗎？那部電視劇雖然各種地方都很爛，但他們想要拍好一部作品的決心卻讓我超感動的！欸？沒看嗎？",	"ナビゲーターのお兄さん、昨日のテレビドラマは見ましたか？色々な意味で最悪なドラマでしたが、良い作品を作ろうという姿勢にすごく感動したんです！えぇ？見てないんですか！？",	"0",	"0",	"领航哥哥，昨天的电视剧你看了吗？那部电视剧虽然各种地方都很烂，但他们想要拍好一部作品的决心却让我超感动的！诶？没看吗？",	"0",	"cv_ruoshui_4",	"0",	"0",	"0"},
[401105] = {401105,	10011,	6,	4,	"0",	"idle",	"冥火！冥火！嗯？她不在這裡嗎…欸，她只要沒有任務的時候，感覺就跟消失了一樣，真神秘呢…我還想找她玩呢！",	"冥火ー？冥火ー？あれ？いない……任務がないとすぐいなくなっちゃうんだから。……一緒に遊ぼうって思ってたのに！",	"0",	"0",	"冥火！冥火！嗯？她不在这里吗…诶，她只要没有任务的时候，感觉就跟消失了一样，真神秘呢…我还想找她玩呢！",	"0",	"cv_ruoshui_29",	"0",	"0",	"0"},
[401106] = {401106,	10011,	7,	5,	"1_》_0_0.8",	"level1",	"以前…因為一些原因，我失去了視力，也因此失去了自己的朋友和家人…不過，一切都過去了，現在的我，只想盡自己所能地幫助大家！",	"ここに来る前に……視力も、友達も、家族も失いました。……でも、それはもう過ぎたことです。今はただ、出来る限りみんなの助けになりたいんです！",	"0",	"0",	"以前…因为一些原因，我失去了视力，也因此失去了自己的朋友和家人…不过，一切都过去了，现在的我，只想尽自己所能地帮助大家！",	"0",	"cv_ruoshui_30",	"0",	"0",	"0"},
