[401108] = {401108,	10011,	9,	5,	"1_》_100_1.5",	"level2",	"哥哥，哥哥，我們一起出去玩吧，我想去遊樂場玩！",	"お兄さんお兄さん、一緒に出かけましょう。遊園地がいいです！",	"0",	"0",	"哥哥，哥哥，我们一起出去玩吧，我想去游乐场玩！",	"0",	"cv_ruoshui_6",	"0",	"0",	"0"},
[401109] = {401109,	10011,	10,	5,	"1_》_500_2",	"level3",	"哥哥，我們一起去看電影吧，首先要做的是去買飲料、爆米花…欸，像約會一樣？……約、約會的話，也不是不行啦。",	"お兄さん、一緒に映画を見に行きましょう。まず飲み物とポップコーンを買って……え、デートみたい？……デ、デートはダメ……じゃないですけど……",	"0",	"0",	"哥哥，我们一起去看电影吧，首先要做的是去买饮料、爆米花…诶，像约会一样？……约、约会的话，也不是不行啦。",	"0",	"cv_ruoshui_7",	"0",	"0",	"0"},
[401110] = {401110,	10011,	11,	5,	"1_》_1000_2.5",	"level4",	"是領航您的話，我不用擔心被背叛，也不用擔心你會突然消失吧…這樣就足夠了。領航，之後也請您一直陪著我吧，我…不想和您分開。",	"お兄さんがナビゲーターなら、私を裏切ったり、ある日突然消えちゃうこともないですよね。……それで十分です。これからもずっと私のそばに居てください。私……お兄さんと離れるのは嫌なんです。",	"0",	"0",	"是领航您的话，我不用担心被背叛，也不用担心你会突然消失吧…这样就足够了。领航，之后也请您一直陪着我吧，我…不想和您分开。",	"0",	"cv_ruoshui_8",	"0",	"0",	"0"},
