[401113] = {401113,	10011,	14,	8,	"0",	"0",	"真是不可思議呢…力量在源源不斷地湧出。嗯，決定了，這份力量，這份強大，只為領航您而存在。今後，不管是什麼樣的敵人，“弱水”都會為了您，將他擊潰！",	"不思議……力がどんどん湧いてきます。うん、決めました。この力、この強さはお兄さんだけのものです。これからどんな敵が現れようとも、お兄さんのために弱水が倒して見せます！",	"0",	"0",	"真是不可思议呢…力量在源源不断地涌出。嗯，决定了，这份力量，这份强大，只为领航您而存在。今后，不管是什么样的敌人，“弱水”都会为了您，将他击溃！",	"0",	"cv_ruoshui_11",	"0",	"0",	"0"},
