[401202] = {401202,	10012,	3,	3,	"0",	"0",	"您好，我是第三研究室防衛班的新成員，格洛麗亞。從今天開始，您便是我的領航了。",	"はじめまして。第三研究室防衛班の新メンバーで、グロリアと申します。本日から、貴方が私のナビゲーターです。",	"0",	"0",	"您好，我是第三研究室防卫班的新成员，格洛丽亚。从今天开始，您便是我的领航了。",	"0",	"cv_guroria_1",	"0",	"0",	"0"},
[401203] = {401203,	10012,	4,	4,	"0",	"idle",	"領航先生，我有一個疑惑…艾吉斯的規章制度，只有那一點嗎？是嗎…這樣啊。嗯，真好啊。",	"ナビゲーターさん、少しお聞きしたいのですが……アイギスの規則はこれだけでしょうか？そう…ですか。なるほど。いいですね。",	"0",	"0",	"领航先生，我有一个疑惑…艾吉斯的规章制度，只有那一点吗？是吗…这样啊。嗯，真好啊。",	"0",	"cv_guroria_3",	"0",	"0",	"0"},
[401204] = {401204,	10012,	5,	4,	"0",	"idle",	"領航先生，您今天的工作還沒有結束嗎？是嗎，請加油。",	"ナビゲーターさん、まだ今日の仕事が終わっていないのですか？……そうですか。頑張ってください。",	"0",	"0",	"领航先生，您今天的工作还没有结束吗？是吗，请加油。",	"0",	"cv_guroria_4",	"0",	"0",	"0"},
[401205] = {401205,	10012,	6,	4,	"0",	"idle",	"多洛莉絲學姐？啊…她是一個好人，和她相處久了能學到不少東西。您也是這麼認為的吧，領航先生。",	"ドロリィス先輩ですか？ええ、素晴らしいお方です。一緒にいれば、きっと沢山の学びが得られることでしょう。ナビゲーターさんもそう思ってらっしゃるのでは？",	"0",	"0",	"多洛莉丝学姐？啊…她是一个好人，和她相处久了能学到不少东西。您也是这么认为的吧，领航先生。",	"0",	"cv_guroria_29",	"0",	"0",	"0"},
[401206] = {401206,	10012,	7,	5,	"1_》_0_0.8",	"level1",	"艾吉斯…對我而言，是一次新的開始。我想試著…開始新的生活。…領航先生，請不要在意，我只是在自言自語。",	"アイギス……私の新たなスタート……新しい生活を、始められる……あ。ナビゲーターさん、お気になさらないでください。ただの独り言ですから。",	"0",	"0",	"艾吉斯…对我而言，是一次新的开始。我想试着…开始新的生活。…领航先生，请不要在意，我只是在自言自语。",	"0",	"cv_guroria_30",	"0",	"0",	"0"},
[401207] = {401207,	10012,	8,	5,	"1_》_0_0.8",	"level1",	"嗯？請問，有什麼事嗎？",	"はい？あの……どうしたのですか？",	"0",	"0",	"嗯？请问，有什么事吗？",	"0",	"cv_guroria_5",	"0",	"0",	"0"},
[401208] = {401208,	10012,	9,	5,	"1_》_100_1.5",	"level2",	"領航先生…您如果有空的話，工作結束後能和我聊聊嗎？我有很多想對您說的話，不過，如果給您添麻煩了，就算了。",	"ナビゲーターさん……お仕事の後に少しお時間よろしいですか？もしご迷惑でないなら、お話ししたいことが沢山あるのです。",	"0",	"0",	"领航先生…您如果有空的话，工作结束后能和我聊聊吗？我有很多想对您说的话，不过，如果给您添麻烦了，就算了。",	"0",	"cv_guroria_6",	"0",	"0",	"0"},
[401209] = {401209,	10012,	10,	5,	"1_》_500_2",	"level3",	"領航先生，待在您身邊…有一種輕鬆感，就像是，把什麼沉重的東西卸下來了一樣。您或許能成為我…唯一的“理解者”。",	"ナビゲーターさん、貴方のそばにいると……心の中にある大きな重いものがすっと消えるような、軽やかな気持ちになるのです。もしかすると、貴方は私の……唯一の理解者になってくださるのでしょうか……？",	"0",	"0",	"领航先生，待在您身边…有一种轻松感，就像是，把什么沉重的东西卸下来了一样。您或许能成为我…唯一的“理解者”。",	"0",	"cv_guroria_7",	"0",	"0",	"0"},
[401210] = {401210,	10012,	11,	5,	"1_》_1000_2.5",	"level4",	"領航先生…不，我的“理解者”，你就是我一直在尋找著的，唯一一個想要瞭解我，能夠理解我的，只屬於我的“理解者”。",	"ナビゲーターさん……いえ、私の理解者である貴方こそ、私が探し続けたただ一人の人。私を理解しようと思ってくださる、そして理解してくださる人。私だけの……理解者。",	"0",	"0",	"领航先生…不，我的“理解者”，你就是我一直在寻找着的，唯一一个想要了解我，能够理解我的，只属于我的“理解者”。",	"0",	"cv_guroria_8",	"0",	"0",	"0"},
[401211] = {401211,	10012,	12,	6,	"0",	"0",	"升級？喔，謝謝。",	"レベルアップですか？ありがとうございます。",	"0",	"0",	"升级？哦，谢谢。",	"0",	"cv_guroria_9",	"0",	"0",	"0"},
[401212] = {401212,	10012,	13,	7,	"0",	"0",	"階級提升，謝謝。",	"ランクアップ、ありがとうございます。",	"0",	"0",	"阶级提升，谢谢。",	"0",	"cv_guroria_10",	"0",	"0",	"0"},
[401213] = {401213,	10012,	14,	8,	"0",	"0",	"領航先生…一直以來，我十分感謝您對我的幫助…可，這些並不是我所希望的。領航先生…能，離我更近一些嗎？",	"ナビゲーターさん…いつも私に良くしてくださって、ありがとうございます。……ですが、私の本当の望みは、違うのです。ナビゲーターさん……もっと近くに来ていただけますか？",	"0",	"0",	"领航先生…一直以来，我十分感谢您对我的帮助…可，这些并不是我所希望的。领航先生…能，离我更近一些吗？",	"0",	"cv_guroria_11",	"0",	"0",	"0"},
[401214] = {401214,	10012,	15,	9,	"0",	"0",	"謝謝您，領航先生。",	"ありがとうございます、ナビゲーターさん。",	"0",	"0",	"谢谢您，领航先生。",	"0",	"cv_guroria_12",	"0",	"0",	"0"},
