[401302] = {401302,	10013,	3,	3,	"0",	"0",	"啊，熟悉的味道啊。你就是那個真正的通感者吧。話先說在前面，我討厭所有的通感者，當然也包括我自己。",	"ああ、懐かしい匂い…...あなたが真の通感覚者なのね。先に言っておくけど、私、通感覚者のことが嫌いなの。もちろん、私自身も含めて。",	"0",	"0",	"啊，熟悉的味道啊。你就是那个真正的通感者吧。话先说在前面，我讨厌所有的通感者，当然也包括我自己。",	"0",	"cv_lilith_1",	"0",	"0",	"0"},
[401303] = {401303,	10013,	4,	4,	"0",	"idle",	"身為真正的通感者，你應該也能聽得到吧？大家的恐懼，憎恨以及……絕望。",	"真の通感覚者のあなたなら、聞こえるんじゃない？みんなの恐怖、憎悪、そして……絶望。",	"0",	"0",	"身为真正的通感者，你应该也能听得到吧？大家的恐惧，憎恨以及……绝望。",	"0",	"cv_lilith_3",	"0",	"0",	"0"},
[401304] = {401304,	10013,	5,	4,	"0",	"idle",	"在這裡浪費時間毫無意義，既然我是你的屬下，就趕快給我佈置任務吧。",	"ここで時間を費やしても意味がない。ここでは私はあなたの部下なのだから、早く指示を出してちょうだい。",	"0",	"0",	"在这里浪费时间毫无意义，既然我是你的属下，就赶快给我布置任务吧。",	"0",	"cv_lilith_4",	"0",	"0",	"0"},
[401305] = {401305,	10013,	6,	4,	"0",	"idle",	"藍莓蛋糕……斯卡蒂，你又偷偷吃了我的藍莓蛋糕了吧？不要再裝了，你心裡想的我全都知道了。",	"スカディ、また私のブルーベリーケーキをこっそりつまみ食いしたでしょ？知らないふりをしたって無駄よ。何を考えてるのか、私には分かる。",	"0",	"0",	"蓝莓蛋糕……斯卡蒂，你又偷偷吃了我的蓝莓蛋糕了吧？不要再装了，你心里想的我全都知道了。",	"0",	"cv_lilith_28",	"0",	"0",	"0"},
[401306] = {401306,	10013,	7,	5,	"1_》_0_0.8",	"level1",	"怎麼了？我喜歡吃甜食很奇怪嗎？",	"どうしたの？私がスイーツ好きなのが、そんなに驚くこと？",	"0",	"0",	"怎么了？我喜欢吃甜食很奇怪吗？",	"0",	"cv_lilith_29",	"0",	"0",	"0"},
[401307] = {401307,	10013,	8,	5,	"1_》_0_0.8",	"level1",	"如果可以的話，將我當作是工具就好了。",	"私を道具として使っていいよ。",	"0",	"0",	"如果可以的话，将我当作是工具就好了。",	"0",	"cv_lilith_5",	"0",	"0",	"0"},
[401308] = {401308,	10013,	9,	5,	"1_》_100_1.5",	"level2",	"既然你也能接受到他人的負面情感的話，那麼我們姑且也能算作是通感者中的同類了吧。",	"もし、あなたも他人の負の感情を感じられると言うのなら、私たちは、通感覚者の中でも同類であると言えるね。",	"0",	"0",	"既然你也能接受到他人的负面情感的话，那么我们姑且也能算作是通感者中的同类了吧。",	"0",	"cv_lilith_6",	"0",	"0",	"0"},
[401309] = {401309,	10013,	10,	5,	"1_》_500_2",	"level3",	"一直以來都很辛苦吧，雖然不清楚為什麼你對此還是一副無所謂的態度。但是我很清楚，你的痛楚，你的自責……",	"辛いでしょ？あなたが何故そのようにどうでもいいみたいな態度をとってるのかは知らないけど。でも、私は知ってる。あなたの苦しみと自責の念……",	"0",	"0",	"一直以来都很辛苦吧，虽然不清楚为什么你对此还是一副无所谓的态度。但是我很清楚，你的痛楚，你的自责……",	"0",	"cv_lilith_7",	"0",	"0",	"0"},
[401310] = {401310,	10013,	11,	5,	"1_》_1000_2.5",	"level4",	"是同伴而不是同類嗎……隨便你怎麼說吧，我只是你的工具而已。不過在戰鬥的時候還請不要再對我使用通感了，我可不希望你的痛苦翻倍。",	"同類じゃなくて仲間、か……勝手にすれば。私はただの道具だわ。あなたの道具。でも、戦ってる時は私に対して通感覚をしないで。あなたの苦しみを増やしたくないから。",	"0",	"0",	"是同伴而不是同类吗……随便你怎么说吧，我只是你的工具而已。不过在战斗的时候还请不要再对我使用通感了，我可不希望你的痛苦翻倍。",	"0",	"cv_lilith_8",	"0",	"0",	"0"},
