[401503] = {401503,	10015,	4,	4,	"0",	"idle",	"打雪仗是我在卡佳最喜歡的娛樂活動了。不管多麼用力地扔出去，都不會傷到人，這不是很好的娛樂活動嗎？",	"0",	"0",	"0",	"打雪仗是我在卡佳最喜欢的娱乐活动了。不管多么用力地扔出去，都不会伤到人，这不是很好的娱乐活动吗？",	"0",	"cv_sofia_3",	"0",	"0",	"0"},
