[401705] = {401705,	10017,	6,	4,	"0",	"idle",	"與原罪戰鬥當然會害怕啦，但是本小姐的貴族血統可不允許害怕。作為前線小隊的成員每一次任務都是在用生命進行戰鬥，這點本小姐早就已經有覺悟了。",	"0",	"0",	"0",	"与原罪战斗当然会害怕啦，但是本小姐的贵族血统可不允许害怕。作为前线小队的成员每一次任务都是在用生命进行战斗，这点本小姐早就已经有觉悟了。",	"0",	"cv_rosalind_29",	"0",	"0",	"0"},
