[402110] = {402110,	10021,	11,	5,	"1_》_1000_2.5",	"level4",	"正如你所見，她就像是我的影子一樣。如果你不介意的話，我們三個人就像現在這樣相處就好……",	"ご覧の通り、私とシンミアは表裏一体の存在。もしあなたが宜しければ、私達三人、このままで……いたいです……",	"0",	"0",	"0",	"0",	"cv_xinxiya_8",	"0",	"0",	"0"},
