[410103] = {410103,	11001,	4,	4,	"0",	"idle",	"即便身處異鄉，我也不會忘記自己是克雷蒂亞家的長女。",	"異郷の地とて、クリティア家の長女であることを、決して忘れることはありません。",	"0",	"0",	"即便身处异乡，我也不会忘记自己是克雷蒂亚家的长女。",	"0",	"cv_alice_3",	"0",	"0",	"0"},
[410104] = {410104,	11001,	5,	4,	"0",	"idle",	"準備好了的話就出擊吧，領航。讓你見識一下克雷蒂亞家正統繼承人的劍藝。",	"ご用意ができましたら出撃しましょう、ナビゲーター。クリティア家の正統なる後継者の剣術を披露して差し上げます。",	"0",	"0",	"准备好了的话就出击吧，领航。让你见识一下克雷蒂亚家正统继承人的剑艺。",	"0",	"cv_alice_4",	"0",	"0",	"0"},
[410105] = {410105,	11001,	6,	4,	"0",	"idle",	"靜雖然是個沒有上進心的孩子，但是不知道為什麼我很喜歡和她待在一起……總覺得，她比起貓咪更像是倉鼠呢……",	"ギンは確かに向上心がないコですが、何故か彼女と一緒にいるのが大好きで……彼女って、どちらかというと猫より絹毛鼠の方に似ていますよね……",	"0",	"0",	"静虽然是个没有上进心的孩子，但是不知道为什么我很喜欢和她呆在一起……总觉得，她比起猫咪更像是仓鼠呢……",	"0",	"cv_alice_30",	"0",	"0",	"0"},
[410106] = {410106,	11001,	7,	5,	"1_》_0_0.8",	"level1",	"在回到多瑙之前，我必須要足夠強大才行啊，否則的話即便是回去了也改變不了什麼。",	"ダニューブに帰る前にもっと強くなっておかなければなりません。そうでなければ、帰ったところで何も変えられないでしょう。",	"0",	"0",	"在回到多瑙之前，我必须要足够强大才行啊，否则的话即便是回去了也改变不了什么。",	"0",	"cv_alice_31",	"0",	"0",	"0"},
