[410108] = {410108,	11001,	9,	5,	"1_》_100_1.5",	"level2",	"為了遠離家族內部的派系鬥爭，我和靜從小就被安置在了瑪雅。不知不覺中已經快忘記父母的樣貌了……",	"一族内の派閥争いに巻き込まれないよう、私たちとギンは幼い頃からマヤに預けられました。気付いたら、いつの間にか両親の姿まで忘れかけていました……",	"0",	"0",	"为了远离家族内部的派系斗争，我和静从小就被安置在了玛雅。不知不觉中已经快忘记父母的样貌了……",	"0",	"cv_alice_6",	"0",	"0",	"0"},
[410109] = {410109,	11001,	10,	5,	"1_》_500_2",	"level3",	"這是……泡芙嗎？真是令人懷念的味道啊……以前經常和靜一起去家對面的甜品店偷偷買回來吃呢。",	"これは……シュークリームですか？懐かしい味です……昔、よくギンと一緒に家の向こうにあるデザート屋に行って、こっそり買って食べていたんです。",	"0",	"0",	"这是……泡芙吗？真是令人怀念的味道啊……以前经常和静一起去家对面的甜品店偷偷买回来吃呢。",	"0",	"cv_alice_7",	"0",	"0",	"0"},
[410110] = {410110,	11001,	11,	5,	"1_》_1000_2.5",	"level4",	"這麼多年，我的腦海中只有一件事……那就是回家。但是無論是蒂娜老師還是父母都覺得我還不夠成熟……",	"長い間、私の頭の中をいっぱいにしているのは一つ――それは、家に帰ること。でも、ティナ先生も、両親も、皆私のことをまだ未熟者だと思っていて……",	"0",	"0",	"这么多年，我的脑海中只有一件事……那就是回家。但是无论是蒂娜老师还是父母都觉得我还不够成熟……",	"0",	"cv_alice_8",	"0",	"0",	"0"},
