[410204] = {410204,	11002,	5,	4,	"0",	"idle",	"茶味花香嗎……這兩者都是老身所喜好的，沒想到出生在多瑙的您也懂得欣賞這些，真是難得。",	"お茶の香りとお花の香りですか……二つとも、吾の好物です。まさかダニューブ出身のあなた様に見る目があったとは。驚きですね。",	"0",	"0",	"茶味花香吗……这两者都是老身所喜好的，没想到出生在多瑙的您也懂得欣赏这些，真是难得。",	"0",	"cv_kokorokami_4",	"0",	"0",	"0"},
[410205] = {410205,	11002,	6,	4,	"0",	"idle",	"瑩草姐……不對，應該是小瑩草才是……如果當著她的面說錯稱呼估計會被殺掉吧。",	"蛍草姉さま……いえ、蛍草ちゃん、と呼ぶべきでしょう……彼女の前で呼び名を間違えたら殺されかねません。",	"0",	"0",	"莹草姐……不对，应该是小莹草才是……如果当着她的面说错称呼估计会被杀掉吧。",	"0",	"cv_kokorokami_30",	"0",	"0",	"0"},
[410206] = {410206,	11002,	7,	5,	"1_》_0_0.8",	"level1",	"神明只有在動亂時才有存在的價值，老身只不過是被這樣的使命驅使著前行罷了。",	"神様は動乱時にのみ存在価値があります。吾はただ、使命に駆られて前に進んでいるだけです。",	"0",	"0",	"神明只有在动乱时才有存在的价值，老身只不过是被这样的使命驱使着前行罢了。",	"0",	"cv_kokorokami_31",	"0",	"0",	"0"},
[410207] = {410207,	11002,	8,	5,	"1_》_0_0.8",	"level1",	"可以請您私下再說嗎？現在老身並沒有空。",	"後にしていただけますか？今は忙しいのです。",	"0",	"0",	"可以请您私下再说吗？现在老身并没有空。",	"0",	"cv_kokorokami_5",	"0",	"0",	"0"},
[410208] = {410208,	11002,	9,	5,	"1_》_100_1.5",	"level2",	"怎麼？又來找老身了嗎？很抱歉，下次有空時會提前告知您的。",	"また吾の所へ来たのですか？申し訳ありません。時間ができた時に、また連絡いたしますので。",	"0",	"0",	"怎么？又来找老身了吗？很抱歉，下次有空时会提前告知您的。",	"0",	"cv_kokorokami_6",	"0",	"0",	"0"},
[410209] = {410209,	11002,	10,	5,	"1_》_500_2",	"level3",	"真是個執著的男人啊，那麼您想和老身聊些什麼呢？放心好了，身為侍奉神明的巫女，我會耐心回答完您所有的疑問。",	"しつこい方ですね。では、吾とどんな話をしたいのですか？ご安心ください。神様に仕える巫女として、あなた様の質問全てに、根気よくお答えします。",	"0",	"0",	"真是个执着的男人啊，那么您想和老身聊些什么呢？放心好了，身为侍奉神明的巫女，我会耐心回答完您所有的疑问。",	"0",	"cv_kokorokami_7",	"0",	"0",	"0"},
[410210] = {410210,	11002,	11,	5,	"1_》_1000_2.5",	"level4",	"啊……想必已經被發現了吧，我口中的神明，愛好……甚至我的姓名都是虛假的。沒錯，這段時間與您相處的女孩只不過是虛偽的化身，信仰的人偶罷了……什麼？您說無論哪邊的我在您眼中都是……真實的嗎……",	"ああ……もうばれてしまったのですね。吾が申し上げた神様、趣味……そして自分の名前は、全て嘘ですそう、今まであなた様とともに過ごしてきた吾は、ただの偽りの存在、信仰の人形にすぎません……えっ？どの吾でも、あなた様にとっては……真の存在である、と…...？",	"0",	"0",	"啊……想必已经被发现了吧，我口中的神明，爱好……甚至我的姓名都是虚假的。没错，这段时间与您相处的女孩只不过是虚伪的化身，信仰的人偶罢了……什么？您说无论哪边的我在您眼中都是……真实的吗……",	"0",	"cv_kokorokami_8",	"0",	"0",	"0"},
