[410213] = {410213,	11002,	14,	8,	"0",	"0",	"落櫻紛飛，刹那芳華，何為虛影，傾此半生。但您的心意，已經傳達到了。",	"桜の花びらが舞い上がる、その美しさは一瞬のこと。そんな偽りの景色を求めるために、なぜ人は生涯をかけるのでしょうか……とはいえ、あなた様のお気持ち、しっかりと受け止めさせていただきました。",	"0",	"0",	"落樱纷飞，刹那芳华，何为虚影，倾此半生。但您的心意，已经传达到了。",	"0",	"cv_kokorokami_11",	"0",	"0",	"0"},
