[410305] = {410305,	11003,	6,	4,	"0",	"idle",	"不知火那孩子，總是用看小孩的目光看著咱呢。呼呼呼，對於咱來說，她才是需要照顧的孩子呢。因為，咱才是這支隊伍的隊長呀。",	"不知火はいつも子供を見る目でうちを見とるけど、ふふ、うちにとっては、あいつこそ世話する必要がある子供なんやで。だって、うちがこのチームの隊長やからね！",	"0",	"0",	"不知火那孩子，总是用看小孩的目光看着咱呢。呼呼呼，对于咱来说，她才是需要照顾的孩子呢。因为，咱才是这支队伍的队长呀。",	"0",	"cv_suzuki_30",	"0",	"0",	"0"},
