[410402] = {410402,	11004,	3,	3,	"0",	"0",	"初次見面，我是來自風林火山部隊的栗山青鸞。那個……我的身體應該沒有嚇到您吧？",	"初めまして。私は風林火山部隊の栗山青鸞です。あの……私の身体、怖くないでしょうか……？",	"0",	"0",	"初次见面，我是来自风林火山部队的栗山青鸾。那个……我的身体应该没有吓到您吧？",	"0",	"cv_kuriyama_1",	"0",	"0",	"0"},
[410403] = {410403,	11004,	4,	4,	"0",	"idle",	"我的身體……很嚇人吧？如果讓您感到不舒服的話我馬上就離開這裡。欸？你說不用放在心上？",	"私の身体……怖いでしょう？見てて気分が悪くなるとか…...すみません、すぐここを離れますから。え？気にすることはない、ですか？",	"0",	"0",	"我的身体……很吓人吧？如果让您感到不舒服的话我马上就离开这里。哎？你说不用放在心上？",	"0",	"cv_kuriyama_3",	"0",	"0",	"0"},
[410404] = {410404,	11004,	5,	4,	"0",	"idle",	"這個孩子的名字叫做太郎，我和它的視覺是共用的喔。它很厲害吧，嘿嘿。",	"このコは太郎っていいます。視覚を共有しているんですよ。このコ、凄いでしょ？えへへ。",	"0",	"0",	"这个孩子的名字叫做太郎，我和他的视觉是共享的哦。它很厉害吧，嘿嘿。",	"0",	"cv_kuriyama_4",	"0",	"0",	"0"},
[410405] = {410405,	11004,	6,	4,	"0",	"idle",	"今天又沒能好好和鬼之介說上話呢……雖然她總是一副生氣的樣子，但是我還是覺得她其實是個好孩子。",	"今日も、鬼之介とはちゃんと話せなかったですね……いつも怒っているみたいですけど、嫌われているというよりは、ただの子供なんだと、思います。",	"0",	"0",	"今天又没能好好和鬼之介说上话呢……虽然她总是一副生气的样子，但是我还是觉得她其实是个好孩子。",	"0",	"cv_kuriyama_28",	"0",	"0",	"0"},
[410406] = {410406,	11004,	7,	5,	"1_》_0_0.8",	"level1",	"領航……戰爭結束了之後，您能和我一起去一個地方嗎？有些話，只有在那裡才能告訴領航。欸？什麼話……嗚，現在還不能說！",	"ナビゲーター……戦争が終わったら、ある場所に一緒に行っていただけませんか？そこでしか話せないことがあって。え？何の話って……ま、まだ内緒です！",	"0",	"0",	"领航……战争结束了之后，您能和我一起去一个地方吗？有些话，只有在那里才能告诉领航。诶？什么话……呜，现在还不能说！",	"0",	"cv_kuriyama_29",	"0",	"0",	"0"},
[410407] = {410407,	11004,	8,	5,	"1_》_0_0.8",	"level1",	"欸？週末想要和我一起出去玩？但是…我的身體……大家會害怕的……",	"え？週末は私と一緒に出掛けたい、ですか？でも……私の身体が…...それに、一緒にいると……あなたまで怖がられてしまいますよ。",	"0",	"0",	"哎？周末想要和我一起出去玩？但是…我的身体……大家会害怕的……",	"0",	"cv_kuriyama_5",	"0",	"0",	"0"},
[410408] = {410408,	11004,	9,	5,	"1_》_100_1.5",	"level2",	"這裡是……幼稚園？原來如此，一起出去玩的意思是做義工啊。但是我的身體真的不會嚇到孩子們嗎？",	"ここは……幼稚園ですか？なるほど、出掛けるとはボランティアのことだったのですね。でも、私の身体を見たら……子供たちは本当に大丈夫でしょうか？怖くないのでしょうか…...？",	"0",	"0",	"这里是……幼儿园？原来如此，一起出去玩的意思是做义工啊。但是我的身体真的不会吓到孩子们吗？",	"0",	"cv_kuriyama_6",	"0",	"0",	"0"},
[410409] = {410409,	11004,	10,	5,	"1_》_500_2",	"level3",	"馬……馬上就來！姐姐的手臂一次性能拎起3桶水呢！欸？是領航嗎？！不……不好意思，不經意間就和孩子們打成一片了。",	"す、すぐに来るから！お姉さんはバケツを三つも持てるのよ！えっ？ナビゲーター？！す、すみません……子供たちがなついてくれて……",	"0",	"0",	"马……马上就来！姐姐的手臂一次性能拎起3桶水呢！哎？是领航吗？！不……不好意思，不经意间就和孩子们打成一片了。",	"0",	"cv_kuriyama_7",	"0",	"0",	"0"},
[410410] = {410410,	11004,	11,	5,	"1_》_1000_2.5",	"level4",	"醜陋的就是醜陋的，無論如何我的身體都無法被稱之為美麗的。曾經我也因為這種事情而痛苦過，失落過。但是因為您的緣故，我想我也會開始慢慢接受這樣的自己了吧。",	"醜いものは醜いです。私の身体、綺麗とは言い難いでしょう。今まではこの体の事でずっと悩んでいて、落ち込んでいました。でも、あなた様のお陰で、これからはありのままの自分を受け入れられるような気がします。",	"0",	"0",	"丑陋的就是丑陋的，无论如何我的身体都无法被称之为美丽的。曾经我也因为这种事情而痛苦过，失落过。但是因为您的缘故，我想我也会开始慢慢接受这样的自己了吧。",	"0",	"cv_kuriyama_8",	"0",	"0",	"0"},
