[410601] = {410601,	11006,	2,	2,	"0",	"0",	"喔~這個位置不錯啊，看來能拍攝的素材又變多了。就是如果能再隱蔽點就好了。",	"おぉ～、ここいいね。撮影できる素材が増えるそうだよ。もうちょっと隠蔽性が高かったらなぁ。",	"0",	"0",	"噢~这个位置不错啊，看来能拍摄的素材又变多了。就是如果能再隐蔽点就好了。",	"0",	"cv_jenny_2",	"0",	"0",	"0"},
[410602] = {410602,	11006,	3,	3,	"0",	"0",	"呦~聽說這邊有大新聞俺就來了，初次見面，俺叫燕妮·羅斯。",	"よぉ！ここにビッグニュースがあるって聞いたんだ。俺はジェニィ・ロス。よろしくおな。",	"0",	"0",	"呦~听说这边有大新闻俺就来了，初次见面，俺叫燕妮·罗斯。",	"0",	"cv_jenny_1",	"0",	"0",	"0"},
[410603] = {410603,	11006,	4,	4,	"0",	"idle",	"啊？大新聞？在哪裡！在哪裡！前面礙事的傢伙，趕快閃開啊！欸，原來是你嗎？",	"え？ビッグニュース？どこどこ？！ちょっと、邪魔なんだけど！退けって！あれ？あんただったんだ！",	"0",	"0",	"啊？大新闻？在哪里！在哪里！前面碍事的家伙，赶快闪开啊！哎，原来是你吗？",	"0",	"cv_jenny_3",	"0",	"0",	"0"},
[410604] = {410604,	11006,	5,	4,	"0",	"idle",	"別擔心，俺是絕對不會把武器和相機弄混的。來，笑一個，讓俺給你來上一炮吧。開玩笑的~",	"大丈夫、武器とカメラを間違えるはずがないだろー？ほら、笑えよ。一発射撃するから。冗談だよ、冗談。",	"0",	"0",	"别担心，俺是绝对不会把武器和相机弄混的。来，笑一个，让俺给你来上一炮吧。开玩笑的~",	"0",	"cv_jenny_4",	"0",	"0",	"0"},
[410605] = {410605,	11006,	6,	4,	"0",	"idle",	"我其實一直都在秘密調查茱莉亞的背景，那個傢伙的花錢方式可不像是個普通人家的女兒啊……當然這些都是秘密進行的，絕對不能被她發現……啊！茱……茱莉亞？！你什麼時候跑到我後面的？",	"俺、ジュリアのバックグラウンドを密かに調査してるんだ。あいつの金の使い方を見る限り、普通の家の娘さんじゃねーんだろうが……まぁ、密かにね、密かに。絶対に気付かれちゃだめだ……あっ！ジ、ジュリア？！いつから俺の後ろに……？！",	"0",	"0",	"我其实一直都在秘密调查茱莉亚的背景，那个家伙的花钱方式可不像是个普通人家的女儿啊……当然这些都是秘密进行的，绝对不能被她发现……啊！茱……茱莉亚？！你什么时候跑到我后面的？",	"0",	"cv_jenny_30",	"0",	"0",	"0"},
[410606] = {410606,	11006,	7,	5,	"1_》_0_0.8",	"level1",	"寫不出好的報導的時候自然就會陷入消極情緒，這個時候只要把相機換成炮筒去戰場上大鬧一番就能緩過來了。",	"良い記事が書けないと、落ち込んじまう。そういう時はカメラを大砲に替えて戦場で暴れれば元通りの自分に戻れるってわけ。",	"0",	"0",	"写不出好的报道的时候自然就会陷入消极情绪，这个时候只要把相机换成炮筒去战场上大闹一番就能缓过来了。",	"0",	"cv_jenny_31",	"0",	"0",	"0"},
[410607] = {410607,	11006,	8,	5,	"1_》_0_0.8",	"level1",	"喔吼吼~難道說你對攝影產生興趣了嗎？",	"あっはは、撮影に興味が湧いてきたか？",	"0",	"0",	"呕吼吼~难道说你对摄影产生兴趣了吗？",	"0",	"cv_jenny_5",	"0",	"0",	"0"},
[410608] = {410608,	11006,	9,	5,	"1_》_100_1.5",	"level2",	"成為駕駛員的初衷？當然是為了能夠更方便地收集素材啊。但是……從另一面來說，也可能是因為不想一直都在當旁觀者吧。",	"ドライバーになった理由？それはもちろん、素材が集めやすいからに決まってる。まぁ……ただの傍観者でいたくないっていうのもあったかもしれないな。",	"0",	"0",	"成为驾驶员的初衷？当然是为了能够更方便地收集素材啊。但是……从另一面来说，也可能是因为不想一直都在当旁观者吧。",	"0",	"cv_jenny_6",	"0",	"0",	"0"},
[410609] = {410609,	11006,	10,	5,	"1_》_500_2",	"level3",	"無論是開心的瞬間，還是悲傷的瞬間，只要是能激勵他人的素材俺都會記錄下來。但是對我而言，最重要的還是和夥伴們在一起的瞬間。",	"楽しい瞬間も悲しい瞬間も、人を励ませる素材があれば、俺は全部記録する。でも、俺にとって、一番重要なのはやっぱり仲間たちと一緒にいる瞬間なんだ。",	"0",	"0",	"无论是开心的瞬间，还是悲伤的瞬间，只要是能激励他人的素材俺都会记录下来。但是对我而言，最重要的还是和伙伴们在一起的瞬间。",	"0",	"cv_jenny_7",	"0",	"0",	"0"},
[410610] = {410610,	11006,	11,	5,	"1_》_1000_2.5",	"level4",	"那個……和你認識了這麼久俺好像都沒有出過和你有關的報導呢。其實私底下俺也試著寫過啦。喏，這就是初稿，要記得拿到沒人的地方再拆開喔。",	"あのさ……あんたと知り合ってから随分経つんだけど、俺、あんたに関する報道は一つもしてない。実はこっそり記事を書いてみたんだが……ほら、これが初稿だ。読むなら人のいない所で！",	"0",	"0",	"那个……和你认识了这么久俺好像都没有出过和你有关的报道呢。其实私底下俺也试着写过啦。喏，这就是初稿，要记得拿到没人的地方再拆开哦。",	"0",	"cv_jenny_8",	"0",	"0",	"0"},
[410611] = {410611,	11006,	12,	6,	"0",	"0",	"真是不錯的素材啊~",	"なかなか良い素材だった。",	"0",	"0",	"真是不错的素材啊~",	"0",	"cv_jenny_9",	"0",	"0",	"0"},
