[410704] = {410704,	11007,	5,	4,	"0",	"idle",	"一直盯著大姐姐看是因為遇到什麼麻煩事了嗎？要和大姐姐說說看嗎？",	"ずっと私を見つめてるようだけど、何か困ったことでもあった？お姉さんに話してみない？",	"0",	"0",	"一直盯着大姐姐看是因为遇到什么麻烦事了吗？要和大姐姐说说看吗？",	"0",	"cv_ridelia_4",	"0",	"0",	"0"},
[410705] = {410705,	11007,	6,	4,	"0",	"idle",	"真是的，瑪利亞那個傢伙又犯老毛病了？不是每個人都能接受她那種問候方式吧。",	"もうっ……マリアったら！またいつものあれ？あんな挨拶、みんながみんな受け入れられるわけないでしょ。",	"0",	"0",	"真是的，玛利亚那个家伙又犯老毛病了？不是每个人都能接受她那种问候方式吧。",	"0",	"cv_ridelia_29",	"0",	"0",	"0"},
[410706] = {410706,	11007,	7,	5,	"1_》_0_0.8",	"level1",	"卡佳是個冰冷的地方，不光光是環境，還有那裡的人心……",	"カティアはとても寒い場所なの。環境そのものだけでなく、人の心もね……",	"0",	"0",	"卡佳是个冰冷的地方，不光光是环境，还有那里的人心……",	"0",	"cv_ridelia_30",	"0",	"0",	"0"},
