[410709] = {410709,	11007,	10,	5,	"1_》_500_2",	"level3",	"嘿嘿嘿，總覺得在你面前我都不好意思叫自己是姐姐了呢。你是一個值得依靠和信賴的對象，領航。",	"ふふ、あなたの前でお姉さんを名乗るのが何だか恥ずかしいなぁって。あなたはとても頼もしい人だよ、ナビゲーター。",	"0",	"0",	"嘿嘿嘿，总觉得在你面前我都不好意思叫自己是姐姐了呢。你是一个值得依靠和信赖的对象，领航。",	"0",	"cv_ridelia_7",	"0",	"0",	"0"},
[410710] = {410710,	11007,	11,	5,	"1_》_1000_2.5",	"level4",	"等戰爭結束後要來姐姐的家鄉看看嗎？其實很早之前就想邀請你去玩一趟了，但是一直都沒找到合適的機會說罷了。當然，你可不能拒絕姐姐喔~為什麼？嘿嘿嘿，就當做是姐姐在撒嬌好了。",	"戦争が終わったら、私の故郷に来てみない？ずっと前から誘おうと思ったの。でも、なかなか言い出す機会がなくて……もちろん、拒否権はないよ。なんでって？ふふ、そうだね、お姉さんがあなたに甘えてるってことで。",	"0",	"0",	"等战争结束后要来姐姐的家乡看看吗？其实很早之前就想邀请你去玩一趟了，但是一直都没找到合适的机会说罢了。当然，你可不能拒绝姐姐哦~为什么？嘿嘿嘿，就当做是姐姐在撒娇好了。",	"0",	"cv_ridelia_8",	"0",	"0",	"0"},
[410711] = {410711,	11007,	12,	6,	"0",	"0",	"更依賴姐姐一些吧。",	"もっとお姉さんを頼って。",	"0",	"0",	"更依赖姐姐一些吧。",	"0",	"cv_ridelia_9",	"0",	"0",	"0"},
