[410713] = {410713,	11007,	14,	8,	"0",	"0",	"真是……我已經不知道該如何表達自己現在的感情了。領航，可以讓姐姐抱一下你嗎？如果能聽到我的心跳聲的話，你應該就能明白了吧。",	"もうっ……自分の感情をどうやって表せばいいのか分からなくなってきたみたい。ね、ナビゲーター。抱きしめさせてくれない？私の心臓の音を聞いたら、きっと分かってくれると思うわ。",	"0",	"0",	"真是……我已经不知道该如何表达自己现在的感情了。领航，可以让姐姐抱一下你吗？如果能听到我的心跳声的话，你应该就能明白了吧。",	"0",	"cv_ridelia_11",	"0",	"0",	"0"},
