[410802] = {410802,	11008,	3,	3,	"0",	"0",	"是什麼讓你我相遇呢？是命令？還是音樂？無論如何，從現在開始你我的命運已經連接在一起了。",	"私たちの出会ったきっかけは、命令？それとも音楽？どちらにしても、あなたと私の運命はもう繋がっているのよ。",	"0",	"0",	"是什么让你我相遇呢？是命令？还是音乐？无论如何，从现在开始你我的命运已经连接在一起了。",	"0",	"cv_aishirika_1",	"0",	"0",	"0"},
[410803] = {410803,	11008,	4,	4,	"0",	"idle",	"無論是帶領部隊還是樂隊，我都是超一流的。",	"部隊を率いてもバンドを率いても、私は超一流よ。",	"0",	"0",	"无论是带领部队还是乐队，我都是超一流的。",	"0",	"cv_aishirika_3",	"0",	"0",	"0"},
[410804] = {410804,	11008,	5,	4,	"0",	"idle",	"真希望能有機會在這裡辦場音樂會啊。畢竟，這裡可是匯聚了一批不得了的聽眾呢。",	"ここでコンサートを開ければいいわね。ここには凄いリスナーが集まっているから。",	"0",	"0",	"真希望能有机会在这里办场音乐会啊。毕竟，这里可是汇聚了一批不得了的听众呢。",	"0",	"cv_aishirika_4",	"0",	"0",	"0"},
[410805] = {410805,	11008,	6,	4,	"0",	"idle",	"瓦答娜和薩拉蒂，她們兩個總是讓我不放心。但是，我又擔心自己對她們是不是太嚴厲了一點。該怎麼辦才好呢……",	"ワダーナとサラティーのことが心配だわ。彼女たちには、厳しすぎるんじゃないかと思う時もある。一体、どうしたらいいのかしら……",	"0",	"0",	"瓦答娜和萨拉蒂，她们两个总是让我不放心。但是，我又担心自己对她们是不是太严厉了一点。该怎么办才好呢……",	"0",	"cv_aishirika_30",	"0",	"0",	"0"},
[410806] = {410806,	11008,	7,	5,	"1_》_0_0.8",	"level1",	"如果不成為駕駛員，不終結這場戰爭，大家都沒辦法靜下心聆聽我的音樂了。所以，我必須要戰鬥才行。不過，領航，你不覺得讓原罪成為自己的聽眾，是件很有趣的事嗎！",	"ドライバーになってこの戦争を終わらせないと、皆私の音楽を堪能することができない。だから、私は戦わないといけない。でも、原罪を自分のリスナーにするのってそれはそれで面白いと思うのよね。ナビゲーターどう思う？",	"0",	"0",	"如果不成为驾驶员，不终结这场战争，大家都没办法静下心聆听我的音乐了。所以，我必须要战斗才行。不过，领航，你不觉得让原罪成为自己的听众，是件很有趣的事吗！",	"0",	"cv_aishirika_31",	"0",	"0",	"0"},
[410807] = {410807,	11008,	8,	5,	"1_》_0_0.8",	"level1",	"舞蹈和音樂有著奇妙的力量，你也是這麼覺得吧？",	"ダンスと音楽には不思議な力がある。あなたもそう思うでしょ？",	"0",	"0",	"舞蹈和音乐有着奇妙的力量，你也是这么觉得吧？",	"0",	"cv_aishirika_5",	"0",	"0",	"0"},
[410808] = {410808,	11008,	9,	5,	"1_》_100_1.5",	"level2",	"我曾經有過這樣的幻想。既然原罪能夠受到我的音樂的影響，那麼是不是意味著他們也能聽懂我的演奏呢？既然這樣的話……說不定我們之間還有交流的可能性。",	"私、思ったの。原罪は私の音楽に影響される。ということは、彼らも私の演奏を理解できる可能性があるのかも。だとしたら……私たちは交流できるのかもしれないわね。",	"0",	"0",	"我曾经有过这样的幻想。既然原罪能够受到我的音乐的影响，那么是不是意味着他们也能听懂我的演奏呢？既然这样的话……说不定我们之间还有交流的可能性。",	"0",	"cv_aishirika_6",	"0",	"0",	"0"},
[410809] = {410809,	11008,	10,	5,	"1_》_500_2",	"level3",	"真是少見啊，你突然提出想要聽我的彈奏嗎？好吧，哪怕聽眾只有你一個人我也不會拒絕的。畢竟，你是我最好的朋友嘛。",	"珍しいわね。私の演奏が聞きたいだなんて。まぁいいわ。たとえリスナーがあなた一人でも断ったりはしない。あなたは私の一番の友達だから。",	"0",	"0",	"真是少见啊，你突然提出想要听我的弹奏吗？好吧，哪怕听众只有你一个人我也不会拒绝的。毕竟，你是我最好的朋友嘛。",	"0",	"cv_aishirika_7",	"0",	"0",	"0"},
[410810] = {410810,	11008,	11,	5,	"1_》_1000_2.5",	"level4",	"越是短暫的生命就越是要高聲歌唱，這只是蟬的哲學罷了。無論生命長短，我們都有放聲歌唱的權利。如果我能親眼見證這場戰爭的勝利，那麼我一定會將與你一同經歷過故事寫進歌中。",	"命が短いほど、声を出して歌いたくなる。これが蝉の哲学だわ。命の長さに関係なく、私たちは皆、声を出して歌う権利がある。もしこの戦争の勝利を見届けられたら、あなたと経験したことを歌にするわ。",	"0",	"0",	"越是短暂的生命就越是要高声歌唱，这只是蝉的哲学罢了。无论生命长短，我们都有放声歌唱的权利。如果我能亲眼见证这场战争的胜利，那么我一定会将与你一同经历过故事写进歌中。",	"0",	"cv_aishirika_8",	"0",	"0",	"0"},
[410811] = {410811,	11008,	12,	6,	"0",	"0",	"托你的福，又有新的創作靈感了。",	"お陰で新しいインスピレーションを得たわ。",	"0",	"0",	"托你的福，又有新的创作灵感了。",	"0",	"cv_aishirika_9",	"0",	"0",	"0"},
