[410813] = {410813,	11008,	14,	8,	"0",	"0",	"啊……非常抱歉，每次到這種時候我都會控制不住自己……終於…終於可以奏出真正屬於我們的旋律了。",	"ああっ……ごめんなさい。こういう時いつも自分の感情をコントロールできなくて……やっと……やっと、私たちの真のメロディーを奏でることができるのね。",	"0",	"0",	"啊……非常抱歉，每次到这种时候我都会控制不住自己……终于…终于可以奏出真正属于我们的旋律了。",	"0",	"cv_aishirika_11",	"0",	"0",	"0"},
