[411003] = {411003,	11010,	4,	4,	"0",	"idle",	"瓏……常常因為害怕而從戰場上逃走。多虧了隊伍裡的大家，瓏才能免受責罰。這樣是不對的，可是瓏真的很怕，該怎麼辦才好呢？",	"瓏は……怖いから戦場から逃げてばかりなの。だけど、チームのみんなのお陰で、ペナルティを免れたの。こんなの、良くない。でも、本当に凄く怖いの。どうすればいいのかな？",	"0",	"0",	"珑……常常因为害怕而从战场上逃走。多亏了队伍里的大家，珑才能免受责罚。这样是不对的，可是珑真的很怕，该怎么办才好呢？",	"0",	"cv_long_3",	"0",	"0",	"0"},
[411004] = {411004,	11010,	5,	4,	"0",	"idle",	"瓏很弱……還很膽小，這樣的我，真的能夠得到領航的信任嗎？……但，但是！瓏會加油的，請不要丟下瓏一個人……",	"瓏は弱くて……臆病なの。こんな瓏でも、本当にナビゲーターに信頼してもらえるの？……で、でも！瓏、頑張るから！だから、一人にしないで……",	"0",	"0",	"珑很弱……还很胆小，这样的我，真的能够得到领航的信任吗？……但，但是！珑会加油的，请不要丢下珑一个人……",	"0",	"cv_long_4",	"0",	"0",	"0"},
[411005] = {411005,	11010,	6,	4,	"0",	"idle",	"一直以來，都是渠小姐在保護著瓏……瓏不能再逃了，要為了渠小姐變強才行。",	"瓏、今まではずっと渠さんに守られてて……これ以上は逃げちゃだめ。瓏、渠さんのために強くならなきゃ。",	"0",	"0",	"一直以来，都是渠小姐在保护着珑……珑不能再逃了，要为了渠小姐变强才行。",	"0",	"cv_long_28",	"0",	"0",	"0"},
[411006] = {411006,	11010,	7,	5,	"1_》_0_0.8",	"level1",	"瓏……其實一點也不想戰鬥。但是瓏的家鄉已經沒了，所以，這裡是瓏唯一的歸宿。瓏不想再失去它了！",	"瓏、本当は戦いたくないの。でも、瓏の故郷はもう、ない。だから、ここが瓏の唯一の居場所なの。瓏、この場所を失いたくない！",	"0",	"0",	"珑……其实一点也不想战斗。但是珑的家乡已经没了，所以，这里是珑唯一的归宿。珑不想再失去它了！",	"0",	"cv_long_29",	"0",	"0",	"0"},
