[411105] = {411105,	11011,	6,	4,	"0",	"idle",	"儘管艾吉斯並不是一個表面上那樣完美的的組織…但它救了我，讓我重獲新生也是不爭的事實。所以，我決定將作為“轟雷”的人生…全部奉獻給艾吉斯。",	"アイギスは……特に素晴らしい組織とも言えぬ。だが我を救い、新たな人生を与えてくれたことも紛れのない事実だ。だから我は轟雷としての人生を、全てアイギスに捧げると決意したのだ。",	"0",	"0",	"尽管艾吉斯并不是一个表面上那样完美的的组织…但它救了我，让我重获新生也是不争的事实。所以，我决定将作为“轰雷”的人生…全部奉献给艾吉斯。",	"0",	"cv_honglei_29",	"0",	"0",	"0"},
[411106] = {411106,	11011,	7,	5,	"1_》_0_0.8",	"level1",	"忍心社的成員，平常會偽裝成不起眼的人，來隱藏自己的身份。我們作為艾吉斯的無形之刃，在黑暗中為它服務，直到死亡才會停下，這就是我們的宿命。",	"忍心社の者たちは、目立たぬ一般人として生活することで、己の正体を隠している。アイギスの刃として闇の中で己を研ぎすまし、人知れず錆びていく。これが我らの宿命だ。",	"0",	"0",	"忍心社的成员，平常会伪装成不起眼的人，来隐藏自己的身份。我们作为艾吉斯的无形之刃，在黑暗中为它服务，直到死亡才会停下，这就是我们的宿命。",	"0",	"cv_honglei_30",	"0",	"0",	"0"},
