[411108] = {411108,	11011,	9,	5,	"1_》_100_1.5",	"level2",	"領航，無論多麼骯髒的任務我都會完成的，這就是我的使命。",	"どんな汚い任務でも成し遂げてみせる。これが我が使命だ。",	"0",	"0",	"领航，无论多么肮脏的任务我都会完成的，这就是我的使命。",	"0",	"cv_honglei_6",	"0",	"0",	"0"},
[411109] = {411109,	11011,	10,	5,	"1_》_500_2",	"level3",	"成立“忍心社”的目的，是為了防止像“她”那樣的悲劇再次出現。領航，我不會讓任何人傷害您的…您理應有一個美滿的人生。",	"忍心社を創設した目的は……彼女のような悲劇を二度と生じさせぬこと。……ナビゲーター、誰にも貴殿を傷付けさせぬ。貴殿には幸せな人生を送って欲しいのだ。",	"0",	"0",	"成立“忍心社”的目的，是为了防止像“她”那样的悲剧再次出现。领航，我不会让任何人伤害您的…您理应有一个美满的人生。",	"0",	"cv_honglei_7",	"0",	"0",	"0"},
[411110] = {411110,	11011,	11,	5,	"1_》_1000_2.5",	"level4",	"…領航，我一直認為，只要能夠完成任務，無論是別人的性命，亦或是自己的生命，都不過是消耗品。但，唯有您…只有您，是不同的。",	"……ナビゲーター。我は任務が達成できるのであれば、人の命や自分の命など、ただの消耗品に過ぎないと思っていた。しかしナビゲーター。貴殿だけは……特別なのだ。",	"0",	"0",	"…领航，我一直认为，只要能够完成任务，无论是别人的性命，亦或是自己的生命，都不过是消耗品。但，唯有您…只有您，是不同的。",	"0",	"cv_honglei_8",	"0",	"0",	"0"},
