[411113] = {411113,	11011,	14,	8,	"0",	"0",	"您的這份信任，我會用實績來回報的。請原諒我現在只能用一句簡單的“謝謝”來回應您……",	"貴殿の信頼に、必ずや実績を持って応えよう。今は、感謝の言葉しかない。許してくれ……",	"0",	"0",	"您的这份信任，我会用实绩来回报的。请原谅我现在只能用一句简单的“谢谢”来回应您……",	"0",	"cv_honglei_11",	"0",	"0",	"0"},
