[411401] = {411401,	11014,	2,	2,	"0",	"0",	"哼，你會選擇吾是理所當然的，畢竟吾與汝之間可是存在著不可視的命運紅線在連接著…喂，別走啊，我還沒說完呢！",	"フン、汝が妾を選ぶのは当然だ。汝と妾は、運命の赤い糸で結ばれておるのだからなぁ……ってこら！行くな、まだ話の途中だぁ！",	"0",	"0",	"哼，你会选择吾是理所当然的，毕竟吾与汝之间可是存在着不可视的命运红线在连接着…喂，别走啊，我还没说完呢！",	"0",	"cv_sikadi_2",	"0",	"0",	"0"},
[411402] = {411402,	11014,	3,	3,	"0",	"0",	"終於，找到你了，這就是我與你的宿命嗎？我…吾的名字是斯卡蒂，統治著暗之國的女王…“應該是影之國吧？”…不要在意那麼多啦！",	"ようやく見つけたぞ。まさにこれが運命。あた…妾の名はスカディ、影の国を統べる女王なり！……え？冬の女神のほうが正しい？……細かいことを気にするなぁ！",	"0",	"0",	"终于，找到你了，这就是我与你的宿命吗？我…吾的名字是斯卡蒂，统治着暗之国的女王…“应该是影之国吧？”…不要在意那么多啦！",	"0",	"cv_sikadi_1",	"0",	"0",	"0"},
[411403] = {411403,	11014,	4,	4,	"0",	"idle",	"哈——哈——哈，領航，吾能感覺到汝在想什麼…“通感”？不是啦，這是魔法，魔法！",	"はっはっはー！ナビゲーター、汝の思惑、妾には隠せぬぞ。……通感覚？違う！これは魔法だ、魔法ぉ！",	"0",	"0",	"哈——哈——哈，领航，吾能感觉到汝在想什么…“通感”？不是啦，这是魔法，魔法！",	"0",	"cv_sikadi_3",	"0",	"0",	"0"},
[411404] = {411404,	11014,	5,	4,	"0",	"idle",	"看到了嗎，領航，吾的眼睛正在閃閃發光，這是與汝產生共鳴的徵兆！",	"見たか、ナビゲーター。妾の目が光っておるぞ。これは汝との共鳴の兆しじゃ！",	"0",	"0",	"看到了吗，领航，吾的眼睛正在闪闪发光，这是与汝产生共鸣的征兆！",	"0",	"cv_sikadi_4",	"0",	"0",	"0"},
[411405] = {411405,	11014,	6,	4,	"0",	"idle",	"噓——領航，不要告訴莉莉絲我在這裡…真是的，只是一個蛋糕而已，有什麼關係嘛……",	"しーっ……ナビゲーター、妾がここに居ること、リリスに言うでないぞ。……まったく、ケーキのひとつぐらい、別にいいじゃないか……",	"0",	"0",	"嘘——领航，不要告诉莉莉丝我在这里…真是的，只是一个蛋糕而已，有什么关系嘛……",	"0",	"cv_sikadi_28",	"0",	"0",	"0"},
[411406] = {411406,	11014,	7,	5,	"1_》_0_0.8",	"level1",	"中二病？不是！吾才不是中二病！聽好了，吾是因為被世界選擇，被人們需要，所以才會成為影之國的女王，出現在這裡的！才不是普通的“中二病”！",	"中二病？違う！妾は中二病などではないっ！よいかっ。妾は世界に選ばれ、民に必要とされたが故、影の国の女王となってここに顕現したのじゃ！決して中二病ではないぞ！",	"0",	"0",	"中二病？不是！吾才不是中二病！听好了，吾是因为被世界选择，被人们需要，所以才会成为影之国的女王，出现在这里的！才不是普通的“中二病”！",	"0",	"cv_sikadi_29",	"0",	"0",	"0"},
[411407] = {411407,	11014,	8,	5,	"1_》_0_0.8",	"level1",	"想靠近吾的話，倒也無妨，不過要小心被陰影吞噬喔，領航。",	"ナビゲーターよ。妾に近づくのは構わぬが、影に飲み込まれるでないぞ。",	"0",	"0",	"想靠近吾的话，倒也无妨，不过要小心被阴影吞噬噢，领航。",	"0",	"cv_sikadi_5",	"0",	"0",	"0"},
[411408] = {411408,	11014,	9,	5,	"1_》_100_1.5",	"level2",	"啊，是領航啊。正好，幫吾去買一份補充黑暗力量的魔力劑吧…就是那個…碳酸飲料啦。",	"あっ、ナビゲーターだ。……丁度よい。妾の代理としてダークエネルギーを補充する魔剤を入手するのだ。……えーっと、あれだよ……サイダーのことだよ。",	"0",	"0",	"啊，是领航啊。正好，帮吾去买一份补充黑暗力量的魔力剂吧…就是那个…碳酸饮料啦。",	"0",	"cv_sikadi_6",	"0",	"0",	"0"},
[411409] = {411409,	11014,	10,	5,	"1_》_500_2",	"level3",	"不，不要老是摸吾啦，別把吾當成那些愛撒嬌的孩子！吾可是最強的影之國女王！咳咳…不過，你真這麼喜歡吾的話，吾也不會在意的。",	"な、なぜいつも頭をなでるのだ。妾を甘えん坊な子供と一緒にするなぁ！妾は最強なる影の国の女王じゃぞ！オホン……でもまあ、そんなに妾のことが好きなら……仕方ないのう。",	"0",	"0",	"不，不要老是摸吾啦，别把吾当成那些爱撒娇的孩子！吾可是最强的影之国女王！咳咳…不过，你真这么喜欢吾的话，吾也不会在意的。",	"0",	"cv_sikadi_7",	"0",	"0",	"0"},
