[411501] = {411501,	11015,	2,	2,	"0",	"0",	"呵，領航果然離不開我呢，誰讓我是天才呢~欸？只是站在這裡嗎，這是大材小用啦！",	"やれやれ。ナビゲーターはやっぱりあたしがいないとダメだねー。まあ天才だしー。……え？ここに立ってるだけ？そんなの誰だってできるじゃーん！",	"0",	"0",	"呵，领航果然离不开我呢，谁让我是天才呢~诶？只是站在这里吗，这是大材小用啦！",	"0",	"cv_lin_2",	"0",	"0",	"0"},
[411502] = {411502,	11015,	3,	3,	"0",	"0",	"我的名字叫做鈴，天華閣的王牌，九州的超新星！呼呼，領航，從今天開始，我的時代開始了——喂，聽我說完啦！",	"あたしは鈴！天華閣のエース、九州の超新星であーる！フッフーン。ナビゲーター、今日からあたしの時代が開幕……って最後まで聞けー！",	"0",	"0",	"我的名字叫做铃，天华阁的王牌，九州的超新星！呼呼，领航，从今天开始，我的时代开始了——喂，听我说完啦！",	"0",	"cv_lin_1",	"0",	"0",	"0"},
[411503] = {411503,	11015,	4,	4,	"0",	"idle",	"“永不放棄”，這就是我的座右銘！怎麼樣，很帥氣吧？嘻嘻。",	"あたしのモットー、それは……ネバーギブアップ！どう？カッコいいでしょ？ニシシ。",	"0",	"0",	"“永不放弃”，这就是我的座右铭！怎么样，很帅气吧？嘻嘻。",	"0",	"cv_lin_3",	"0",	"0",	"0"},
[411504] = {411504,	11015,	5,	4,	"0",	"idle",	"所謂“天才”，就是要在其他人都放棄、氣餒的時候，一如既往地露出自己帥氣的背影，奮力向前！",	"天才はね、他の人が諦めてくじけそうになっていても、いつものように突き進んで、カッコいい背中を見せつけるの！",	"0",	"0",	"所谓“天才”，就是要在其他人都放弃、气馁的时候，一如既往地露出自己帅气的背影，奋力向前！",	"0",	"cv_lin_4",	"0",	"0",	"0"},
[411505] = {411505,	11015,	6,	4,	"0",	"idle",	"上次，我不小心把彩華隊長喜歡的葫蘆弄壞了，我還以為自己要被殺掉了呢。結果隊長卻對我說沒關係，真是溫柔呢~",	"こないだね、彩華隊長が大事にしてるひょうたんを壊しちゃったの。「あ、ダメだ。死ぬ……」って思ってたらなんと！大丈夫って言ってくれたのー！隊長やさしー！",	"0",	"0",	"上次，我不小心把彩华队长喜欢的葫芦弄坏了，我还以为自己要被杀掉了呢。结果队长却对我说没关系，真是温柔呢~",	"0",	"cv_lin_29",	"0",	"0",	"0"},
[411506] = {411506,	11015,	7,	5,	"1_》_0_0.8",	"level1",	"我的夢想是，成為一個受人景仰，被人依賴，並且，勇往直前的英雄！因為我是天才，所以一定能實現的！",	"あたしの夢は、みんなが憧れてくれる、頼りにしてくれる、道を切り開くヒーローになること！天才だから、きっと叶えてみせるもんね！",	"0",	"0",	"我的梦想是，成为一个受人景仰，被人依赖，并且，勇往直前的英雄！因为我是天才，所以一定能实现的！",	"0",	"cv_lin_30",	"0",	"0",	"0"},
