[411509] = {411509,	11015,	10,	5,	"1_》_500_2",	"level3",	"領航，你知道嗎，我有兩位母親喔！不管是哪一個，都是十分偉大的母親，所以才會有我這樣的天才誕生！",	"ねえねえ知ってる？あたしにはお母さんが二人いるんだよ！二人ともすっごいの！あたしみたいな天才が生まれるのも当然よね！",	"0",	"0",	"领航，你知道吗，我有两位母亲噢！不管是哪一个，都是十分伟大的母亲，所以才会有我这样的天才诞生！",	"0",	"cv_lin_7",	"0",	"0",	"0"},
