[411602] = {411602,	11016,	3,	3,	"0",	"0",	"忍心社，黑羽，從今天開始擔任您的護衛，我會寸步不離地守候在您周圍的。",	"忍心社、黒羽。今日からナビゲーター殿の護衛として、一歩も離れません。",	"0",	"0",	"忍心社，黑羽，从今天开始担任您的护卫，我会寸步不离地守候在您周围的。",	"0",	"cv_heiyu_1",	"0",	"0",	"0"},
[411603] = {411603,	11016,	4,	4,	"0",	"idle",	"領航，我的職責並不是監視您，而是保護您。只有這點，請不要弄錯。",	"ナビゲーター殿。私の役目は監視ではなく、護衛です。これだけは、誤解しないでいただきたい。",	"0",	"0",	"领航，我的职责并不是监视您，而是保护您。只有这点，请不要弄错。",	"0",	"cv_heiyu_3",	"0",	"0",	"0"},
[411604] = {411604,	11016,	5,	4,	"0",	"idle",	"我不會那些光怪陸離的忍術，至於刺殺的技藝，也只是一知半解。不過，我向您保證，在我的視野範圍內，您不會有任何危險。",	"奇妙な忍術はできませんし、暗殺の技も未熟ですが、私の目が黒いうちは、ナビゲーター殿を危険を晒すようなことはないと、保証します。",	"0",	"0",	"我不会那些光怪陆离的忍术，至于刺杀的技艺，也只是一知半解。不过，我向您保证，在我的视野范围内，您不会有任何危险。",	"0",	"cv_heiyu_4",	"0",	"0",	"0"},
[411605] = {411605,	11016,	6,	4,	"0",	"idle",	"轟雷隊長是去外出執行任務了嗎？真遺憾，我本來想向她學習一些戰鬥的技巧呢。",	"轟雷隊長は、任務でご不在なのですか？戦闘のコツを教えて頂きたかったのですが、残念です。",	"0",	"0",	"轰雷队长是去外出执行任务了吗？真遗憾，我本来想向她学习一些战斗的技巧呢。",	"0",	"cv_heiyu_29",	"0",	"0",	"0"},
[411606] = {411606,	11016,	7,	5,	"1_》_0_0.8",	"level1",	"我並不是效忠於艾吉斯…只是平等交易罷了。他們為“黑羽”提供了庇佑的住所，而我為他們服務。",	"私はアイギスに忠誠を誓った訳ではなく、取引をしただけです。彼らは黒羽に住処を提供し、その対価として、私は任務を果たすのです。",	"0",	"0",	"我并不是效忠于艾吉斯…只是平等交易罢了。他们为“黑羽”提供了庇佑的住所，而我为他们服务。",	"0",	"cv_heiyu_30",	"0",	"0",	"0"},
[411607] = {411607,	11016,	8,	5,	"1_》_0_0.8",	"level1",	"您這樣做，有什麼特別的含義嗎？",	"これは、何か特別な意味があるのですか？",	"0",	"0",	"您这样做，有什么特别的含义吗？",	"0",	"cv_heiyu_5",	"0",	"0",	"0"},
[411608] = {411608,	11016,	9,	5,	"1_》_100_1.5",	"level2",	"我不能理解您的行為…“想和我更加親近一些”？…呵呵，真是奇怪啊。",	"主殿の行動が理解できないのですが……私ともっと親しくなりたい？……フフ。変なことをおっしゃいますね。",	"0",	"0",	"我不能理解您的行为…“想和我更加亲近一些”？…呵呵，真是奇怪啊。",	"0",	"cv_heiyu_6",	"0",	"0",	"0"},
[411609] = {411609,	11016,	10,	5,	"1_》_500_2",	"level3",	"領航，您對我的過去感興趣嗎？雖然按照規定應該是要對您保密的…不過，如果您想知道的話……我會把您想知道的，都告訴您的。",	"私の過去に興味があるのですか？掟は秘密にしなければならないのですが……もし主殿が知りたいのであれば……全てお話しします。",	"0",	"0",	"领航，您对我的过去感兴趣吗？虽然按照规定应该是要对您保密的…不过，如果您想知道的话……我会把您想知道的，都告诉您的。",	"0",	"cv_heiyu_7",	"0",	"0",	"0"},
[411610] = {411610,	11016,	11,	5,	"1_》_1000_2.5",	"level4",	"…是該承認這一點了。領…領航，您的確和其他人不一樣。從您身上，我感受不到其他人的偏見……您並沒有把我視為達成目的的道具，而是當做同您一樣的“人”對待。",	"……認めざるを得ないようですね。主殿は、確かに他の人とは違って、私を偏見の目で見ることがありませんでした。目的達成のための道具ではなく、自分と同じ「人間」として見てくださったのですね。",	"0",	"0",	"…是该承认这一点了。领…领航，您的确和其他人不一样。从您身上，我感受不到其他人的偏见……您并没有把我视为达成目的的道具，而是当做同您一样的“人”对待。",	"0",	"cv_heiyu_8",	"0",	"0",	"0"},
[411611] = {411611,	11016,	12,	6,	"0",	"0",	"感謝。",	"感謝します。",	"0",	"0",	"感谢。",	"0",	"cv_heiyu_9",	"0",	"0",	"0"},
