[411613] = {411613,	11016,	14,	8,	"0",	"0",	"您…給予了我愛。無論這份愛是友情、是親情、是愛情，哪怕是同情…我都會用忠誠回報您。這就是“黑羽”的信條。",	"主殿は、私に愛をくださいました。たとえその愛が友情であろうと、愛情であろうと……同情であっても……私は忠誠をもってお応えします。これが黒羽のやり方です。",	"0",	"0",	"您…给予了我爱。无论这份爱是友情、是亲情、是爱情，哪怕是同情…我都会用忠诚回报您。这就是“黑羽”的信条。",	"0",	"cv_heiyu_11",	"0",	"0",	"0"},
