[411702] = {411702,	11017,	3,	3,	"0",	"0",	"多瑙第一親衛班隊長，芙蘿拉。欸？您問為什麼親衛隊要穿女僕裝？",	"ダニューブ第一親衛班班長、フローラと申します。え？どうして親衛班がメイド服なのか、ですか？",	"0",	"0",	"多瑙第一亲卫班队长，芙萝拉。哎？您问为什么亲卫队要穿女仆装？",	"0",	"cv_fuluola_1",	"0",	"0",	"0"},
[411703] = {411703,	11017,	4,	4,	"0",	"idle",	"方舟正在平穩地行駛，看來暫時沒有什麼要忙的，要為您泡杯茶嗎？",	"方舟の運航は順調です。暫くゆっくりなさってください。そうだ、お茶を淹れましょうか？",	"0",	"0",	"方舟正在平稳地行驶，看来暂时没有什么要忙的，要为您泡杯茶吗？",	"0",	"cv_fuluola_3",	"0",	"0",	"0"},
[411704] = {411704,	11017,	5,	4,	"0",	"idle",	"我的武器嚇到您了嗎？很抱歉，現在就收起來。",	"わたくしの武器で驚かせてしまったでしょうか？申し訳ありません。今すぐ収めます。",	"0",	"0",	"我的武器吓到您了吗？很抱歉，现在就收起来。",	"0",	"cv_fuluola_4",	"0",	"0",	"0"},
[411705] = {411705,	11017,	6,	4,	"0",	"idle",	"身為親衛班的隊長，我更應該要起到表率作用。有機會的話，我想要向朱利烏斯小姐請教一下。",	"わたくしは親衛班の班長として、常に模範とならなければいけません。今度、ユリウスさんにご指導いただこうと思います。",	"0",	"0",	"身为亲卫班的队长，我更应该要起到表率作用。有机会的话，我想要向朱利乌斯小姐请教一下。",	"0",	"cv_fuluola_29",	"0",	"0",	"0"},
[411706] = {411706,	11017,	7,	5,	"1_》_0_0.8",	"level1",	"第一親衛班的首要任務是確保多瑙的象徵——方舟能夠安全地行駛。當然，我們本身也常常被當做是多瑙駕駛員的代表，所以維持自身形象是非常有必要的。",	"第一親衛班の最も重要な任務はダニューブの象徴、方舟を守ることです。また、わたくしたちはダニューブのドライバーの代表として見られることが多いですから、自身のイメージを維持することも非常に重要です。",	"0",	"0",	"第一亲卫班的首要任务是确保多瑙的象征——方舟能够安全地行驶。当然，我们本身也常常被当做是多瑙驾驶员的代表，所以维持自身形象是非常有必要的。",	"0",	"cv_fuluola_5",	"0",	"0",	"0"},
[411707] = {411707,	11017,	8,	5,	"1_》_0_0.8",	"level1",	"嗯，今天的巡視任務已經結束了，隨時聽從您的調遣。",	"はい。本日の巡回は終了しました。何なりとお申しつけください。",	"0",	"0",	"嗯，今天的巡视任务已经结束了，随时听从您的调遣。",	"0",	"cv_fuluola_30",	"0",	"0",	"0"},
[411708] = {411708,	11017,	9,	5,	"1_》_100_1.5",	"level2",	"我的父母？嗯，她們不光光是養育我的人，同時還是我努力想要成為的人。作為親衛的後代，我必須要做得比其他隊員更好。只有這樣，才不會辜負大家的期待。",	"わたくしの両親ですか？はい。わたくしを育ててくれただけでなく、わたくしの目標でもあります。親衛班の家系で生まれたわたくしは、他の隊員以上に責務を全うしなければなりません。でなければ、皆様の期待を裏切ることになってしまいます。",	"0",	"0",	"我的父母？嗯，她们不光光是养育我的人，同时还是我努力想要成为的人。作为亲卫的后代，我必须要做得比其他队员更好。只有这样，才不会辜负大家的期待。",	"0",	"cv_fuluola_6",	"0",	"0",	"0"},
[411709] = {411709,	11017,	10,	5,	"1_》_500_2",	"level3",	"真是羡慕朱利烏斯和查麗莎小姐啊……如果我不是親衛的話，也想像她們一樣和您並肩作戰。但是，我現在有更重要的東西要去做，守住多瑙的方舟是我的使命……",	"ユリウスさんとチャリサーさんが羨ましいです。もしわたくしも親衛隊でなければ、彼女たちのようにあなた様と共に戦いたい……。ですがわたくしには為すべきことが、ダニューブの方舟を守るという使命があるのです。",	"0",	"0",	"真是羡慕朱利乌斯和查丽莎小姐啊……如果我不是亲卫的话，也想像她们一样和您并肩作战。但是，我现在有更重要的东西要去做，守住多瑙的方舟是我的使命……",	"0",	"cv_fuluola_7",	"0",	"0",	"0"},
[411710] = {411710,	11017,	11,	5,	"1_》_1000_2.5",	"level4",	"雖然無法和您一同遠征，但也有身為親衛的我能做的事。無論您身處何方都還請放心，我一定會守住您和您同伴們的歸所。如果有一天您感到疲憊了也隨時都能回來休息一段時間，我會在這裡等著您的。",	"あなたと共に遠征はできませんが、親衛班であるわたくしだからこそ、できることがあります。ご安心ください。あなた様と仲間の皆様の帰る場所は、わたくしが必ずお守りします。もし疲れたら、いつでも帰ってきてください。いつでもここでお待ちしております。",	"0",	"0",	"虽然无法和您一同远征，但也有身为亲卫的我能做的事。无论您身处何方都还请放心，我一定会守住您和您同伴们的归所。如果有一天您感到疲惫了也随时都能回来休息一段时间，我会在这里等着您的。",	"0",	"cv_fuluola_8",	"0",	"0",	"0"},
