[411808] = {411808,	11018,	9,	5,	"1_》_100_1.5",	"level2",	"我的同族？嗯，她們都是可愛的孩子，是我活在這個世界上唯一的精神寄託。但是……作為戰士的我已經沒有臉面再和她們生活在一起了。",	"僕の同族？ああ、僕が生きる唯一の心の支えになっている、可愛い子たちだ。でも……戦士になってしまった僕は、もうあの子達と一緒に暮らすことはできない。",	"0",	"0",	"我的同族？嗯，她们都是可爱的孩子，是我活在这个世界上唯一的精神寄托。但是……作为战士的我已经没有脸面再和她们生活在一起了。",	"0",	"cv_yin_6",	"0",	"0",	"0"},
[411809] = {411809,	11018,	10,	5,	"1_》_500_2",	"level3",	"人類？雖然也有個別也能讓我提起興趣的傢伙，但你們人類的壽命實在是過於短暫了。……人類的領航啊，你能理解嗎？我只是不想再和心愛的人分開罷了。",	"僕に興味を持ってくれる人間もいるけど、お前たちの寿命はあまりにも短すぎる。……人間のナビゲーター、お前は分かってくれるか？僕はただ二度と、愛しいものと別れたくないだけなんだ。",	"0",	"0",	"人类？虽然也有个别也能让我提起兴趣的家伙，但你们人类的寿命实在是过于短暂了。……人类的领航啊，你能理解吗？我只是不想再和心爱的人分开罢了。",	"0",	"cv_yin_7",	"0",	"0",	"0"},
