[412006] = {412006,	11020,	7,	5,	"1_》_0_0.8",	"level1",	"領航，有時候我會這麼想，誕生於世的人，應該都有他們存在的使命。不管是多麼不起眼的人，也一定能有她能勝任的位置……我是這麼想的…………誒？您沒在聽嗎？難道您從一開始就沒在聽我說話嗎！？",	"0",	"0",	"0",	"0",	"0",	"cv_caroline_30",	"0",	"0",	"0"},
