[412009] = {412009,	11020,	10,	5,	"1_》_500_2",	"level3",	"隊長說，偵查的時候需要像我這樣巨大化後也沒什麼存在感的駕駛員。雖然是事實……但真希望她說的時候能夠注意下我的個人感受啦。",	"0",	"0",	"0",	"0",	"0",	"cv_caroline_7",	"0",	"0",	"0"},
[412010] = {412010,	11020,	11,	5,	"1_》_1000_2.5",	"level4",	"如果沒有戰爭，許多人都不會走上“英雄”的道路。但我相信，即使是那些英雄，也一定盼望著“普通”的人生。所以，我的責任一定就是讓那些遠離日常的英雄們，回到她們本該的位置上……我是這麼想的。",	"0",	"0",	"0",	"0",	"0",	"cv_caroline_8",	"0",	"0",	"0"},
