[412101] = {412101,	11021,	2,	2,	"0",	"0",	"哈——哈——哈，領航，吾都等你好久了。選吾不是毋庸置疑的嘛！",	"はーっはっはー！ナビゲーター、待っておったぞ。妾を選ぶのに何を迷う！",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_2",	"0",	"0",	"0"},
[412102] = {412102,	11021,	3,	3,	"0",	"0",	"吾乃影之國的夏之女王，這是吾百般王之形態的其中一種，只有借助陽炎的力量才能顯現的特殊形態！",	"妾は影の国……夏の女王！王が持つ百の姿の一。太陽の力によってのみ発現する特別な姿なのじゃ！",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_3",	"0",	"0",	"0"},
[412103] = {412103,	11021,	4,	4,	"0",	"idle",	"……你說吾背後有兩個模糊的人影？……嗯！？沒、沒有呀。吾、我完全沒看到哦。你在騙我對吧？",	"妾の背後に……人影が二つ？……ええっ！？ど、どこにもおらんぞ。嘘じゃよな……ナビゲーター？",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_4",	"0",	"0",	"0"},
[412104] = {412104,	11021,	5,	4,	"0",	"idle",	"說起來，最近睡覺的時候經常做夢。醒來後又好像學會了新的招式…………難道吾被封印的記憶覺醒了嗎？",	"そう言えば妾はよく夢を見るんじゃが、起きたら新しい技を覚えてることがあって…………もしかして、妾の封印されし記憶が蘇ったのか！？",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_5",	"0",	"0",	"0"},
[412105] = {412105,	11021,	6,	4,	"0",	"idle",	"睡了一覺起來渾身酸痛，像是打了很多場架。嘛，不過，現在已經完全恢復了。所以陪吾一起去看海吧！領航！",	"目が覚めたら全身筋肉痛で、なんかいっぱい戦った感じがするんじゃが……でももう全回復したぞ！一緒に海を見に行くぞ、ナビゲーター！",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_6",	"0",	"0",	"0"},
[412106] = {412106,	11021,	7,	5,	"1_》_0_0.8",	"level1",	"陽炎想要覆滅大地上的一切生機，即使是吾也受到了它的影響，但是極淵之地的冰寒中篆刻著破解這高懸陽炎的辦法。領航……要去吃霜淇淋嗎。",	"太陽がこの大地に生きる者すべてを圧倒し、妾ですらその影響を受けておる。だが極寒の地の氷に、この炎熱に対抗する方法が封じられていたのじゃ。つまり、ナビゲーターよ……アイスクリームを食べに行かぬか？",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_7",	"0",	"0",	"0"},
[412107] = {412107,	11021,	8,	5,	"1_》_0_0.8",	"level1",	"吾說的話能讓大家鼓起勇氣？嗯！因為吾是要保護影之國居民的女王嘛！",	"妾の言葉はみんなを勇気づける？うむ！妾は影の国の民を守る女王じゃからな！",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_8",	"0",	"0",	"0"},
[412108] = {412108,	11021,	9,	5,	"1_》_100_1.5",	"level2",	"上次回孤兒院，甚至還碰到了以前的朋友，大家都長得好高，只有吾沒什麼變化，唔……",	"この前孤児院に行って昔の友達と会ったのじゃが、みんな背がすっごく伸びていて……妾だけ昔のままで、ううぅ……",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_9",	"0",	"0",	"0"},
[412109] = {412109,	11021,	10,	5,	"1_》_500_2",	"level3",	"領航，不管發生什麼事情吾都會來到你身邊保護你的哦！不論是過去，現在，還是未來，只要你高呼著“斯卡蒂”的名字，那麼影之國女王便會來到你身邊。",	"ナビゲーター。例え何があろうと、妾が守ってやるぞ！過去、現在、そしてこれからも……スカディと呼べば、影の女王がすぐに降臨するのじゃ！",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_10",	"0",	"0",	"0"},
[412110] = {412110,	11021,	11,	5,	"1_》_1000_2.5",	"level4",	"昨天夢見吾落在了海裏，是領航救了吾。吾和領航流落到了一座荒島上，然後我們就在島上一起生活……之後？……之，之後吾，吾吾吾已經全部忘掉了！！",	"ゆうべ海に落ちる夢を見て……ナビゲーターが妾を救ってくれたのじゃ。そして妾たちは孤島に流れ着いて、二人で暮らし始めて…………それから？そっ、そそそれからは何も覚えとらーん！",	"0",	"0",	"0",	"0",	"cv_sikadi_sw_11",	"0",	"0",	"0"},
