[412301] = {412301,	11023,	2,	2,	"0",	"0",	"這就是閣下經常呆的地方嗎。嗯……嗯！那現在這裏就是曉夢要守護的地方了。",	"ここが殿がよくいる場所か……うん……うん！では、今からここが暁夢（ぎょうむ）の守備範囲だな！",	"0",	"0",	"0",	"0",	"cv_xiaomeng_2",	"0",	"0",	"0"},
[412302] = {412302,	11023,	3,	3,	"0",	"0",	"閣下，聽到你的呼喚，曉夢馬上就來幫忙了。這次又要給予曉夢什麼樣的試煉呢？",	"殿の呼びかけに応じ、暁夢、ここに参上！さあ、今回はどのような試練が待っているんだ？",	"0",	"0",	"0",	"0",	"cv_xiaomeng_3",	"0",	"0",	"0"},
[412303] = {412303,	11023,	4,	4,	"0",	"idle",	"出拳的意義？不知道，也沒想過，先生教曉夢拳法，曉夢便習武，練了便是練了。曉夢為何出拳，怎麼出拳，這些都是閣下需要思考的問題吧？拳出拳止，這才是曉夢的意義。",	"この拳の意味？分からん、考えたこともない。師匠が拳法を教え、暁夢はそれを修める。それだけのことだ。暁夢が何のためにどうやって拳を出すのか。それは殿に任せる。殿が思うところに我が拳あり！それが暁夢の生き様だ！",	"0",	"0",	"0",	"0",	"cv_xiaomeng_4",	"0",	"0",	"0"},
[412304] = {412304,	11023,	5,	4,	"0",	"idle",	"澄練說閣下可以教導曉夢修行，要聽閣下的話。那麼從現在開始，曉夢便聽閣下的話。",	"殿が修行をつけてくれると澄練（ちょうれん）から聞いたんだ。今からどんな命令にも従うぞ！",	"0",	"0",	"0",	"0",	"cv_xiaomeng_5",	"0",	"0",	"0"},
[412305] = {412305,	11023,	6,	4,	"0",	"idle",	"大而無當——母親在說完這句後，曉夢就被趕了出來。閣下知道母親說的話……是什麼意思嗎？",	"その拳に乗せるものを探しなさい……母上はそう言って、暁夢を追い出したんだ。殿。この意味が分かるか？",	"0",	"0",	"0",	"0",	"cv_xiaomeng_6",	"0",	"0",	"0"},
[412306] = {412306,	11023,	7,	5,	"1_》_0_0.8",	"level1",	"閣……閣下！這是在做什麼？",	"と、殿？何をしているんだ？",	"0",	"0",	"0",	"0",	"cv_xiaomeng_7",	"0",	"0",	"0"},
[412307] = {412307,	11023,	8,	5,	"1_》_0_0.8",	"level1",	"最開始練拳的時候當然很痛啊，但是痛過之後，現在曉夢的拳頭已經不會痛了。閣下想要看看曉夢的手嗎？",	"拳法を始めた時は痛かった拳が、今はもう痛むことはない。暁夢の手を見てみるか？",	"0",	"0",	"0",	"0",	"cv_xiaomeng_8",	"0",	"0",	"0"},
[412308] = {412308,	11023,	9,	5,	"1_》_100_1.5",	"level2",	"領航對曉夢下命令吧，曉夢想要聽閣下的話！曉夢想……待在閣下身邊……",	"殿。暁夢に命令をくれ。暁夢は殿の言うことを聞きたい。暁夢は……殿の傍にいたい……",	"0",	"0",	"0",	"0",	"cv_xiaomeng_9",	"0",	"0",	"0"},
[412309] = {412309,	11023,	10,	5,	"1_》_500_2",	"level3",	"閣下，曉夢好像明白一點了……想靜下心來思考再給閣下答案……原來是這樣啊……",	"殿。暁夢は少し分かってきた気がする……でも、もっと落ち着いて考えてから、話そうと思う。だから今はここまでだ。",	"0",	"0",	"0",	"0",	"cv_xiaomeng_10",	"0",	"0",	"0"},
[412310] = {412310,	11023,	11,	5,	"1_》_1000_2.5",	"level4",	"……思考是很重要的……對錯也是很重要的！平心社的大家是很重要的……閣下也是很重要的……！對不起……閣下……曉夢現在只能想到這些…………今後再和領航一起想吧。",	"考えることは大切だけど……決めることも大切だな！で、暁夢は平心社のみんなが大切で……でも！殿も大切な存在で……うーん……申し訳ない。いまの暁夢は、これぐらいしか分からない。……だからこれから一緒に考えてくれ！",	"0",	"0",	"0",	"0",	"cv_xiaomeng_11",	"0",	"0",	"0"},
