[412802] = {412802,	11028,	3,	3,	"0",	"0",	"初次見面…嗯？你…啊…失禮了，我是潔蘿，是瓦爾基裏的一員…同時也是卡佳最強的駕駛員。嗯，我有說出這句話的自信。",	"はじめまして…うん？あなたは…あっ、失礼。私はワルキューレが一人、ジェロよ。そしてカティア最強のドライバー。えぇ、その自信があるわ。",	"0",	"0",	"0",	"0",	"cv_geiro_3",	"0",	"0",	"0"},
[412803] = {412803,	11028,	4,	4,	"0",	"idle",	"領航…你並不是人類吧？至少，你血管裏流淌著的血液中，有一部分不屬於人類。為什麼會知道你的秘密？…我也不知道，或許只是直覺而已吧。",	"ナビゲーター、あなた人間じゃ…ないわよね。少なくとも、人間じゃない血が混ざってる。どうして知ってるのかって？…私も分からないわ、ただそう感じただけよ。",	"0",	"0",	"0",	"0",	"cv_geiro_4",	"0",	"0",	"0"},
[412804] = {412804,	11028,	5,	4,	"0",	"idle",	"誒——你…比我想像中還要悠閒呢。看到你這份遊刃有餘的態度，真不舒服。",	"ん～、あなた…想像してたよりものんびりしてるのね。その余裕のある態度、なんかムカつくわ。",	"0",	"0",	"0",	"0",	"cv_geiro_5",	"0",	"0",	"0"},
[412805] = {412805,	11028,	6,	4,	"0",	"idle",	"“生命只有一次，每個人都有義務在死亡到來前想好怎麼揮霍它。想要成為怎樣的人，由你自己決定。”這是那位醫生對我說過的話，我希望領航你也能好好思考它的含義。",	"「人生は一回限り、死が訪れる前に自分の人生をどうやって費やすのを考えなければならない。どんな人になるのか、決めるのは己自身だ。」これはあの医師に言われたこと。ナビゲーターにもその意味をちゃんと考えて欲しいの。",	"0",	"0",	"0",	"0",	"cv_geiro_6",	"0",	"0",	"0"},
[412806] = {412806,	11028,	7,	5,	"1_》_0_0.8",	"level1",	"動亂的世界想要恢復和平，就必須剷除所有的原罪。為了讓那一天儘早到來，我會一直戰鬥下去，為了我自己，為了人類。",	"平和を取り戻すには、全ての原罪を駆除しなくちゃならない。そんな日が一日も早く来るよう、私は戦い続ける。私自身のためにも、人類のためにも。",	"0",	"0",	"0",	"0",	"cv_geiro_7",	"0",	"0",	"0"},
[412807] = {412807,	11028,	8,	5,	"1_》_0_0.8",	"level1",	"請不要隨便觸碰我…這是為了你的安全著想才說的忠告。",	"気安く触らないで…これはあなたための忠告よ。",	"0",	"0",	"0",	"0",	"cv_geiro_8",	"0",	"0",	"0"},
[412808] = {412808,	11028,	9,	5,	"1_》_100_1.5",	"level2",	"真是的，我不是說了不要碰我嗎…我沒有在嚇你啦。我還不能很好地控制自己的力量，要是傷到你了該怎麼辦啊？",	"まったく、触らないでって言ったはずよ…脅しじゃないわ。私はまだ自分の力を完璧にコントロール出来ないの。怪我したらどうすれば？",	"0",	"0",	"0",	"0",	"cv_geiro_9",	"0",	"0",	"0"},
[412809] = {412809,	11028,	10,	5,	"1_》_500_2",	"level3",	"我在卡佳遊歷過一段時間，所以心裏很清楚。如果沒有艾吉斯，那些平民只會過得比現在更糟。也是這段經歷，讓我審視起自己擁有的東西，去思考自己該成為什麼樣的人。…為什麼我會和你說這些啊…真奇怪。",	"カティアを旅してた私には分かるの。アイギスがなかったら、みんなは今よりも酷い生活を送っていただろうって。だから私は自分を見つめ直して、どんな人間になりたいかを考えたの。……どうしてあなたにこんなことを…変ね。",	"0",	"0",	"0",	"0",	"cv_geiro_10",	"0",	"0",	"0"},
[412810] = {412810,	11028,	11,	5,	"1_》_1000_2.5",	"level4",	"艾吉斯能帶領人類前往美好的未來，但我確信那個地方不會有我的位置。領航，我會守護艾吉斯的，人類的現在，而他們的未來則拜託你了。雖然你有時候挺不正經的…但我相信你，你一定能做到的。",	"アイギスは人類を素晴らしい未来へ導いてくれるけど、その未来に私の居場所はないでしょうね。ナビゲーター、私はアイギスの、人類の今を守る。だけど未来はあなたに任せるわ。時々不真面目な所もあるけど…あなたなら出来ると信じてるわ。",	"0",	"0",	"0",	"0",	"cv_geiro_11",	"0",	"0",	"0"},
[412811] = {412811,	11028,	12,	6,	"0",	"0",	"謝謝。",	"ありがとう。",	"0",	"0",	"0",	"0",	"cv_geiro_12",	"0",	"0",	"0"},
[412812] = {412812,	11028,	13,	7,	"0",	"0",	"我會消滅所有原罪，一只也不會剩。",	"私は必ず全ての原罪を退治する。一匹も残らさないわ。",	"0",	"0",	"0",	"0",	"cv_geiro_13",	"0",	"0",	"0"},
[412813] = {412813,	11028,	14,	8,	"0",	"0",	"力量會讓人迷失自我，尤其是當這份力量強大到超越常識的時候。所以，我一直在審問著自己的心，詢問自己該如何使用這份力量。領航，請和我一起將這份力量用在正確的地方上吧，謝謝。",	"力を持つと人は自分自身を見失いやすくなる、その力が強ければ強いほどね。だから、私はいつも自分の心に問うの、この力の使い方を。ナビゲーター、どうか私と共に、この力を正しく使ってね。",	"0",	"0",	"0",	"0",	"cv_geiro_14",	"0",	"0",	"0"},
[412814] = {412814,	11028,	15,	9,	"0",	"0",	"我需要向前輩們學習更多技能。",	"先輩からもっとスキルを学ばないと。",	"0",	"0",	"0",	"0",	"cv_geiro_15",	"0",	"0",	"0"},
[412815] = {412815,	11028,	16,	10,	"0",	"0",	"我會將自己的力量…用在正確的地方。",	"この力…正しく使うわ。",	"0",	"0",	"0",	"0",	"cv_geiro_16",	"0",	"0",	"0"},
