[412901] = {412901,	11029,	2,	2,	"0",	"0",	"就算是學生會長也不能逃避值日。",	"生徒会長も例外なく、日直を担当します。",	"0",	"0",	"0",	"0",	"cv_qianmo_2",	"0",	"0",	"0"},
[412902] = {412902,	11029,	3,	3,	"0",	"0",	"早安，領航先生，雛鷹小隊千陌報導，今後就麻煩您了。",	"おはようございます、先生。雛鷹（ひなたか）所属の、千陌（せんはく）です。これからよろしくお願いします。",	"0",	"0",	"0",	"0",	"cv_qianmo_3",	"0",	"0",	"0"},
[412903] = {412903,	11029,	4,	4,	"0",	"idle",	"給實習生裝備這麼精良的裝備合乎規定嗎？",	"インターン生にこのような高性能の装備を与えて、問題はないのでしょうか？",	"0",	"0",	"0",	"0",	"cv_qianmo_4",	"0",	"0",	"0"},
[412904] = {412904,	11029,	5,	4,	"0",	"idle",	"按照休息表上的時間，馬上就是休息時間了。",	"スケジュールによると、もうすぐ休憩時間です。",	"0",	"0",	"0",	"0",	"cv_qianmo_5",	"0",	"0",	"0"},
[412905] = {412905,	11029,	6,	4,	"0",	"idle",	"其實我一直反對“雛鷹計畫”，讓沒有經驗的學生上戰場就是在揠苗助長。目前來看，學院裏有能力執行實戰任務的只有我和卡蓮。",	"私は「雛鷹プロジェクト」には反対です。戦闘経験のない学生を戦場に送るなど、助長抜苗（じょちょうばつびょう）でしかありません。現時点で実戦任務を遂行できるのは、私とカリンだけです。",	"0",	"0",	"0",	"0",	"cv_qianmo_6",	"0",	"0",	"0"},
[412906] = {412906,	11029,	7,	5,	"1_》_0_0.8",	"level1",	"弱肉強食雖合乎自然生存之法，但並不合乎人類發展之法。所以縱使原罪比我們強上千倍百倍，我也不會低頭。",	"自然界においては弱肉強食が正しいのかもしれませんが、人類が発展したのは、それだけが理由ではないはずです。だからこそ、原罪が私たちの百倍、いえ、千倍強くとも屈することはありません。",	"0",	"0",	"0",	"0",	"cv_qianmo_7",	"0",	"0",	"0"},
[412907] = {412907,	11029,	8,	5,	"1_》_0_0.8",	"level1",	"騷擾學生可是重大犯罪，請先生三思。",	"学生への迷惑行為は重大な犯罪です。慎重に考えてください。",	"0",	"0",	"0",	"0",	"cv_qianmo_8",	"0",	"0",	"0"},
[412908] = {412908,	11029,	9,	5,	"1_》_100_1.5",	"level2",	"現在是工作時間……想發牢騷的話可以在工作結束後說，先生。",	"仕事中です。愚痴を言いたければ、仕事が終わってからお聞きしましょう。",	"0",	"0",	"0",	"0",	"cv_qianmo_9",	"0",	"0",	"0"},
[412909] = {412909,	11029,	10,	5,	"1_》_500_2",	"level3",	"先生上次說到的原罪行動方式，和學校裏老師所教學的有些出入。如果在實戰中按照教材來應對，想必會敗得很慘吧。",	"先生から教わった原罪の行動パターンは、学校で聞いたものとずいぶん違いますね……もし実戦で教科書通りに動いたら、あっさりと敗北してしまうかもしれません……",	"0",	"0",	"0",	"0",	"cv_qianmo_10",	"0",	"0",	"0"},
[412910] = {412910,	11029,	11,	5,	"1_》_1000_2.5",	"level4",	"先生的學識和見聞超過我太多。遺憾的是作為實習生，不能長久地在先生身邊學習。希望在成為真正的駕駛員之後可以繼續和先生共事。",	"先生の知識と経験は想像以上でした。もっと先生の元で学びたいのですが……インターン生ですから、残された時間は多くありません。将来、一人前のドライバーになって、先生と一緒に仕事をすることが私の目標です。",	"0",	"0",	"0",	"0",	"cv_qianmo_11",	"0",	"0",	"0"},
[412911] = {412911,	11029,	12,	6,	"0",	"0",	"感謝教誨。",	"教えに感謝します。",	"0",	"0",	"0",	"0",	"cv_qianmo_12",	"0",	"0",	"0"},
[412912] = {412912,	11029,	13,	7,	"0",	"0",	"與先生閒聊真的感悟頗豐。",	"先生との会話は、本当に得ることが多いです。",	"0",	"0",	"0",	"0",	"cv_qianmo_13",	"0",	"0",	"0"},
[412913] = {412913,	11029,	14,	8,	"0",	"0",	"按規矩這不該是實習駕駛員應該獲得的力量，難道在先生心中，我已經是正式的駕駛員了嗎？",	"規定では、これはインターン生が持つべき力ではありません。先生の心の中では、私を一人前のドライバーと認めてくださったのですか？",	"0",	"0",	"0",	"0",	"cv_qianmo_14",	"0",	"0",	"0"},
