[413001] = {413001,	11030,	2,	2,	"0",	"0",	"由我來擔任參謀嗎……正好，我也有很多話想與領航講。",	"私が参謀、ですか……わかりました。ちょうどナビゲーターさんにお聞きしたいことがたくさんあったんです。",	"0",	"0",	"0",	"0",	"cv_chenglian_2",	"0",	"0",	"0"},
[413002] = {413002,	11030,	3,	3,	"0",	"0",	"閣下就是那位來自多瑙的領航吧？九州平心社，澄練，在此久候多時了。可以預見，接下來我們將會共事很長一段時間，請多多指教。",	"あなたがダニューブのナビゲーターさんですね？九州平心社（きゅうしゅうへいしんしゃ）の澄練（ちょうれん）といいます。お会いできるのを楽しみにしていました。長いお付き合いになると思いますが、どうぞよろしくお願いします。",	"0",	"0",	"0",	"0",	"cv_chenglian_3",	"0",	"0",	"0"},
[413003] = {413003,	11030,	4,	4,	"0",	"idle",	"領航需要幫忙嗎，作為照顧我們的回禮，我會在能力範圍內協助您的工作，即使是不了解的事情，我也會跟著領航學習的。",	"平心社がお世話になったお礼として、できる限りの協力をさせてください。分からない事があっても、勉強してできるようになりますから。",	"0",	"0",	"0",	"0",	"cv_chenglian_4",	"0",	"0",	"0"},
[413004] = {413004,	11030,	5,	4,	"0",	"idle",	"我們需要通過領航來瞭解塵世，所以我希望領航也能稍微依靠我們一點。在戰場上也好，在生活中……也一樣……我會負責記錄領航的點點滴滴。",	"平心社は塵世（じんせい）を知るために、ナビゲーターさんのお力を必要としています。ですから、ナビゲーターさんももう少し私たちを頼ってください。戦場でも、日常生活でも、些細なことまできちんと記録しますから。",	"0",	"0",	"0",	"0",	"cv_chenglian_5",	"0",	"0",	"0"},
[413005] = {413005,	11030,	6,	4,	"0",	"idle",	"在史書上的人類，從來沒有像現在這樣團結過，雖然難免有摩擦，但是所有人都為了更好的明天全心全意，能記錄下這段歷史，我已經死而無憾了。",	"歴史上、人類がこれほど団結したことはないでしょう。多少の摩擦が生じることがあっても、みんながより良い未来を目指して全力を尽くしています。この歴史を書き記すことができれば、私はもう悔いはありません。",	"0",	"0",	"0",	"0",	"cv_chenglian_6",	"0",	"0",	"0"},
[413006] = {413006,	11030,	7,	5,	"1_》_0_0.8",	"level1",	"我們幻化之後的腿是不是看起來很奇怪？",	"ダニューブの博物館に行って、昔の人々が作り出した遺物を見てみたいんです。……その持ち主と私の祖先が知り合いかもしれないとか、想像したら楽しくないですか？",	"0",	"0",	"0",	"0",	"cv_chenglian_7",	"0",	"0",	"0"},
[413007] = {413007,	11030,	8,	5,	"1_》_0_0.8",	"level1",	"嗚……領航，我們與您只是相熟共事的關係，請不要靠得太近。",	"ひゃ！……ナ、ナビゲーターさんと平心社はお仕事でのお付き合いなんですから、近づきすぎちゃダメです！",	"0",	"0",	"0",	"0",	"cv_chenglian_8",	"0",	"0",	"0"},
[413008] = {413008,	11030,	9,	5,	"1_》_100_1.5",	"level2",	"我們正處於人類歷史中最特殊的節點，而領航您無疑是這個時代最奇怪的人之一，無論如何請活下去，讓我們見證結局您的吧。",	"私たちは現在、人類史上最も重要な時代にいます。そしてナビゲーターさんは間違いなく、この時代でもっとも特別な一人です。どうかこれからも歩みを止めず、その結末を私たちに見届けさせてください。",	"0",	"0",	"0",	"0",	"cv_chenglian_9",	"0",	"0",	"0"},
[413009] = {413009,	11030,	10,	5,	"1_》_500_2",	"level3",	"我總是用“我們”來替代“我”，仿佛失去了“她們”，我便失去了與人交流、面對難題、處理事情的底氣……我……很膽小吧。",	"私、いつも自分のことを「平心社」って言ってしまうんです。仲間がいないと、人と話すことも問題に対処することも自信が持てなくなってしまうみたいで……弱虫ですよね……",	"0",	"0",	"0",	"0",	"cv_chenglian_10",	"0",	"0",	"0"},
[413010] = {413010,	11030,	11,	5,	"1_》_1000_2.5",	"level4",	"您的心願……我已經知道了……但是……但是……我是“史官”啊……",	"あなたの願い……ちゃんと受け取りました……ですが……ですが私は史官なんですよ……まだ、お返事はできません……",	"0",	"0",	"0",	"0",	"cv_chenglian_11",	"0",	"0",	"0"},
