[420003] = {420003,	12000,	4,	4,	"0",	"idle",	"富有的人貢獻金錢，強壯的人貢獻力量。當然~對於我來說，金錢就是力量！",	"お金持ちがお金を出す。体の強い人が力を出す。まぁ、あたしにとっては、お金イコール力だからね！",	"0",	"0",	"富有的人贡献金钱，强壮的人贡献力量。当然~对于我来说，金钱就是力量！",	"0",	"cv_kinkura_3",	"0",	"0",	"0"},
[420004] = {420004,	12000,	5,	4,	"0",	"idle",	"真是可惜啊，像你這樣的人才如果能來多瑙的話，一定會為我們帶來新的變革吧。",	"残念ね。あんたみたいな人が九州に来たら、きっと新しい変化をもたらしてくれるのに。",	"0",	"0",	"真是可惜啊，像你这样的人才如果能来九州的话，一定会为我们带来新的变革吧。",	"0",	"cv_kinkura_4",	"0",	"0",	"0"},
[420005] = {420005,	12000,	6,	4,	"0",	"idle",	"多瑙的領航，你不覺得露露啦太天真了嗎？她那種溫柔的性格，太容易被人利用了。嗯？你也這麼覺得……喂，她可是本小姐先看上的！",	"ルルラってホント単純すぎる。そう思わない？あんな優しい性格じゃ利用されちゃうよね。そっか、あんたもそう思って……？待って、彼女はあたしが先に目を付けたんだからね！",	"0",	"0",	"多瑙的领航，你不觉得露露啦太天真了吗？她那种温柔的性格，太容易被人利用了。嗯？你也这么觉得……喂，她可是本小姐先看上的！",	"0",	"cv_kinkura_29",	"0",	"0",	"0"},
[420006] = {420006,	12000,	7,	5,	"1_》_0_0.8",	"level1",	"加入這場戰爭，不過是本小姐計劃的第一步。與原罪的戰爭結束後，本小姐的商業帝國也就成型了，哼哼哼！",	"この戦争に参加するのはあたしの計画の第一歩に過ぎない。原罪との戦争が終わったら、あたしの商業帝国も形になってるはず。ふっふっふー",	"0",	"0",	"加入这场战争，不过是本小姐计划的第一步。与原罪的战争结束后，本小姐的商业帝国也就成型了，哼哼哼！",	"0",	"cv_kinkura_30",	"0",	"0",	"0"},
[420007] = {420007,	12000,	8,	5,	"1_》_0_0.8",	"level1",	"喔吼~難道說你終於打算轉部了嗎？放心好了，只要有本小姐的指示，你的待遇一切從優。",	"おほほほ、ようやく転部を決心したの？安心して。あたしからの指示さえあれば、あんたの待遇は保証されるよ。",	"0",	"0",	"哦吼~难道说你终于打算转部了吗？放心好了，只要有本小姐的指示，你的待遇一切从优。",	"0",	"cv_kinkura_5",	"0",	"0",	"0"},
[420008] = {420008,	12000,	9,	5,	"1_》_100_1.5",	"level2",	"沒錯，沒錯。本小姐確實是結果主義者，只要能夠幫助到那些有困難的人。我既可以是商人，也可以是戰士。",	"そう、そうなのよ。困ってる人を助けられるかどうか、あたしは成果主義者なの。あたしは商人でもあり、戦士でもあるのよ。",	"0",	"0",	"没错，没错。本小姐确实是结果主义者，只要能够帮助到那些有困难的人。我既可以是商人，也可以是战士。",	"0",	"cv_kinkura_6",	"0",	"0",	"0"},
[420009] = {420009,	12000,	10,	5,	"1_》_500_2",	"level3",	"雖然家裡的長輩曾經教導過我們，不要妄圖使用金錢解決一切問題。但是，我明白，有些事情必須要用金錢來解決……比如說，想要為那些流離失所的孩子們建起一座大廈，光靠力氣是絕對辦不到的。",	"全てのことをお金で解決しようとしてはいけないって、家族に教わってるけど。でも、時にはそうしなければならないこともあると、あたしは思ってる……たとえば、居場所を失ってしまった子供たちのためにビルを建てることは、力だけじゃできないでしょ。",	"0",	"0",	"虽然家里的长辈曾经教导过我们，不要妄图使用金钱解决一切问题。但是，我明白，有些事情必须要用金钱来解决……比如说，想要为那些流离失所的孩子们建起一座大厦，光靠力气是绝对办不到的。",	"0",	"cv_kinkura_7",	"0",	"0",	"0"},
[420010] = {420010,	12000,	11,	5,	"1_》_1000_2.5",	"level4",	"無價之寶嗎……確實啊，我承認，這個世界上確實存在著無法用金錢衡量的事物。比如爺爺曾經說過的，人和人之間的聯繫，信任，與愛意……究竟從何時起，我好像也能漸漸體會到這其中的含義了。",	"価値なき宝か……確かに、この世にはお金で価値を判断できないものはある。たとえば、人と人の間にある繋がり、信頼、愛がそうだって……おじいちゃんが言ってた。いつの間にかあたしもその意味が分かるようになった気がする。",	"0",	"0",	"无价之宝吗……确实啊，我承认，这个世界上确实存在着无法用金钱衡量的事物。比如爷爷曾经说过的，人和人之间的联系，信任，与爱意……究竟从何时起，我好像也能渐渐体会到这其中的含义了。",	"0",	"cv_kinkura_8",	"0",	"0",	"0"},
