[420012] = {420012,	12000,	13,	7,	"0",	"0",	"喔吼吼~沒錯，就是這樣，你投入得越多我的力量也會變得越大。這便是，等價交換！",	"おーっほっほ、そうなの。あんたからの投資が多いほど、あたしの力は大きくなるの。これはいわば等価交換ってやつなのよ！",	"0",	"0",	"哦吼吼~没错，就是这样，你投入得越多我的力量也会变得越大。这便是，等价交换！",	"0",	"cv_kinkura_10",	"0",	"0",	"0"},
