[420203] = {420203,	12002,	4,	4,	"0",	"idle",	"弱小之人，可愛之人，令人心生憐憫之人啊。正是因為有她們的存在，強者才能被稱作強者。無論是保護她們，還是摧毀她們，強者始終都離不開弱者。",	"弱き者、可愛い者。不憫でならないわ。彼女たちが存在するからこそ、強者は強者と呼ばれるの。守るにせよ、滅ぼすにせよ……強者は弱者から離れられないのよ。",	"0",	"0",	"弱小之人，可爱之人，令人心生怜悯之人啊。正是因为有她们的存在，强者才能被称作强者。无论是保护她们，还是摧毁她们，强者始终都离不开弱者。",	"0",	"cv_shiranui_3",	"0",	"0",	"0"},
[420204] = {420204,	12002,	5,	4,	"0",	"idle",	"喜歡可愛而又脆弱的東西又有什麼錯呢？",	"可愛くて弱いものが好きで、何が悪いの？",	"0",	"0",	"喜欢可爱而又脆弱的东西又有什么错呢？",	"0",	"cv_shiranui_4",	"0",	"0",	"0"},
[420205] = {420205,	12002,	6,	4,	"0",	"idle",	"領航，你不覺得清風那孩子可愛得有些過分了嗎？明明還是個孩子，卻要裝成大人的模樣。那雙柔弱的肩膀上，背負著太多沉重的東西了。",	"清風って本当に可愛いわあ。ナビゲーターもそう思わない？子供なのに大人ぶってて。あの柔らかい肩に重荷を背負いすぎてるのね。",	"0",	"0",	"领航，你不觉得清风那孩子可爱得有些过分了吗？明明还是个孩子，却要装成大人的模样。那双柔弱的肩膀上，背负着太多沉重的东西了。",	"0",	"cv_shiranui_30",	"0",	"0",	"0"},
[420206] = {420206,	12002,	7,	5,	"1_》_0_0.8",	"level1",	"為什麼要當駕駛員，當然是因為有很多可愛的孩子在啦……而且，如果戰爭不結束的話，那些孩子就沒辦法過上幸福的生活，不是嗎？",	"ドライバーになった理由？沢山の可愛いコがいるからに決まってるわ……それに、戦争が終わらないと、あのコたちは幸せに暮らせない。そうでしょ？",	"0",	"0",	"为什么要当驾驶员，当然是因为有很多可爱的孩子在啦……而且，如果战争不结束的话，那些孩子就没办法过上幸福的生活，不是吗？",	"0",	"cv_shiranui_31",	"0",	"0",	"0"},
[420207] = {420207,	12002,	8,	5,	"1_》_0_0.8",	"level1",	"欸呀，難道說你和我一樣也是會主動進攻的那類嗎？",	"あら、もしかして、あなたも私みたいに自分から攻めるタイプなの？",	"0",	"0",	"哎呀，难道说你和我一样也是会主动进攻的那类吗？",	"0",	"cv_shiranui_5",	"0",	"0",	"0"},
[420208] = {420208,	12002,	9,	5,	"1_》_100_1.5",	"level2",	"呵呵呵，明明長得那麼可愛，但是卻意外得成熟嘛。這樣一來姐姐就沒法對你下手了吧。",	"うふふ。見た目は可愛いけど、案外大人しいのね。これじゃ手が出せないじゃない。",	"0",	"0",	"呵呵呵，明明长得那么可爱，但是却意外得成熟嘛。这样一来姐姐就没法对你下手了吧。",	"0",	"cv_shiranui_6",	"0",	"0",	"0"},
[420209] = {420209,	12002,	10,	5,	"1_》_500_2",	"level3",	"即便是再強大的人都會擁有弱點，強者只不過是善於掩蓋自己弱點的人罷了。領航，我能感覺到，支撐著你內心的那根支柱實際上非常脆弱吧。",	"どれだけ強い人であっても弱点は必ずあるわ。ただ、強者は自分の弱点を隠すのが上手い。それだけよ。ナビゲーター、私、感じてるわ。あなたの心を支えてる支柱、本当は凄く脆いんでしょ？",	"0",	"0",	"即便是再强大的人都会拥有弱点，强者只不过是善于掩盖自己弱点的人罢了。领航，我能感觉到，支撑着你内心的那根支柱实际上非常脆弱吧。",	"0",	"cv_shiranui_7",	"0",	"0",	"0"},
[420210] = {420210,	12002,	11,	5,	"1_》_1000_2.5",	"level4",	"等一切都結束過後，你我就都能卸下偽裝了。是啊，我想要創造的，只是一個不需要強者的世界罷了。",	"全てが終わったら、あなたも私も、偽りの仮面を外すことができるわ。そう。私が創りたいのは、強者を必要としない世界なの。",	"0",	"0",	"等一切都结束过后，你我就都能卸下伪装了。是啊，我想要创造的，只是一个不需要强者的世界罢了。",	"0",	"cv_shiranui_8",	"0",	"0",	"0"},
