[420303] = {420303,	12003,	4,	4,	"0",	"idle",	"四十八——四十九——五十——好了，今天的第十二組力量訓練完成，還剩下八組！領航，要試試鍛煉肌肉嗎？",	"四十八――四十九――五十――よし、今日の筋トレはもう12セットすんだから…...あと8セット！ナビゲーターもやってみない？筋トレ。",	"0",	"0",	"四十八——四十九——五十——好了，今天的第十二组力量训练完成，还剩下八组！领航，要试试锻炼肌肉吗？",	"0",	"cv_efugenia_3",	"0",	"0",	"0"},
[420304] = {420304,	12003,	5,	4,	"0",	"idle",	"肉體遠比精神重要，只有健碩的軀體才能容下堅毅的靈魂。所以領航，你真的不考慮再鍛煉一下嗎？哈哈，放心好了，我會耐下性子來好好指導你的。",	"肉体は精神より遥かに重要だ。丈夫な体にこそ強い魂を宿せるんだから。ってワケで、本当にトレーニングしなくていいの？あはは、安心して。根気よく指導してあげるからさ。",	"0",	"0",	"肉体远比精神重要，只有健硕的躯体才能容下坚毅的灵魂。所以领航，你真的不考虑再锻炼一下吗？哈哈，放心好了，我会耐下性子来好好指导你的。",	"0",	"cv_efugenia_4",	"0",	"0",	"0"},
[420305] = {420305,	12003,	6,	4,	"0",	"idle",	"作為鋼輪戈爾的隊長，我必須要對自己的隊員負責！因此，只要有空閑的時間，我都會給她們進行緊急強化訓練。",	"コウリンゲールの隊長として、チーム内の皆の世話をする義務があるんだ。だから、時間がある時はいつも皆を対象に緊急強化トレーニングを実施してるのさ。",	"0",	"0",	"作为钢轮戈尔的队长，我必须要对自己的队员负责！因此，只要有空闲的时间，我都会给她们进行紧急强化训练。",	"0",	"cv_efugenia_31",	"0",	"0",	"0"},
[420306] = {420306,	12003,	7,	5,	"1_》_0_0.8",	"level1",	"如果不能保護同伴，我一直鍛煉的肌肉就沒有了意義。只有變得足夠強大，我才能守護人類的世界。",	"仲間を守れないなら、ずっと鍛えた筋肉も意味がない。十分強くなってこそ、人間の世界を守ることができるんだ。",	"0",	"0",	"如果不能保护同伴，我一直锻炼的肌肉就没有了意义。只有变得足够强大，我才能守护人类的世界。",	"0",	"cv_efugenia_32",	"0",	"0",	"0"},
[420307] = {420307,	12003,	8,	5,	"1_》_0_0.8",	"level1",	"我已經很久沒有收到過其他人的挑戰了，領航你還真是勇敢！哈！欸？我還沒用力……",	"人から挑戦を受けるなんて久しぶりだ。やるね、ナビゲーター！はっ！…...え？そんなあ、これからが本番だっていうのに……",	"0",	"0",	"我已经很久没有收到过其他人的挑战了，领航你还真是勇敢！哈！诶？我还没用力……",	"0",	"cv_efugenia_5",	"0",	"0",	"0"},
[420308] = {420308,	12003,	9,	5,	"1_》_100_1.5",	"level2",	"你想要鍛煉肌肉了嗎？哈哈，那我來給你安排一套訓練方案吧！擁有強健身材的人才更帥氣啊！",	"筋トレ、やりたくなった？あはは、じゃあ、トレーニングプランを練ってやるよ！丈夫な体を持った方がかっこいいしね！",	"0",	"0",	"你想要锻炼肌肉了吗？哈哈，那我来给你安排一套训练方案吧！拥有强健身材的人才更帅气啊！",	"0",	"cv_efugenia_6",	"0",	"0",	"0"},
[420309] = {420309,	12003,	10,	5,	"1_》_500_2",	"level3",	"你還真是個有毅力的傢伙！居然還要加練！那我陪你一起鍛煉吧，你可不能中途放棄喔！",	"あんた、本当に根気強いね！まだあたしが作ったトレーニングプランを続けてるだなんて！ここまできたら、付き合ってあげるよ。途中で諦めたりしちゃダメだからね！",	"0",	"0",	"你还真是个有毅力的家伙！居然还要加练！那我陪你一起锻炼吧，你可不能中途放弃哦！",	"0",	"cv_efugenia_7",	"0",	"0",	"0"},
