[420409] = {420409,	12004,	10,	5,	"1_》_500_2",	"level3",	"那個……有件事情想要拜託你。就是昨天下午三點零二分三十一秒的時候我看到你和其他女生一起出去了，如果可以的話下次能提前和我打一聲招呼嗎？或者乾脆不要和其他女生交流了吧，好嗎？",	"えっと……お願いがあるんです。昨日の午後３時２分３１秒、他の女の子と一緒に出掛けていたのを見ました。今度から、そういう時はあらかじめ、あたしに言っておいてくれませんか？もしできないのなら、他の女の子との交流はもうお仕舞いですよ？",	"0",	"0",	"那个……有件事情想要拜托你。就是昨天下午三点零二分三十一秒的时候我看到你和其他女生一起出去了，如果可以的话下次能提前和我打一声招呼吗？或者干脆不要和其他女生交流了吧，好吗？",	"0",	"cv_hanago_7",	"0",	"0",	"0"},
[420410] = {420410,	12004,	11,	5,	"1_》_1000_2.5",	"level4",	"在遇到您之前我一直認為自己只應侍奉神明。但是，見過您之後，這腹中躁動著的熱潮又該如何解釋呢？呵呵呵，我想，該不會是因為，您就是神明大人吧？只屬於我的……神明大人。",	"貴方に出会うまで、あたしは神様に仕えるだけの存在だと思っていました。でも、貴方と過ごす時間はすごく不思議で安心感があって……うふふ。もしかして、貴方が神様そのものなのでしょうか？あたしだけの……神様。",	"0",	"0",	"在遇到您之前我一直认为自己只应侍奉神明。但是，见过您之后，这腹中躁动着的热潮又该如何解释呢？呵呵呵，我想，该不会是因为，您就是神明大人吧？只属于我的……神明大人。",	"0",	"cv_hanago_8",	"0",	"0",	"0"},
