[420507] = {420507,	12005,	8,	5,	"1_》_0_0.8",	"level1",	"請不要用那種眼神看著我，這都是我自己的選擇，你只用將我當作是普通的雇傭兵就好了。",	"そんな目で見つめないで。これは私自身の選択。私のことは、普通の傭兵だって思えばいい。",	"0",	"0",	"请不要用那种眼神看着我，这都是我自己的选择，你只用将我当作是普通的雇佣兵就好了。",	"0",	"cv_iria_32",	"0",	"0",	"0"},
