[420509] = {420509,	12005,	10,	5,	"1_》_500_2",	"level3",	"以前的我似乎沒有注意到，但是自從來到艾吉斯才發現，自己的裝備好像有些落伍了啊……",	"アイギスに来てから初めて気付いたけど、私の装備ってちょっと古い……？",	"0",	"0",	"以前的我似乎没有注意到，但是自从来到艾吉斯才发现，自己的装备好像有些落伍了啊……",	"0",	"cv_iria_7",	"0",	"0",	"0"},
[420510] = {420510,	12005,	11,	5,	"1_》_1000_2.5",	"level4",	"要更加愛惜自己的身體嘛……不，在我眼裏只要能夠完成復仇，其他的都無所謂了。但是，如果這是你的命令的話，那麼我也會試著抽空考慮下復仇之後的事情吧。",	"自分の身体には気を付けた方がいいって？いや、私にとって、復讐さえできれば他のことはどうでもいい。でも、あんたの命令なら、復讐を果たした後のためにも少しは気を使ってみようかな。",	"0",	"0",	"要更加爱惜自己的身体嘛……不，在我眼里只要能够完成复仇，其他的都无所谓了。但是，如果这是你的命令的话，那么我也会试着抽空考虑下复仇之后的事情吧。",	"0",	"cv_iria_8",	"0",	"0",	"0"},
