[420513] = {420513,	12005,	14,	8,	"0",	"0",	"我曾經以為早晚有一天我的心智會被怒火吞沒，但是多虧了你，我才在最後保持了自我。接下來就讓我用這幅嶄新的鋼鐵之軀來回應你的期待吧。我將會……把所有的原罪都化為灰燼。",	"いつか私の心も怒りに呑み込まれるんじゃないかって思ってた。でもあんたのお陰で、最後の最後で自分を取り戻すことができた。これからも、この新しい鋼鉄の身であんたの期待に応えるために頑張るよ。ーー全ての原罪を灰燼と帰さん。",	"0",	"0",	"我曾经以为早晚有一天我的心智会被怒火吞没，但是多亏了你，我才在最后保持了自我。接下来就让我用这幅崭新的钢铁之躯来回应你的期待吧。我将会……把所有的原罪都化为灰烬。",	"0",	"cv_iria_11",	"0",	"0",	"0"},
