[420702] = {420702,	12007,	3,	3,	"0",	"0",	"呀吼~終於見面了呢，多瑙的領航。小生的名字是華夢，可千萬不要忘記啊。",	"ヤッホー。やっと会えたな、ダニューブのナビゲーター。オレの名は華夢。忘れるなよ。",	"0",	"0",	"呀吼~终于见面了呢，多瑙的领航。小生的名字是华梦，可千万不要忘记啊。",	"0",	"cv_kamu_1",	"0",	"0",	"0"},
[420703] = {420703,	12007,	4,	4,	"0",	"idle",	"喝——啊——！太小了！這裡實在是太過於狹小了！完全施展不開拳腳！",	"はっ――やっ――！狭すぎ！ここ、本当に狭すぎる！体、動かせないじゃん！",	"0",	"0",	"喝——啊——！太小了！这里实在是太过于狭小了！完全施展不开拳脚！",	"0",	"cv_kamu_3",	"0",	"0",	"0"},
[420704] = {420704,	12007,	5,	4,	"0",	"idle",	"今天是個適合踏青的好日子呢，如果可以的話真想和你一起出去走走啊。正所謂勞逸結合，偶爾也去做點其他事情放鬆下吧。",	"今日は遠足日和だ。できればお前と一緒に出掛けたいな。まぁ、仕事と休みはバランスよく取るべきだし。たまには他のことをやってみて、リラックスしたらどうだ？",	"0",	"0",	"今天是个适合踏青的好日子呢，如果可以的话真想和你一起出去走走啊。正所谓劳逸结合，偶尔也去做点其他事情放松下吧。",	"0",	"cv_kamu_4",	"0",	"0",	"0"},
[420705] = {420705,	12007,	6,	4,	"0",	"idle",	"無論是彩華還是華戀，她們都不是可以輕視的對手啊。不過小生還是更加害怕和彩華交手，那個傢伙總是會使用非常危險的武器呢。",	"彩華も華恋も、見くびっちゃいけない相手だ。まぁ、オレは彩華の方が苦手だな。あいつ、いつも危ない武器を使ってるからさ。",	"0",	"0",	"无论是彩华还是华恋，她们都不是可以轻视的对手啊。不过小生还是更加害怕和彩华交手，那个家伙总是会使用非常危险的武器呢。",	"0",	"cv_kamu_29",	"0",	"0",	"0"},
