[420707] = {420707,	12007,	8,	5,	"1_》_0_0.8",	"level1",	"天華閣…與其說是作戰部隊不如說是修行部隊呢，像這樣習武是我們的日常。",	"天華閣……作戦部隊っていうより、修行部隊って言うべきか。こうして武芸の練習をするのはオレたちの日常だし。",	"0",	"0",	"天华阁…与其说是作战部队不如说是修行部队呢，像这样习武是我们的日常。",	"0",	"cv_kamu_5",	"0",	"0",	"0"},
[420708] = {420708,	12007,	9,	5,	"1_》_100_1.5",	"level2",	"將身體與技巧都鍛煉到極致確實是我們的追求。但是，就我個人來說的話，還有需要鍛煉的事物。沒錯，那便是氣。",	"体とスキルを限界まで鍛える事は確かにオレたちが求めてることだ。でも、個人的にはもう一つ鍛えなきゃならないものがある。そう、気のことだ。",	"0",	"0",	"将身体与技巧都锻炼到极致确实是我们的追求。但是，就我个人来说的话，还有需要锻炼的事物。没错，那便是气。",	"0",	"cv_kamu_6",	"0",	"0",	"0"},
[420709] = {420709,	12007,	10,	5,	"1_》_500_2",	"level3",	"癡迷修行的代價嘛……估計就是回過神來才發現自己已經到這個歲數了吧。說起來，在我的記憶中似乎並沒有所謂的童年呢。稍微……有點遺憾啊。",	"修行に夢中になることの代償と言えば……まぁ、気付いたらもうこんな年になっちゃった、ぐらいか。そういえばオレ、いわゆる子供時代ってものの記憶がないんだ。ちょっと……残念だな。",	"0",	"0",	"痴迷修行的代价嘛……估计就是回过神来才发现自己已经到这个岁数了吧。说起来，在我的记忆中似乎并没有所谓的童年呢。稍微……有点遗憾啊。",	"0",	"cv_kamu_7",	"0",	"0",	"0"},
[420710] = {420710,	12007,	11,	5,	"1_》_1000_2.5",	"level4",	"修行確實讓我失去了很多東西，但是一想到今天的自己，那麼這一切便都有了意義。更加重要的是，正是因為修行，我才認識了你。",	"確かにオレは修行のせいで沢山のものを失った。でも、今の自分を見たら、全ては意味があることだったと確信できる。修行のお陰でお前に出会えたんだ。",	"0",	"0",	"修行确实让我失去了很多东西，但是一想到今天的自己，那么这一切便都有了意义。更加重要的是，正是因为修行，我才认识了你。",	"0",	"cv_kamu_8",	"0",	"0",	"0"},
