[420806] = {420806,	12008,	7,	5,	"1_》_0_0.8",	"level1",	"默默是大海的孩子，所以，戰爭結束之後，默默會回到海裏和姐姐們在一起喔。不過，那樣的話媽媽會很傷心的，所以默默也在困擾該怎麼辦……嗚。",	"モモは海の子なの。だから、戦争が終わったら、モモは海の中に戻るの。お姉ちゃんたちと一緒に。でも、そうするとお母さんが悲しんじゃう……だから、モモもどうすればいいか分からなくて困ってるの……う……",	"0",	"0",	"默默是大海的孩子，所以，战争结束之后，默默会回到海里和姐姐们在一起哦。不过，那样的话妈妈会很伤心的，所以默默也在困扰该怎么办……呜。",	"0",	"cv_momo_31",	"0",	"0",	"0"},
[420807] = {420807,	12008,	8,	5,	"1_》_0_0.8",	"level1",	"默默的姐姐在哪裡？默默的姐姐們就是默默喔！嗯？不明白嗎？",	"モモのお姉ちゃんはどこかって？モモのお姉ちゃんたちはモモだよ！ん？分からないの？",	"0",	"0",	"默默的姐姐在哪里？默默的姐姐们就是默默噢！嗯？不明白吗？",	"0",	"cv_momo_5",	"0",	"0",	"0"},
