[420810] = {420810,	12008,	11,	5,	"1_》_1000_2.5",	"level4",	"姐姐們說……領航你是可以信任的人。雖然不想承認，但默默從領航身上，感覺到了和姐姐們不同的情感……什麼情感？領航你是不可能明白的。",	"ナビゲーターは信頼できる人だってお姉ちゃんたちが言ってたの。認めたくないけど…...モモ、ナビゲーターには、お姉ちゃんたちと違う気持ちを感じるの……何の気持ちかって？ナビゲーターに分かるはずないの。",	"0",	"0",	"姐姐们说……领航你是可以信任的人。虽然不想承认，但默默从领航身上，感觉到了和姐姐们不同的情感……什么情感？领航你是不可能明白的。",	"0",	"cv_momo_8",	"0",	"0",	"0"},
