[420902] = {420902,	12009,	3,	3,	"0",	"0",	"初次見面，多瑙的小弟弟。這是作為見面禮的擁抱喔——嗯？太用力了嗎？",	"初めまして、ダニューブの坊ちゃん。これは初めましてのぎゅーだよ――あら、力入れ過ぎちゃったかしら？",	"0",	"0",	"初次见面，多瑙的小弟弟。这是作为见面礼的拥抱哦——嗯？太用力了吗？",	"0",	"cv_maria_1",	"0",	"0",	"0"},
[420903] = {420903,	12009,	4,	4,	"0",	"idle",	"嗯？領航困了嗎？想睡覺的話，可以睡在我的大腿上喔。……一直以來真是辛苦你了，真的很努力了呢。",	"あら、眠くなってきたの？なら、私の太ももに頭を乗せて寝てていいわよ。……色々とお疲れ様。本当によく頑張ったわね。",	"0",	"0",	"嗯？领航困了吗？想睡觉的话，可以睡在我的大腿上喔。……一直以来真是辛苦你了，真的很努力了呢。",	"0",	"cv_maria_3",	"0",	"0",	"0"},
[420904] = {420904,	12009,	5,	4,	"0",	"idle",	"小弟弟一直在處理文檔呢，真是了不起，這是作為獎勵的抱抱。放心，這次我會控制好力度的~",	"坊ちゃんはずっと書類作業に励んでいたのね。すごいわ！これはご褒美のぎゅーだよ。大丈夫、今日はちゃんと力加減、気を付けるから。",	"0",	"0",	"小弟弟一直在处理文件呢，真是了不起，这是作为奖励的抱抱。放心，这次我会控制好力度的~",	"0",	"cv_maria_4",	"0",	"0",	"0"},
[420905] = {420905,	12009,	6,	4,	"0",	"idle",	"小弟弟，如果在戰場上受傷了，一定要回到熱尼亞身邊喔。只要在她身邊，任何人都不會有事的。熱尼亞就是如此厲害喔！",	"もし戦場で負傷したら、ジェニアのもとに戻るのよ。彼女のそばにいれば、安全よ。ジェニアはそれくらい凄いコよ！",	"0",	"0",	"小弟弟，如果在战场上受伤了，一定要回到热尼亚身边哦。只要在她身边，任何人都不会有事的。热尼亚就是如此厉害哦！",	"0",	"cv_maria_30",	"0",	"0",	"0"},
[420906] = {420906,	12009,	7,	5,	"1_》_0_0.8",	"level1",	"戰爭……到底什麼時候才會結束呢？……呵呵，讓小弟弟你擔心了，我沒事。",	"戦争って……いつになったら終わるのでしょう？……うふふ。ごめんね、君に心配をかけちゃって。なんでもないわ。",	"0",	"0",	"战争……到底什么时候才会结束呢？……呵呵，让小弟弟你担心了，我没事。",	"0",	"cv_maria_31",	"0",	"0",	"0"},
[420907] = {420907,	12009,	8,	5,	"1_》_0_0.8",	"level1",	"嗯？怎麼了？小弟弟是有什麼想對我說的話嗎？",	"あら、どうしたの？坊ちゃん。何か私に言いたいことでもあるの？",	"0",	"0",	"嗯？怎么了？小弟弟是有什么想对我说的话吗？",	"0",	"cv_maria_5",	"0",	"0",	"0"},
[420908] = {420908,	12009,	9,	5,	"1_》_100_1.5",	"level2",	"嗯——小弟弟是通過這樣的方式來增進自己與部下之間的默契嗎？真是不錯的想法呢！下次見到熱尼亞的時候，我也要試試。",	"へぇー――坊ちゃんはこうやって部下との絆を深めているんだ。いいわね！今度ジェニアに会った時にもやってみよう。",	"0",	"0",	"嗯——小弟弟是通过这样的方式来增进自己与部下之间的默契吗？真是不错的想法呢！下次见到热尼亚的时候，我也要试试。",	"0",	"cv_maria_6",	"0",	"0",	"0"},
[420909] = {420909,	12009,	10,	5,	"1_》_500_2",	"level3",	"在我的故鄉卡佳，一旦注意力被寒冷擊散的時候，大家就會通過擁抱來取回溫度和注意力。——開玩笑的。不過，小弟弟，要試一下嗎？",	"私の故郷、カティアでは、寒さで注意力が散漫になった時はみんなで抱き合って温もりと注意力を取り戻すのよ。――冗談だって。でも、実際どうなるか、ちょっと試してみない？坊ちゃん。",	"0",	"0",	"在我的故乡卡佳，一旦注意力被寒冷击散的时候，大家就会通过拥抱来取回温度和注意力。——开玩笑的。不过，小弟弟，要试一下吗？",	"0",	"cv_maria_7",	"0",	"0",	"0"},
[420910] = {420910,	12009,	11,	5,	"1_》_1000_2.5",	"level4",	"最近，感覺自己變得奇怪了。小弟弟在身邊的時候，總是想忍不住抱上去……雖然以前也想，但最近這種衝動變得更強烈了。",	"最近、なんかおかしくなってきた気がするの。坊ちゃんが隣にいると、つい抱きしめたくなるわ――前にもこんなふうに思ったことはあったけど、最近はこの思いがどんどん高まってるような気がするの。",	"0",	"0",	"最近，感觉自己变得奇怪了。小弟弟在身边的时候，总是想忍不住抱上去……虽然以前也想，但最近这种冲动变得更强烈了。",	"0",	"cv_maria_8",	"0",	"0",	"0"},
[420911] = {420911,	12009,	12,	6,	"0",	"0",	"嗯？變強了？",	"あら、強くなったのかしら？",	"0",	"0",	"嗯？变强了？",	"0",	"cv_maria_9",	"0",	"0",	"0"},
