[420913] = {420913,	12009,	14,	8,	"0",	"0",	"從今往後，小弟弟也要更加地依靠我喔。別擔心，不管什麼樣的敵人，我都會把它擊潰。這就是背負起這份信任之後所要承擔的責任，不是嗎？",	"これからはもっと私に頼ってね、坊ちゃん。心配しないで。どんな敵であっても、全部潰してあげるから。これはこの信頼を裏切らないために背負うべき責任、でしょ？",	"0",	"0",	"从今往后，小弟弟也要更加得依靠我哦。别担心，不管什么样的敌人，我都会把它击溃。这就是背负起这份信任之后所要承担的责任，不是吗？",	"0",	"cv_maria_11",	"0",	"0",	"0"},
