[421002] = {421002,	12010,	3,	3,	"0",	"0",	"你就是領航啊——老娘的名字是冥火，不要把我和“另一個我”弄混了，我才是冥火！",	"てめーがナビゲーターか。俺は冥火。もうひとりのあたしと間違えんなよ。俺こそが冥火だ！",	"0",	"0",	"你就是领航啊——老娘的名字是冥火，不要把我和“另一个我”弄混了，我才是冥火！",	"0",	"cv_meika_1",	"0",	"0",	"0"},
[421003] = {421003,	12010,	4,	4,	"0",	"idle",	"鮮血、毀滅，這才是我想追求的！喂，領航，快點給我下達作戰任務！",	"俺が欲しいのは血と破滅だ！おいナビゲーター、さっさと任務をよこせ！",	"0",	"0",	"鲜血、毁灭，这才是我想追求的！喂，领航，快点给我下达作战任务！",	"0",	"cv_meika_3",	"0",	"0",	"0"},
[421004] = {421004,	12010,	5,	4,	"0",	"idle",	"真無聊，你打算一直待在辦公室裡嗎？我們出去大幹一場吧！",	"つまんねえなぁ。ずっとここにいるつもりか？外で暴れさせてくれよ！",	"0",	"0",	"真无聊，你打算一直待在办公室里吗？我们出去大干一场吧！",	"0",	"cv_meika_4",	"0",	"0",	"0"},
[421005] = {421005,	12010,	6,	4,	"0",	"idle",	"我討厭“她”，因為她總是忍讓。她明明可以不被人欺負，明明可以讓我消失……但她沒這麼做……我，“冥火”也是因為她的忍耐…善良才“誕生”的。",	"俺は、我慢ばかりしてやがる「あたし」が嫌いだ。俺を消せるのに、もういじめられないで済むのに……そうしなかった。俺は……冥火は、「あたし」の我慢と、優しさから生まれたんだ。",	"0",	"0",	"我讨厌“她”，因为她总是忍让。她明明可以不被人欺负，明明可以让我消失……但她没这么做……我，“冥火”也是因为她的忍耐…善良才“诞生”的。",	"0",	"cv_meika_29",	"0",	"0",	"0"},
[421006] = {421006,	12010,	7,	5,	"1_》_0_0.8",	"level1",	"爸爸和媽媽…他們希望“我”恢復正常，想要讓我…“冥火”消失。所以才把我送到了艾吉斯。如果這就是他們希望的事，那也…才怪咧，老娘才不想消失！",	"オヤジとオフクロは、正気の「あたし」に戻って欲しいのさ。俺に……冥火に消えてほしくて、アイギスに送ったんだ。もし、オヤジたちがそう望むなら、それでいい……わけねぇだろう！俺は消えたくねぇんだよ！",	"0",	"0",	"爸爸和妈妈…他们希望“我”恢复正常，想要让我…“冥火”消失。所以才把我送到了艾吉斯。如果这就是他们希望的事，那也…才怪咧，老娘才不想消失！",	"0",	"cv_meika_30",	"0",	"0",	"0"},
[421007] = {421007,	12010,	8,	5,	"1_》_0_0.8",	"level1",	"…喂，不要隨便碰我，咬斷你手指喔！",	"……おい、勝手に触んじゃねぇ。てめーの指噛み切るぞ！",	"0",	"0",	"…喂，不要随便碰我，咬断你手指噢！",	"0",	"cv_meika_5",	"0",	"0",	"0"},
[421008] = {421008,	12010,	9,	5,	"1_》_100_1.5",	"level2",	"為什麼不遮住自己的臉？哼哼，根本沒有那個必要。反正，那個“我”不是“現在的我”，就算見面了你們應該也認不出來吧。",	"なんで顔を隠さないのかって？フン、その必要なんざねぇよ。どうせあの「あたし」は俺じゃねえし。てめーが会っても分かんねぇだろ。",	"0",	"0",	"为什么不遮住自己的脸？哼哼，根本没有那个必要。反正，那个“我”不是“现在的我”，就算见面了你们应该也认不出来吧。",	"0",	"cv_meika_6",	"0",	"0",	"0"},
[421009] = {421009,	12010,	10,	5,	"1_》_500_2",	"level3",	"…啊…領航，您好。這段時間，真的十分感謝您的關照。有您在的話，“冥火”就不會胡鬧過頭了，那我就能安心了。您…知道我是誰吧？",	"……あっ……こんにちは、ナビゲーターさん。この間は本当にお世話になりました。あなたがいれば、冥火は羽目を外し過ぎることがないから、安心です。あの……あたしのこと……ご存知ですか？",	"0",	"0",	"…啊…领航，您好。这段时间，真的十分感谢您的关照。有您在的话，“冥火”就不会胡闹过头了，那我就能安心了。您…知道我是谁吧？",	"0",	"cv_meika_7",	"0",	"0",	"0"},
[421010] = {421010,	12010,	11,	5,	"1_》_1000_2.5",	"level4",	"我大概，遲早有一天會消失吧。他們都說我是異常的存在，爸爸、媽媽也是這麼認為的……說“另一個我”才是真正的我。所以，在我消失之前，領航，和我一起大鬧特鬧吧，好嗎！",	"俺はいつか消えちまう。他のヤツから見たら、俺の方がおかしく見えるんだろうよ。「もうひとりのあたし」こそが本物だってな。オヤジやオフクロもそう思ってる……。だから、俺が消えちまう前に一緒に大暴れしようぜ！ナビゲーター！",	"0",	"0",	"我大概，迟早有一天会消失吧。他们都说我是异常的存在，爸爸、妈妈也是这么认为的……说“另一个我”才是真正的我。所以，在我消失之前，领航，和我一起大闹特闹吧，好吗！",	"0",	"cv_meika_8",	"0",	"0",	"0"},
