[421205] = {421205,	12012,	6,	4,	"0",	"idle",	"笨豬，你今天看見棲琳了嗎？沒有嗎？嗯…這樣的話，就拿你來替代吧…喂，別跑啊，真是的，真膽小豬呢。",	"ブタ。シリンを見かけなかった？見てないの？……ふーん。しょうがないわね。代わりにアンタを……あ、ちょっと！何逃げてんのよ！……なんて憶病なブタかしら。",	"0",	"0",	"笨猪，你今天看见栖琳了吗？没有吗？嗯…这样的话，就拿你来替代吧…喂，别跑啊，真是的，真胆小猪呢。",	"0",	"cv_jyuria_29",	"0",	"0",	"0"},
