[421208] = {421208,	12012,	9,	5,	"1_》_100_1.5",	"level2",	"笨豬，你剛剛碰我了吧。是這只手嗎？好的，乖乖把手伸出來。別害怕，剛開始會很痛，但之後你一定會喜歡上這種感覺的——嘿呀！",	"このブタ、今アタシに触ったわね。触ったのはこの手かしら？いいわ。大人しくその手を出して。大丈夫、最初は痛いけど、だんだんその痛みも愛しくなるわ。……ヘイヤー！",	"0",	"0",	"笨猪，你刚刚碰我了吧。是这只手吗？好的，乖乖把手伸出来。别害怕，刚开始会很痛，但之后你一定会喜欢上这种感觉的——嘿呀！",	"0",	"cv_jyuria_6",	"0",	"0",	"0"},
