[421302] = {421302,	12013,	3,	3,	"0",	"0",	"終於見面了，領航。我是薩哈拉支部的候補生，卡蓮。如果不介意的話，可以讓我與您一同前往戰場嗎？",	"ナビゲーター、やっとお会いできました。サハラ支部の候補生、カレンと申します。ご迷惑でなければ、戦場に同行させていただいても宜しいでしょうか？",	"0",	"0",	"终于见面了，领航。我是薩哈拉支部的候补生，卡莲。如果不介意的话，可以让我与您一同前往战场吗？",	"0",	"cv_kalian_1",	"0",	"0",	"0"},
[421303] = {421303,	12013,	4,	4,	"0",	"idle",	"這就是駕駛員們平時的工作嗎……好的，我會努力的。",	"ドライバーの通常業務ですか……わかりました。頑張ります。",	"0",	"0",	"这就是驾驶员们平时的工作吗……好的，我会努力的。",	"0",	"cv_kalian_3",	"0",	"0",	"0"},
[421304] = {421304,	12013,	5,	4,	"0",	"idle",	"怎麼說呢？將幻化出的裝備穿在身上的感覺真是太奇妙了……欸？還可以去戰場測試一下嗎？！",	"なんと言うか、幻化した装備を身に付けるのは本当に不思議な感覚ですね。",	"0",	"0",	"怎么说呢？将幻化出的装备穿在身上的感觉真是太奇妙了……哎？还可以去战场测试一下吗？！",	"0",	"cv_kalian_4",	"0",	"0",	"0"},
[421305] = {421305,	12013,	6,	4,	"0",	"idle",	"除了我之外應該還有其他候補生吧，如果見到她們的話還請多多關照一下。",	"私の他にも候補生がいるのですよね。彼女たちの事も、どうぞよろしくお願いします。",	"0",	"0",	"除了我之外应该还有其他候补生吧，如果见到她们的话还请多多关照一下。",	"0",	"cv_kalian_30",	"0",	"0",	"0"},
[421306] = {421306,	12013,	7,	5,	"1_》_0_0.8",	"level1",	"這件制服很陌生？啊，這是薩哈拉為候補生們準備的學院服。",	"見たことないユニフォーム、ですか？ああ、これはサハラが候補生に用意した制服ですよ。",	"0",	"0",	"这件制服很陌生？啊，这是薩哈拉为候补生们准备的学院服。",	"0",	"cv_kalian_31",	"0",	"0",	"0"},
