[421308] = {421308,	12013,	9,	5,	"1_》_100_1.5",	"level2",	"領航，我回去思考了一段時間，但還是有很多事情都弄不明白……非常抱歉，可能今後也還要拜託你了，老師。嗯，還請允許我像這樣稱呼您吧。",	"ナビゲーター。しばらく考えたのですが、私には、まだまだ分からないことが沢山あるようです。お手数をおかけいたしますが、今後とも宜しくお願いします、先生。……ええ、先生とお呼びすることをお許しください。",	"0",	"0",	"领航，我回去思考了一段时间，但还是有很多事情都弄不明白……非常抱歉，可能今后也还要拜托你了，老师。嗯，还请允许我像这样称呼您吧。",	"0",	"cv_kalian_6",	"0",	"0",	"0"},
[421309] = {421309,	12013,	10,	5,	"1_》_500_2",	"level3",	"老師，您今天有空嗎？我整理出了一些自己這段時間收集到的記錄，想讓您幫忙看一下可以嗎？當然，如果您正在忙的話，我們改天也可以。",	"先生、今日、少しお時間宜しいでしょうか？今までの記録を整理したのですが、ご覧いただけますか？もちろんお忙しいようでしたら、後日でも結構ですので。",	"0",	"0",	"老师，您今天有空吗？我整理出了一些自己这段时间收集到的记录，想让您帮忙看一下可以吗？当然，如果您正在忙的话，我们改天也可以。",	"0",	"cv_kalian_7",	"0",	"0",	"0"},
[421310] = {421310,	12013,	11,	5,	"1_》_1000_2.5",	"level4",	"不知不覺已經和你相處了這麼久了啊，老師。在當駕駛員的時間裏，多虧了你的照顧我才沒有受傷。真希望分別的日子可以再晚些……我還有很多想向老師請教的東西……",	"先生とはじめてお会いしてから、もうこんなに経ったんですね。先生のおかげで、私は生き延びることができたんですよ。……私、先生とお別れしたくありません。まだまだ教えていただきたいことが、沢山あるんです。",	"0",	"0",	"不知不觉已经和你相处了这么久了啊，老师。在当驾驶员的时间里，多亏了你的照顾我才没有受伤。真希望分别的日子可以再晚些……我还有很多想向老师请教的东西……",	"0",	"cv_kalian_8",	"0",	"0",	"0"},
