[421502] = {421502,	12015,	3,	3,	"0",	"0",	"原來如此，您就是父親說的那位傳奇領航嗎？我的名字是薇絲帕爾，很高興能夠見到您。",	"0",	"0",	"0",	"原来如此，您就是父亲说的那位传奇领航吗？我的名字是薇丝帕尔，很高兴能够见到您。",	"0",	"cv_vicepearl_1",	"0",	"0",	"0"},
[421503] = {421503,	12015,	4,	4,	"0",	"idle",	"父親雖然貴為支部長，但其實方舟才是多瑙地區的象徵，我們家族能有今天的地位還是拜艾吉斯所賜。",	"0",	"0",	"0",	"父亲虽然贵为支部长，但其实方舟才是多瑙地区的象征，我们家族能有今天的地位还是拜艾吉斯所赐。",	"0",	"cv_vicepearl_3",	"0",	"0",	"0"},
