[421508] = {421508,	12015,	9,	5,	"1_》_100_1.5",	"level2",	"多瑙的勢力錯綜複雜，現在大家只不過是因為原罪而聯合在了一起。不過我還是相信父親能處理好這一切，所以您大可不必擔心，這裡永遠歡迎您。",	"0",	"0",	"0",	"多瑙的势力错综复杂，现在大家只不过是因为原罪而联合在了一起。不过我还是相信父亲能处理好这一切，所以您大可不必担心，这里永远欢迎您。",	"0",	"cv_vicepearl_6",	"0",	"0",	"0"},
[421509] = {421509,	12015,	10,	5,	"1_》_500_2",	"level3",	"我必須要為未來做好準備，當父親老去，當原罪從世界上消失，多瑙又會走向何方？必須得有一個多瑙人得在這場戰爭中成為新的傳奇，這是我們無法規避的命運。領航……我希望您能支持我。",	"0",	"0",	"0",	"我必须要为未来做好准备，当父亲老去，当原罪从世界上消失，多瑙又会走向何方？必须得有一个多瑙人得在这场战争中成为新的传奇，这是我们无法规避的命运。领航……我希望您能支持我。",	"0",	"cv_vicepearl_7",	"0",	"0",	"0"},
