[430203] = {430203,	13002,	4,	4,	"0",	"idle",	"每個人都有不同的經歷和天賦，而這個世界也需要各種各樣的人。所以我才會區別對待兩位小姐，將她們引向不同的路。",	"人はそれぞれ違う経歴と素質を持っています。そしてこの世界にも、様々な人が必要ですわ。故に、私はお嬢様お二人それぞれにあった接し方と導き方をするように心がけております。",	"0",	"0",	"每个人都有不同的经历和天赋，而这个世界也需要各种各样的人。所以我才会区别对待两位小姐，将她们引向不同的路。",	"0",	"cv_tina_3",	"0",	"0",	"0"},
[430204] = {430204,	13002,	5,	4,	"0",	"idle",	"想要成為人才之前，得先成為自己。而我自己……毋庸置疑，我生而為了克雷蒂亞家族。",	"人材を育てるためには、まずそれにふさわしい自分になる必要があります。私の場合は……言うまでもございません。私は、クリティア家のために生きておりますから。",	"0",	"0",	"想要成为人才之前，得先成为自己。而我自己……毋庸置疑，我生而为了克雷蒂亚家族。",	"0",	"cv_tina_4",	"0",	"0",	"0"},
