[430303] = {430303,	13003,	4,	4,	"0",	"idle",	"身為後勤卻總是偷吃？誰說的，那都是試毒，是試毒啦。當然我肯定不可能往菜裡下毒的。",	"後方勤務のくせにいつもつまみ食いしてるって？ないない、あれは毒見だよ、毒見！まぁ、あたしは絶対、ご飯に毒なんか入れないからね。",	"0",	"0",	"身为后勤却总是偷吃？谁说的，那都是试毒，是试毒啦。当然我肯定不可能往菜里下毒的。",	"0",	"cv_kurimu_3",	"0",	"0",	"0"},
[430304] = {430304,	13003,	5,	4,	"0",	"idle",	"領航，聽說最近有個護送臘腸和熏肉的任務，不如我們一起去吧？！你看，我連喝的都準備好了。",	"ナビゲーター、最近ソーセージとベーコンを護送するミッションがあるみたいだけど、一緒に行かない？ほら、あたし、飲み物も用意しといたよ。",	"0",	"0",	"领航，听说最近有个护送腊肠和熏肉的任务，不如我们一起去吧？！你看，我连喝的都准备好了。",	"0",	"cv_kurimu_4",	"0",	"0",	"0"},
[430305] = {430305,	13003,	6,	4,	"0",	"idle",	"我說，你也是這麼覺得的吧，那個伊莉雅其實超級能喝但只是不想表現出來吧？！有機會的話一定要試一下她的……欸？我是被誰從後面提起來了嗎？",	"ほらね！あんたもそう思うでしょ？――イリアって実はめっちゃ飲めるけど、下戸を装ってるだけだって！いつか絶対彼女の……あれ？あたし、誰かに後ろから引っ張られてない？",	"0",	"0",	"我说，你也是这么觉得的吧，那个伊莉雅其实超级能喝但只是不想表现出来吧？！有机会的话一定要试一下她的……哎？我是被谁从后面提起来了吗？",	"0",	"cv_kurimu_27",	"0",	"0",	"0"},
[430306] = {430306,	13003,	7,	5,	"1_》_0_0.8",	"level1",	"卡佳人都能打過熊？開什麼玩笑啦，你都是從哪聽來的謠言啊？！",	"カティア人が熊に勝てるって？何バカなこと言ってるの？それ、何処から聞いたデマなの？！",	"0",	"0",	"卡佳人都能打过熊？开什么玩笑啦，你都是从哪听来的谣言啊？！",	"0",	"cv_kurimu_28",	"0",	"0",	"0"},
[430307] = {430307,	13003,	8,	5,	"1_》_0_0.8",	"level1",	"我，我才沒有偷吃！請不要告訴伊莉雅姐姐啊！",	"つ、つまみ食いしてないって！お願いだから、イリア姉さんに言わないで！",	"0",	"0",	"我，我才没有偷吃！请不要告诉伊莉雅姐姐啊！",	"0",	"cv_kurimu_5",	"0",	"0",	"0"},
[430308] = {430308,	13003,	9,	5,	"1_》_100_1.5",	"level2",	"看來你已經上道了啊，以後不如這麼稱呼你吧，我的摯友~來為我們的友誼乾杯！",	"段々分かってくれるようになったじゃん、これからは親友って呼んであげるよ。それじゃ、この友情のに、乾杯！",	"0",	"0",	"看来你已经上道了啊，以后不如这么称呼你吧，我的挚友~来为我们的友谊干杯！",	"0",	"cv_kurimu_6",	"0",	"0",	"0"},
[430309] = {430309,	13003,	10,	5,	"1_》_500_2",	"level3",	"欸？領航……為什麼會有2個，3個，4個領航……欸呀呀，我是到天堂了嗎？",	"え？ナビゲーター……なんで、ナビゲーターが二人も、三人も、四人もいるの……あれ？あたしって、天国にいるのかなー…...…？",	"0",	"0",	"哎？领航……为什么会有2个，3个，4个领航……哎呀呀，我是到天堂了吗？",	"0",	"cv_kurimu_7",	"0",	"0",	"0"},
[430310] = {430310,	13003,	11,	5,	"1_》_1000_2.5",	"level4",	"世界上還有很多沒法頓頓都吃飽的人，在我沒有加入艾吉斯前也是他們中的一員。但是我相信，如果只要你能堅持走下去的話，一定可以改變這一切吧。既然如此，我會一直陪在你的身邊，成為你最堅固的後盾。",	"この世界にはね、飢えに苦しむ人々が沢山いるの。アイギスに加入するまでのあたしもそうだった。でも、前に進み続けるあんたなら、きっと全てのことを変えられる。あたしはそう信じてる。だから、あたしはずっと、あんたのそばにいて、あんたの一番の支持者で、理解者になるって決めたの。",	"0",	"0",	"世界上还有很多没法顿顿都吃饱的人，在我没有加入艾吉斯前也是他们中的一员。但是我相信，如果只要你能坚持走下去的话，一定可以改变这一切吧。既然如此，我会一直陪在你的身边，成为你最坚固的后盾。",	"0",	"cv_kurimu_8",	"0",	"0",	"0"},
