[430409] = {430409,	13004,	10,	5,	"1_》_500_2",	"level3",	"領航，請允許在下為你示範正確的點穴方式吧——疼痛只是一瞬間的，馬上就結束了。",	"拙者が正しい点穴のやり方の手本をお見せしよう――一瞬だけ痛みが走るが、すぐに終わる。",	"0",	"0",	"领航，请允许在下为你示范正确的点穴方式吧——疼痛只是一瞬间的，马上就结束了。",	"0",	"cv_ayaka_7",	"0",	"0",	"0"},
[430410] = {430410,	13004,	11,	5,	"1_》_1000_2.5",	"level4",	"領航……如果你不介意的話，在下想請你作為在下的練習對象。欸？可以嗎？明明是工作時間……那麼，在下不客氣了！喝！",	"もしよければ、拙者の練習相手になってくれるか？うえ？いいのか？仕事中なのに……では、失礼する！はっ！",	"0",	"0",	"领航……如果你不介意的话，在下想请你作为在下的练习对象。诶？可以吗？明明是工作时间……那么，在下不客气了！喝！",	"0",	"cv_ayaka_8",	"0",	"0",	"0"},
