[430423] = {430423,	13004,	28,	21,	"0",	"0",	"熱浴的前後一段時間內都不能夠針灸，這是泡澡的唯一壞處呢。",	"熱い風呂の前後は鍼灸を施せない。これが風呂の唯一の欠点だ。",	"0",	"0",	"热浴的前后一段时间内都不能够针灸，这是泡澡的唯一坏处呢。",	"0",	"cv_ayaka_21",	"0",	"0",	"0"},
