[430601] = {430601,	13006,	2,	2,	"0",	"0",	"是！那麼，時薪是…什麼，沒有嗎？嘁——",	"はぁい！じゃあ時給は……えぇ、でないの？ちぇ。",	"0",	"0",	"是！那么，时薪是…什么，没有吗？嘁——",	"0",	"cv_yincao_2",	"0",	"0",	"0"},
[430602] = {430602,	13006,	3,	3,	"0",	"0",	"我來了喔~心經屋的經紀人…不，心經屋的巫女，小瑩草，向你報導，領航。",	"ナビゲーターちゃん、お待たせぇ。心経屋のマネージャー…じゃなかった、心経屋の巫女、蛍草ちゃんよぉ。",	"0",	"0",	"我来了噢~心经屋的经纪人…不，心经屋的巫女，小莹草，向你报道，领航。",	"0",	"cv_yincao_1",	"0",	"0",	"0"},
[430603] = {430603,	13006,	4,	4,	"0",	"idle",	"瑩草姐？討厭啦，是小瑩草才對。下次再叫錯的話…你會死喔？",	"蛍草姉さん？やあねえ。蛍草ちゃん、だよ。次に呼び間違えたら…死んじゃうかもよぉ？",	"0",	"0",	"莹草姐？讨厌啦，是小莹草才对。下次再叫错的话…你会死噢？",	"0",	"cv_yincao_3",	"0",	"0",	"0"},
[430604] = {430604,	13006,	5,	4,	"0",	"idle",	"在現代社會，只要經受過培訓，任何人都能成為巫女——領航想試試看嗎，我給你備好巫女服了。",	"今はちょっと研修を受ければ、誰でも巫女になれるの。ナビゲーターちゃんはどう？あなたの分の巫女装束も用意してあるのよぉ。",	"0",	"0",	"在现代社会，只要经受过培训，任何人都能成为巫女——领航想试试看吗，我给你备好巫女服了。",	"0",	"cv_yincao_4",	"0",	"0",	"0"},
[430605] = {430605,	13006,	6,	4,	"0",	"idle",	"領航，你的臉色很難看喔——花語剛剛看到我們了？唔嗯…被她看見了的話，就麻煩了，是不是先預定一下床位比較好？",	"ナビゲーターちゃん、顔色が悪いわよ？……私たちが一緒にいるところを花語（はなことば）に見られたの？うーん……今のうちに病院のベッドの予約、しておいたらぁ？",	"0",	"0",	"领航，你的脸色很难看噢——花语刚刚看到我们了？唔嗯…被她看见了的话，就麻烦了，是不是先预定一下床位比较好？",	"0",	"cv_yincao_28",	"0",	"0",	"0"},
[430606] = {430606,	13006,	7,	5,	"1_》_0_0.8",	"level1",	"溫柔地引領迷茫之人，點亮前進道路的燈……大概，我沒辦法成為這樣的巫女。不過，我所守護那名少女一定…領航，你能幫我嗎？",	"迷える人をそっと導いて、道を照らす灯りになる。……多分私はそんな巫女にはなれないと思うの。でも、私が守ったあの少女ならきっと……。ナビゲーターちゃん、お願い。力を貸してね。",	"0",	"0",	"温柔地引领迷茫之人，点亮前进道路的灯……大概，我没办法成为这样的巫女。不过，我所守护那名少女一定…领航，你能帮我吗？",	"0",	"cv_yincao_29",	"0",	"0",	"0"},
[430607] = {430607,	13006,	8,	5,	"1_》_0_0.8",	"level1",	"嗯？喔，我正在算這個月的收支。",	"なに？ああ、今月の収支を計算していたところよぉ。",	"0",	"0",	"嗯？噢，我正在算这个月的收支。",	"0",	"cv_yincao_5",	"0",	"0",	"0"},
[430608] = {430608,	13006,	9,	5,	"1_》_100_1.5",	"level2",	"居然有人說巫女只要微笑迎客就行了…別小看巫女這個職業啊！打掃衛生、朝拜神社、主持典禮，還要練習舞蹈…可沒想像中那麼輕鬆。",	"巫女なんてニコニコしてれば何とかなるって言う人がいるけど……舐めないでほしいわ！神社の掃除に参拝者への対応、祭祀の補助に舞の練習……みんなが思っているほど楽じゃないのよぉ。",	"0",	"0",	"居然有人说巫女只要微笑迎客就行了…别小看巫女这个职业啊！打扫卫生、朝拜神社、主持典礼，还要练习舞蹈…可没想象中那么轻松。",	"0",	"cv_yincao_6",	"0",	"0",	"0"},
[430609] = {430609,	13006,	10,	5,	"1_》_500_2",	"level3",	"我和想像中的巫女不一樣？領航，平安年代之後，巫女被賦予沉重意義的時代也就結束了…“可靠”，呵呵，我就當做誇獎收下了。",	"想像してた巫女とは違う？ナビゲーターちゃん、平安時代と今では、巫女が与えられた役割が違うのよ。……頼もしい？フフ、もったいない言葉だわぁ。",	"0",	"0",	"我和想象中的巫女不一样？领航，平安年代之后，巫女被赋予沉重意义的时代也就结束了…“可靠”，呵呵，我就当做夸奖收下了。",	"0",	"cv_yincao_7",	"0",	"0",	"0"},
[430610] = {430610,	13006,	11,	5,	"1_》_1000_2.5",	"level4",	"“夢想”、“理想”、“願望”之類的，我已經很久沒有說過這種話了。不過…心紙，還有領航，你們卻應該去追逐它們。請放心地翱翔吧，其他的交給我來處理吧。",	"夢とか理想とか願いなんて、私には遠い思い出よ。でも…心紙ちゃんやナビゲーターちゃんには、まだそういったものを追いかけてほしいの。他のことは私に任せて、安心して前に進んでちょうだい。",	"0",	"0",	"“梦想”、“理想”、“愿望”之类的，我已经很久没有说过这种话了。不过…心纸，还有领航，你们却应该去追逐它们。请放心地翱翔吧，其他的交给我来处理吧。",	"0",	"cv_yincao_8",	"0",	"0",	"0"},
