[430909] = {430909,	13009,	10,	5,	"1_》_500_2",	"level3",	"只有親身經歷一次才會明白，這個世界上並不存在天堂。被黑暗吞沒也只是一瞬間的事……但是這些已經過去了，我能從那漫無邊際的噩夢中醒來已經足夠了。",	"0",	"0",	"0",	"只有亲身经历一次才会明白，这个世界上并不存在天堂。被黑暗吞没也只是一瞬间的事……但是这些已经过去了，我能从那漫无边际的噩梦中醒来已经足够了。",	"0",	"cv_evatee_7",	"0",	"0",	"0"},
