[431002] = {431002,	13010,	3,	3,	"0",	"0",	"新來的領航？今後就請多多關照了，無論是戰鬥還是生活的事都可以找我幫忙。話說，你看到我們時會嚇一跳嗎？",	"新しいナビゲーター？これからよろしくね。戦闘でもそれ以外でも、困ったことがあれば力になるわ。……ねえ。私たちを初めて見て、驚いたかしら？",	"0",	"0",	"0",	"0",	"cv_qu_3",	"0",	"0",	"0"},
