[431005] = {431005,	13010,	6,	4,	"0",	"idle",	"銀有時會太過衝動，而瓏不過還是個孩子，不能很好地適應戰場……在她們成長起來之前，我得肩負起保護同胞的責任。",	"銀は衝動的になりすぎるところがあるし、瓏は戦場に出るべきではない子供よ……あの子たちが成長するまでは、私が仲間を守る責任を負うわ。",	"0",	"0",	"0",	"0",	"cv_qu_6",	"0",	"0",	"0"},
[431006] = {431006,	13010,	7,	5,	"1_》_0_0.8",	"level1",	"埃塔人對你們人類來說是外來者，只是因為原罪才能保持我們之間的和平。如果有一天原罪被消滅了，我們該以什麼方式相處呢？",	"あなた達人間にとってエッタ人はよそ者よ。私たちの間に平和が保たれているのは、原罪に対抗するためだけど……いつか全ての原罪を滅ぼしたら、私たちはどう付き合えばいいの？",	"0",	"0",	"0",	"0",	"cv_qu_7",	"0",	"0",	"0"},
