[431010] = {431010,	13010,	11,	5,	"1_》_1000_2.5",	"level4",	"在之前的通感中，我明白了領航的心意，領航也瞭解了我黑暗的過去。所以在艾吉斯中我能相信的只有你一個。只有和領航在一起，我才能真正感到安心。",	"この前の通感覚で、私はナビゲーターの心を理解することができた。……そしてナビゲーターも、私の暗い過去を知ったのね。だから、アイギスで信頼できるのはナビゲーターだけ。あなたと一緒にいる時だけ、私は本当に安らげるの。",	"0",	"0",	"0",	"0",	"cv_qu_11",	"0",	"0",	"0"},
