[431203] = {431203,	13012,	4,	4,	"0",	"idle",	"魔女的占卜時間，無論是財運、事業運，還是其他需求，我都可以為你占卜。……戀愛運？看不出來，你還真是單純啊……",	"魔女の占いタイムです！金運や仕事運、どんなことでも占っちゃいますよ！……恋愛運ですか？ナビゲーターさん、意外とピュアなんですね。",	"0",	"0",	"0",	"0",	"cv_dorothy_5",	"0",	"0",	"0"},
[431204] = {431204,	13012,	5,	4,	"0",	"idle",	"我要去參加魔女們的聚會了，要一起去玩嗎……有事情要忙？真可惜呢……那下次可輪到領航來邀請我了哦。",	"魔女たちのパーティーに行くんですが、ナビゲーターさんも一緒にいかがですか？……用事がある？うーん、残念ですね……じゃあ今度はナビゲーターさんから誘ってくださいね！",	"0",	"0",	"0",	"0",	"cv_dorothy_6",	"0",	"0",	"0"},
[431205] = {431205,	13012,	6,	4,	"0",	"idle",	"要把我調回多瑙支部？……我現在可是正處於離家出走的狀態呢。但是……假如領航一定要我陪在你身邊，也不是不可以哦？",	"私をダニューブ支部に？いまは家出中の身なんですが……でももし、ナビゲーターさんがどうしてもって言うのなら……行っちゃおうかなぁ……",	"0",	"0",	"0",	"0",	"cv_dorothy_7",	"0",	"0",	"0"},
[431206] = {431206,	13012,	7,	5,	"1_》_0_0.8",	"level1",	"其實今年是我渡過的的第497個年頭……欸？身份證明上寫著我的出生年月？姆——真是的，領航，在我維護“職業”神秘感的時候，不要幹這樣掃興的事情哦。",	"今年で４９７回目の夏ですね……って何で嘘って知ってるんですか！？ＩＤに生年月日が書いてあった？もう！この仕事は神秘的なのも大事なんですから、ばらさないでくださいよー！",	"0",	"0",	"0",	"0",	"cv_dorothy_8",	"0",	"0",	"0"},
[431207] = {431207,	13012,	8,	5,	"1_》_0_0.8",	"level1",	"擅自靠近魔女可是會招致災厄的哦。",	"不用意に魔女に近づくと、災いを招きますよ。",	"0",	"0",	"0",	"0",	"cv_dorothy_9",	"0",	"0",	"0"},
[431208] = {431208,	13012,	9,	5,	"1_》_100_1.5",	"level2",	"在故事中，接觸魔女的人都會帶上不幸……但是領航你還是這樣靠過來了。要不稍微陪我一會吧，我來給你解除這段不幸的詛咒。",	"魔女に近づくと不幸になる……って言い伝えがあるのに、ナビゲーターさんは気にせず接してくださいましたね。良かったら、もうちょっと付き合ってくださいませんか？「不幸の呪い」を解いてさしあげますから。",	"0",	"0",	"0",	"0",	"cv_dorothy_10",	"0",	"0",	"0"},
[431209] = {431209,	13012,	10,	5,	"1_》_500_2",	"level3",	"這是勇者的塔羅牌，在這個故事裏，拯救世界的使命交給你了。……塔羅牌沒有勇者牌？我的塔羅有哦~你就是我挑選的勇者。",	"これは……勇者のタロットカードです！この物語で世界を救うのは、ナビゲーターさんですよ！……え？タロットカードに勇者なんてあったかって？私のタロットにはあるんです！ナビゲーターさんは私が選んだ勇者なんですから！",	"0",	"0",	"0",	"0",	"cv_dorothy_11",	"0",	"0",	"0"},
[431210] = {431210,	13012,	11,	5,	"1_》_1000_2.5",	"level4",	"我真的是魔女嗎？……來，看著這個，3，2，1。好了，我已經對你施加了會不知不覺愛上我的魔法，而且已經生效了哦~",	"私が本当に魔女なのか、信じてないんですか？……じゃあ、これを見てください。３…２…１…はい！ナビゲーターさんが私のことを好きになる魔法をかけちゃいました。ほーら、もう効いてるでしょう？",	"0",	"0",	"0",	"0",	"cv_dorothy_12",	"0",	"0",	"0"},
[431211] = {431211,	13012,	12,	6,	"0",	"0",	"更多地、許諾我更多的力量吧……",	"もっと、私にもっと力をお与えください……",	"0",	"0",	"0",	"0",	"cv_dorothy_13",	"0",	"0",	"0"},
