[431902] = {431902,	13019,	3,	3,	"0",	"0",	"初次見面，我是來自“學宮”的……啊，不，現在應該叫平心社了……我是平心社的朝霧，小……小女子不才，我……我會全心全意支援領航的。",	"初めてお目にかかります。学宮（がっきゅう）……あ、いえ。今は平心社（へいしんしゃ）の朝霧（ちょうむ）と申します。ふ、不束者ですが、全身全霊でナビゲーターをお支えします。",	"0",	"0",	"0",	"0",	"cv_zhaowu_3",	"0",	"0",	"0"},
[431903] = {431903,	13019,	4,	4,	"0",	"idle",	"“學宮”……是我出身、長大的地方，一個能讓人能靜下心來讀書的地方……但是我現在已經不用回去了。沒事的……是我自己決定出來的，我是為了領航，也是為了我自己而來的。",	"学宮……わたくしが生まれ育ち、心静かに学ぶことができた場所。……でももう帰ることはありません。……わたくし自身のために、そしてナビゲーターのために……自分で決断したのです。",	"0",	"0",	"0",	"0",	"cv_zhaowu_4",	"0",	"0",	"0"},
[431904] = {431904,	13019,	5,	4,	"0",	"idle",	"我覺得……領航就是我們一直在等待的人。我們“平心社”的責任，我的目標在遇見領航的時候就已經完成了，接下來只需要陪伴著您就好了。",	"わたくし達が待ち望んでいたのはきっと……ナビゲーターです。平心社の目的と使命は、あなたと出会った瞬間に達成されました。これからは、あなたの傍にいるだけで良いのです。",	"0",	"0",	"0",	"0",	"cv_zhaowu_5",	"0",	"0",	"0"},
[431905] = {431905,	13019,	6,	4,	"0",	"idle",	"我認為領航的存在比任何人都重要——所以在危險的時候，請毫不留情地使用我吧，能和您經歷過這麼多事情，我已經很滿足了。",	"ナビゲーターは誰よりも重要な存在です。危険な時は迷わずわたくしを盾にしてください。あなたと多くの時間を共有することができて、わたくしはもう十分満足です。",	"0",	"0",	"0",	"0",	"cv_zhaowu_6",	"0",	"0",	"0"},
[431906] = {431906,	13019,	7,	5,	"1_》_0_0.8",	"level1",	"領航，請不要……碰觸我這個戴罪之人。",	"ナビゲーター……どうかこの咎人に触れないでください。",	"0",	"0",	"0",	"0",	"cv_zhaowu_7",	"0",	"0",	"0"},
