[431908] = {431908,	13019,	9,	5,	"1_》_100_1.5",	"level2",	"我是作為罪人降生在這個世界上的，但是謝謝您能相信我。您允許我站在您的身邊，不知道為什麼……讓我感到放鬆。",	"咎人としてこの世に生を受けたわたくしを信じてくださって、ありがとうございます。あなたの隣はなぜか……心が安らぐのです。",	"0",	"0",	"0",	"0",	"cv_zhaowu_9",	"0",	"0",	"0"},
[431909] = {431909,	13019,	10,	5,	"1_》_500_2",	"level3",	"我犯下了什麼過錯……您無需擔心，相伴在您身邊的每一天，便是在贖罪的每一天，但是——我希望您知道，我並不是為了贖罪待在您身邊的，而是我希望，我想要……我憧憬著您。",	"わたくしが犯した罪、ですか……どうか、お気になさらないでください。あなたのそばにいる毎日が償いの日々ですが……罪滅ぼしのためにあなたの傍にいるのではありません。わたくしが……わたくしがあなたに憧れているからです。",	"0",	"0",	"0",	"0",	"cv_zhaowu_10",	"0",	"0",	"0"},
