[432002] = {432002,	13020,	3,	3,	"0",	"0",	"這裏是梅貝爾·伊司，薩哈拉蒼穹學院的一名哲學教師，隸屬於制蜜人小隊。唔，介紹應該就這些了……",	"私はメイベル・イース。サハラの「ファーマメントアカデミー」で哲学の授業担当。ハニーメイカーに所属。これぐらいかな……。",	"0",	"0",	"0",	"0",	"cv_mayball_3",	"0",	"0",	"0"},
[432003] = {432003,	13020,	4,	4,	"0",	"idle",	"等工作完就放鬆下吧，去咖啡館會會朋友，享受靜謐、芬芳，以及……哈嗚~思想的碰撞。",	"仕事が終わったら、友達とカフェで会って、リラックスして、静かな時間と良い香り、そして…ふぁ～、思想のぶつかり合いを楽しむの。",	"0",	"0",	"0",	"0",	"cv_mayball_4",	"0",	"0",	"0"},
[432004] = {432004,	13020,	5,	4,	"0",	"idle",	"我這悠閒散漫的樣子不太受一些學生歡迎，雖說作為教師有些失敗，但反面教材也算教嘛~",	"のんびりしてる私は、一部の生徒からあまり良く思われてないみたい。でも教師としては成功かな…反面教師としてだけど。",	"0",	"0",	"0",	"0",	"cv_mayball_5",	"0",	"0",	"0"},
[432005] = {432005,	13020,	6,	4,	"0",	"idle",	"普瑞席歐和墨君都是工作狂，小隊有她們真讓人輕鬆不少。至於斯緹菈，軟乎乎的非常治癒呢，領航同學也要試試嗎？",	"プレシオと墨君（ぼくくん）は仕事狂いだから、彼女たちがいるとチームはかなり楽になる。ステラは……柔らかくて癒されるの、ナビゲーターくんも試してみない？",	"0",	"0",	"0",	"0",	"cv_mayball_6",	"0",	"0",	"0"},
[432006] = {432006,	13020,	7,	5,	"1_》_0_0.8",	"level1",	"存在即虛無，因此，存在才會不斷探尋意義……但虛無真的能被填滿嗎？",	"存在は虚無であるが故に、意味を探し続ける。虚無を埋めることは出来るのかな？",	"0",	"0",	"0",	"0",	"cv_mayball_7",	"0",	"0",	"0"},
[432007] = {432007,	13020,	8,	5,	"1_》_0_0.8",	"level1",	"我看起來有些困？請不用擔心，就算不小心睡著，手上的書正好能作為一個小枕頭。",	"少し疲れているように見える？心配しないで。うっかり寝てしまっても、この本がちょうど枕代わりになるから。",	"0",	"0",	"0",	"0",	"cv_mayball_8",	"0",	"0",	"0"},
[432008] = {432008,	13020,	9,	5,	"1_》_100_1.5",	"level2",	"哲學書艱深晦澀，有些能打消困倦，有些能使人安眠。領航同學喜歡哪種呢？",	"哲学の本は難解で深遠。眠気が飛ぶものもあれば、眠りへ誘うものもある。ナビゲーターくんはどちらがお好み？",	"0",	"0",	"0",	"0",	"cv_mayball_9",	"0",	"0",	"0"},
[432009] = {432009,	13020,	10,	5,	"1_》_500_2",	"level3",	"偶爾會感到迷茫嗎？沒關係，能夠迷茫正是“存在先於本質”的證明，這不是壞事。",	"たまに迷いを感じることはある？心配しないで。迷いを感じることこそ「実存は本質に先立つ」ということの証明。悪いことではないよ。",	"0",	"0",	"0",	"0",	"cv_mayball_10",	"0",	"0",	"0"},
[432010] = {432010,	13020,	11,	5,	"1_》_1000_2.5",	"level4",	"領航同學，我可以更加依靠你一些嗎？比如……要是嗜睡症不小心發作，希望正好有你在我身邊……這種感覺？",	"ナビゲーターくん、もっと君に頼ってもいいかな？…もし過眠症の発作が起きたとき、君が側にいてくれたらいいなって思って。",	"0",	"0",	"0",	"0",	"cv_mayball_11",	"0",	"0",	"0"},
