[432013] = {432013,	13020,	14,	8,	"0",	"0",	"“覺醒”嗎？這詞真不適合我呢，說不定我下一秒就會睡著。但領航同學一直對我有所期待，果然我還是拿出十足的幹勁吧~",	"「覚醒」？私にはあまり似合わないね。もしかしたら、次の瞬間には寝てしまうかもしれないのに。でも、ナビゲーターくんが期待してくれてるなら、頑張ってみようかな。",	"0",	"0",	"0",	"0",	"cv_mayball_14",	"0",	"0",	"0"},
