[900002] = {900002,	90000,	4,	4,	"0_0_0_0.1",	"6",	"比起給予萬物生命但卻令人無法直視的太陽，我更加喜歡維繫著規則但卻更加柔和的月亮。",	"お日さまは皆は万物に命を与えてくれるけど、直視できない。私は柔らかい光のお月さまの方が好き。",	"0",	"0",	"比起给予万物生命但却令人无法直视的太阳，我更加喜欢维系着规则但却更加柔和的月亮。",	"0",	"cv_jiya_7",	"0",	"0",	"0"},
[900003] = {900003,	90000,	5,	4,	"0_0_0_0.1",	"7",	"等戰爭結束，我想親自去海邊看一看。然後…如果我的病能痊癒的話，吉雅想自己在海邊開一間花店。",	"戦争が終わったら、海に行ってみたい。あと……もし病気が治ったら、海沿いでお花屋さんをやりたい。",	"0",	"0",	"等战争结束，我想亲自去海边看一看。然后…如果我的病能痊愈的话，吉雅想自己在海边开一间花店。",	"0",	"cv_jiya_8",	"0",	"0",	"0"},
