[900005] = {900005,	90000,	46,	4,	"0_0_0_0.1",	"9",	"如果能快點當上情報官的話，就能幫上哥哥了吧。好！趁著還有力氣，今天也要打起精神努力學習喔！",	"早く情報官になれば、お兄ちゃんの力になれるよね。よし。まだまだいける気がするし…、今日も頑張って勉強する！",	"0",	"0",	"如果能快点当上情报官的话，就能帮上哥哥了吧。好！趁着还有力气，今天也要打起精神努力学习哦！",	"0",	"cv_jiya_10",	"0",	"0",	"0"},
[900006] = {900006,	90000,	47,	4,	"0_0_0_0.1",	"10",	"寂寞？沒關係，因為每天都能和哥哥視頻所以也不算太寂寞。當然，如果哥哥能早點回來那就更好了。多洛莉絲小姐教會了我很多新的料理，就等您回來檢驗成果了。",	"寂しいかって……？私は大丈夫だよ。だって、毎日お兄ちゃんとテレビ電話できるし、寂しくないよ。…でもお兄ちゃんがもうちょっと早く帰ってきてくれればうれしいなぁって。ドロリィスさんに沢山の新しい料理を教えてもらったから、その成果を見せてあげたいの。",	"0",	"0",	"寂寞？没关系，因为每天都能和哥哥视频所以也不算太寂寞。当然，如果哥哥能早点回来那就更好了。多洛莉丝小姐教会了我很多新的料理，就等您回来检验成果了。",	"0",	"cv_jiya_11",	"0",	"0",	"0"},
[900007] = {900007,	90000,	48,	4,	"0_0_0_0.1",	"11",	"沒想到會被破格提升成情報官啊……雖然能幫上哥哥的忙很開心，但是如果我有做得不好的地方還請哥哥一定要指出……畢竟我不能再在工作上給您添麻煩了。",	"まさか情報官に抜擢されるなんて、思ってもみなかった……やっとお兄ちゃんの力になれるし、嬉しいけど……何か駄目なところがあったら言ってね、お兄ちゃん……これ以上お仕事で…お兄ちゃんに、迷惑かけるわけにはいかないから。",	"0",	"0",	"没想到会被破格提升成情报官啊……虽然能帮上哥哥的忙很开心，但是如果我有做得不好的地方还请哥哥一定要指出……毕竟我不能再在工作上给您添麻烦了。",	"0",	"cv_jiya_12",	"0",	"0",	"0"},
[900008] = {900008,	90000,	49,	5,	"1_》_0_0.3",	"12",	"呼呼呼，哥哥你總是這麼溫柔啊……哪怕哥哥不摸我的頭，只是陪在我身邊我就很幸福了。",	"うふふ。お兄ちゃんっていつも優しいね……頭をぽんぽんしてくれるのも嬉しいけど、本当はそばにいてくれるだけで幸せなんだよ。",	"0",	"0",	"呼呼呼，哥哥你总是这么温柔啊……哪怕哥哥不摸我的头，只是陪在我身边我就很幸福了。",	"0",	"cv_jiya_13",	"0",	"0",	"0"},
[900009] = {900009,	90000,	50,	5,	"1_》_0_0.3",	"13",	"哇呼——哥哥……不對…領…領航，這麼多都在看著我們……我還是用輪椅吧……但是…像這樣被您抱著的感覺並不討厭……",	"えっ――お兄ちゃん……あっ、えっと、ナ……ナビゲーター、みんな見ているから……私、やっぱり車椅子で……うう。……でも、こうやって抱き上げられるのは、本当は嫌じゃないかも……",	"0",	"0",	"哇呼——哥哥……不对…领…领航，这么多都在看着我们……我还是用轮椅吧……但是…像这样被您抱着的感觉并不讨厌……",	"0",	"cv_jiya_14",	"0",	"0",	"0"},
