[900011] = {900011,	90000,	52,	5,	"1_》_0_0.2",	"15",	"“想要被認同…想要和其他人一樣……被媽媽認同……”哥哥，我最近總是聽到這樣的聲音在耳邊迴響，到底是誰呢？",	"「認めてもらいたい……他の人みたいに……母さんに認めてもらいたい……」お兄ちゃん、最近ね、いつもこんな声が聞こえてくるんだけど……。一体誰だろう……？",	"0",	"0",	"“想要被认同…想要和其他人一样……被妈妈认同……”哥哥，我最近总是听到这样的声音在耳边回响，到底是谁呢？",	"0",	"cv_jiya_16",	"0",	"0",	"0"},
[900012] = {900012,	90000,	53,	5,	"1_》_0_0.2",	"16",	"“將一切都捨棄掉之後……就能心無旁騖地進食了，只要進食得足夠多，馬上就能回到母親身邊了……。”哥哥，好像又有新的聲音出現了！這是……",	"「全部捨てたら……遠慮なく食べられるようになる。沢山食べれば、すぐに母さんの所に帰れる……。」お兄ちゃん、また新しい声が……！これって……",	"0",	"0",	"“将一切都舍弃掉之后……就能心无旁骛地进食了，只要进食得足够多，马上就能回到母亲身边了……。”哥哥，好像又有新的声音出现了！这是……",	"0",	"cv_jiya_17",	"0",	"0",	"0"},
