[9000500] = {9000500,	90005,	97,	0,	"0",	"idle",	"如果在旅途中有撿到什麼奇怪東西的話，可以到吾這裡來交換補給品哦。哼哼，我們可是準備了很久的，絕對會讓你大吃一驚！",	"旅の途中で変なものを拾ったら、妾のところで補給品を交換しに来るとよい。ふんふん、準備するのにけっこう時間を掛ったから、汝は絶対驚くぞ!",	"0",	"0",	"如果在旅途中有捡到什么奇怪东西的话，可以到吾这里来交换补给品哦。哼哼，我们可是准备了很久的，绝对会让你大吃一惊！",	"0",	"shop_sikadi_1",	"0",	"0",	"0"},
[9000501] = {9000501,	90005,	97,	0,	"0",	"idle2",	"這裡是魔女桃樂西的小屋，歡迎你遠道而來的冒險者。不過桃樂西現在不在這裡，有什麼需求的話就和吾講吧！",	"ここは魔女ドロシーの小屋、歓迎するぞ、冒険者！ああでも今ドロシーはここにいないから、何か欲しいものがあったら妾に言ってくれよ!",	"0",	"0",	"这里是魔女多萝西的小屋，欢迎你远道而来的冒险者。不过多萝西现在不在这里，有什么需求的话就和吾讲吧！",	"0",	"shop_sikadi_2",	"0",	"0",	"0"},
[9000502] = {9000502,	90005,	98,	0,	"0",	"shy1.1",	"嗯——既然領航是影之國的國民，那就給領航一個特別優惠好了！",	"うむ、影の国の住人ナビゲーターよ、特別にサービスしてやろう！",	"0",	"0",	"嗯——既然领航是影之国的国民，那就给领航一个特别优惠好了！",	"0",	"shop_sikadi_3",	"0",	"0",	"0"},
[9000503] = {9000503,	90005,	97,	0,	"0",	"shy1.2",	"小店馬上就要關門了。領航，等關店了之後，陪吾去沙灘上散一步吧？",	"このショップももうすぐ閉店だ。ナビゲーター、そのあとは砂浜で散歩しようか？",	"0",	"0",	"小店马上就要关门了。领航，等关店了之后，陪吾去沙滩上散一步吧？",	"0",	"shop_sikadi_4",	"0",	"0",	"0"},
[9000504] = {9000504,	90005,	97,	0,	"0",	"happy",	"《編年史外傳——夢世界見聞錄》公演大成功！吾是拯救了世界的英雄哦，領航。",	"「クロニクル外伝ーー夢の見聞録」、公演大成功！妾こそが世界を救った英雄だぞ！",	"0",	"0",	"《编年史外传——梦世界见闻录》公演大成功！吾是拯救了世界的英雄哦，领航。",	"0",	"shop_sikadi_5",	"0",	"0",	"0"},
[9000505] = {9000505,	90005,	97,	0,	"0",	"happy2",	"領航，吾在沙灘上收到了很多海之祭品哦！小希她們已經在處理食材了，今天就吃這個吧！",	"ナビゲーター、砂浜たっくさん海の贄が貰ったぞ！希ちゃんたちはもう捌いているよ、今日のご飯はそれにしよう！",	"0",	"0",	"领航，吾在沙滩上收到了很多海之祭品哦！小希她们已经在处理食材了，今天就吃这个吧！",	"0",	"shop_sikadi_6",	"0",	"0",	"0"},
[9000506] = {9000506,	90005,	98,	0,	"0",	"jingya",	"領航還有什麼想要的嗎？吾去看看庫存裡有沒有。",	"ナビゲーターはほかに何か欲しいものあるか？妾が在庫を見てくるぞ。",	"0",	"0",	"领航还有什么想要的吗？吾去看看库存里有没有。",	"0",	"shop_sikadi_7",	"0",	"0",	"0"},
[9000507] = {9000507,	90005,	98,	0,	"0",	"normal",	"吾準備了很多珍寶！要用領航的努力來交換哦！加油——領航！",	"沢山のお宝を用意してるから、ナビゲーターも頑張って交換しよう！ファイトだぞ！",	"0",	"0",	"吾准备了很多珍宝！要用领航的努力来交换哦！加油——领航！",	"0",	"shop_sikadi_8",	"0",	"0",	"0"},
[9000600] = {9000600,	90006,	97,	0,	"0",	"idle",	"幹嘛喵，領航你找芙露露有事喵？芙露露現在不忙，可以陪你聊很久很久。",	"0",	"0",	"0",	"如果在旅途中有捡到什么奇怪东西的话，可以到吾这里来交换补给品哦。哼哼，我们可是准备了很久的，绝对会让你大吃一惊！",	"0",	"shop_fururu_1",	"0",	"0",	"0"},
[9000601] = {9000601,	90006,	97,	0,	"0",	"kaixin",	"今天早上打早飯的時候被人多送了一個雞蛋，說是讓芙露露長高些什麼的。不過，芙露露當時已經吃飽了，所以就偷偷留給你了喵，喏。",	"0",	"0",	"0",	"这里是魔女多萝西的小屋，欢迎你远道而来的冒险者。不过多萝西现在不在这里，有什么需求的话就和吾讲吧！",	"0",	"shop_fururu_2",	"0",	"0",	"0"},
