[4000100102] = {4000100102,	10001001,	3,	3,	"0",	"0",	"朱利烏斯·馮·尼采，從現在起將作為您最出色的部下，為了我們共同的榮耀而戰鬥。",	"ユリウス・フォン・ニーチェです。これからあなた様の一番の部下として、我らの栄光のため、共に戦いましょう。",	"0",	"0",	"朱利乌斯·冯·尼采，从现在起将作为您最出色的部下，为了我们共同的荣耀而战斗。",	"0",	"cv_sk_Julius_1",	"0",	"0",	"0"},
[4000100103] = {4000100103,	10001001,	4,	4,	"0",	"idle",	"耀眼眩目的燈光、過於歡快的舞曲……雖說參與者都是年輕駕駛員，沒有太多寒暄與繁文縟節，但我果然還是不適應這種場合，幸好有邀您一同前來。",	"華やかな照明と楽しい音楽……若いドライバーばかりですから堅苦しい雰囲気はありませんが、こういう場は少し慣れなくて……だから、あなた様に一緒に来ていただいて良かったです。",	"0",	"0",	"我想要做的，我能做到的，只不过是笨拙地模仿先人罢了。但是，哪怕是如此愚钝的我还是有一点可以向您保证……赌上家族的荣耀，我一定会为您带来光荣的胜利。",	"0",	"cv_sk_Julius_3",	"0",	"0",	"0"},
[4000100104] = {4000100104,	10001001,	5,	4,	"0",	"idle",	"這是由我們家族舉辦的宴會，而作為長女，待會我必須為來賓們進行一番演講，宣說家族的誓言、使命與榮耀。屆時……您也會在旁聆聽的吧？",	"私の家族が主催するパーティーですから、私は長女として、家族の誓いと使命、そして栄光を誓うスピーチをしなければなりません。……もしよろしければ、側にいていただけますか？",	"0",	"0",	"在这里停留了这么久，难道说领航已经很累了吗？没关系的，您去休息好了，这里交给我就行了。",	"0",	"cv_sk_Julius_4",	"0",	"0",	"0"},
[4000100105] = {4000100105,	10001001,	6,	4,	"0",	"idle",	"穿著高跟鞋，還非得跳華爾滋……在舞會上我會盡力避免失態的，還希望您多多擔待，我的舞伴。",	"ハイヒールを履いて、ワルツを踊らなければいけないなんて……恥ずかしいところをお見せしないように精一杯頑張りますから、パートナーとして、どうかご協力をお願いいたします。",	"0",	"0",	"领航，你有看到查丽莎吗？今天她又没来训练……每次也不请一个假，真是让人担心的家伙……",	"0",	"cv_sk_Julius_30",	"0",	"0",	"0"},
[4000100106] = {4000100106,	10001001,	7,	5,	"1_》_0_0.8",	"level1",	"都說不用這麼奢華的衣服了，可母親大人她還是……誒？領航認為很適合我嗎？那……雖然不太習慣，以後在您面前我就再嘗試一些吧。",	"こんなに豪華なドレスは必要ないと申し上げたのに、母上はまた……え？似合う、ですか？でしたら……まだ慣れませんが、あなた様の前では色々試してみましょうか。",	"0",	"0",	"成为驾驶员的理由？啊，一方面是因为我自己本身就非常憧憬这样的生活，另一方面则是因为我的父亲……",	"0",	"cv_sk_Julius_31",	"0",	"0",	"0"},
[4000100107] = {4000100107,	10001001,	8,	5,	"1_》_0_0.8",	"level1",	"領航需要喝點什麼嗎？綠茶，還是紅酒？抱歉……家中僅備有這類略帶苦味的飲品，據長輩說，這種習慣是源於一句古老的家訓：榮耀的味道是苦的。",	"ナビゲーター、お飲み物はいかがですか？緑茶か、赤ワインか……申し訳ありません。ここでは、やや苦味のある飲み物だけをご用意させていただいております。栄光の味は苦いという、先代から伝わる家訓によるものです。",	"0",	"0",	"谢谢关心，但是还请您注意形象。",	"0",	"cv_sk_Julius_5",	"0",	"0",	"0"},
[4000100108] = {4000100108,	10001001,	9,	5,	"1_》_100_1.5",	"level2",	"對了，母親大人一直很想親自見見您，她常被評價為手腕強勢的貴婦人，也許會說些較為尖銳的話，但那只是算種……考驗？總之，還請您放心。",	"そういえば、母上がずっとあなた様にお会いしたがっていました。母上は「手ごわい貴婦人」と言われ、言葉にも遠慮のないところがあるのですが、それも一種の……テストのようなものです。あまりご心配されなくても大丈夫ですよ。",	"0",	"0",	"怎么了？我的装备穿错了吗？抱歉，我马上检讨。",	"0",	"cv_sk_Julius_6",	"0",	"0",	"0"},
[4000100109] = {4000100109,	10001001,	10,	5,	"1_》_500_2",	"level3",	"關於我小時候？嗯……那時整天都得上各種課，尤其以馬術課最難熬，為了讓我克服，父親特意買了個大型獨角獸玩偶給我。我很喜歡它，至今還妥善保存著，待會要一起試試嗎？",	"私の子供の頃ですか？そうですね……色々な習い事をしたのですが、乗馬が一番苦手でしたね。でも頑張れるように、父上が大きなユニコーンのぬいぐるみを買ってくれたんです。とても気に入って、今でも大切にしているんですよ。後で一緒に見に行きませんか？",	"0",	"0",	"为什么……会这么在意我。如果我有让您不满意的地方还请直接指出，老用这种眼神看着我，我也会……",	"0",	"cv_sk_Julius_7",	"0",	"0",	"0"},
[4000100110] = {4000100110,	10001001,	11,	5,	"1_》_1000_2.5",	"level4",	"非常感謝您願意陪我出席宴會，改天我也去您家做做客吧？不，不是指艾吉斯宿舍，而是您的故鄉……那個隨著記憶忘卻的地方，我想陪您一起尋找。",	"今晩はパーティーにお付き合いくださり、ありがとうございました。いつかあなた様のお家にもお邪魔できたら嬉しいですね。ええ、アイギス寮ではなく、あなた様の故郷……記憶から失われた場所を、一緒に探してみたいのです。",	"0",	"0",	"原来如此，最近我已经明白您的感受了。没错，现在的我和您心中想的事情是一样的……但是在没有结束这一切之前，只是这样看着彼此，就足够了。",	"0",	"cv_sk_Julius_8",	"0",	"0",	"0"},
[4000100111] = {4000100111,	10001001,	12,	6,	"0",	"0",	"謝謝關心。",	"お気遣い、ありがとうございます。",	"0",	"0",	"谢谢关心。",	"0",	"cv_sk_Julius_9",	"0",	"0",	"0"},
