[4000100113] = {4000100113,	10001001,	14,	8,	"0",	"0",	"終於抵達這個高度了嗎……領航，這份榮耀與您共用！",	"やっとここまで辿り着くことができました…...ナビゲーター、この栄光をあなた様と共に！",	"0",	"0",	"终于抵达这个高度了吗……领航，这份荣耀与您共享！",	"0",	"cv_sk_Julius_11",	"0",	"0",	"0"},
