[4000100129] = {4000100129,	10001001,	31,	23,	"0",	"0",	"還請放輕鬆，無論結果如何我都不會責備您的。",	"リラックスしてください。どんな結果になったとしても、責めたりはしませんから。",	"0",	"0",	"还请放轻松，无论结果如何我都不会责备您的。",	"0",	"cv_sk_Julius_27",	"0",	"0",	"0"},
