[4000100131] = {4000100131,	10001001,	33,	25,	"0",	"0",	"我……我沒有責怪您的意思。",	"わ、私は……あなた様を責める気はないのですが。",	"0",	"0",	"我……我没有责怪您的意思。",	"0",	"cv_sk_Julius_29",	"0",	"0",	"0"},
[4000100132] = {4000100132,	10001001,	34,	26,	"0",	"0",	"在宴會進行得正熱烈時，就這樣兩人獨處，靜靜待著也不錯呢。",	"パーティーの喧騒から離れて、二人きりで静かに過ごすのも悪くありませんね。",	"0",	"0",	"欢迎回来，领航。今天也让我们一起为了荣耀而战斗吧。",	"0",	"cv_sk_Julius_32",	"0",	"0",	"0"},
[4000100133] = {4000100133,	10001001,	35,	27,	"0",	"0",	"在旅途結束之前，我都將成為您最牢固的盾以及最鋒利的劍。",	"この旅が終わるまで、あなた様の一番丈夫な盾、そして一番鋭利な剣であり続けると誓いましょう。",	"0",	"0",	"在旅途结束之前，我都将成为您最牢固的盾以及最锋利的剑。",	"0",	"cv_sk_Julius_34",	"0",	"0",	"0"},
