[4001900102] = {4001900102,	10019001,	3,	3,	"0",	"0",	"嗯？我的名字怎麼了嗎？和那位傳說中的偶像名字一模一樣？……是嘛，原來“她”已經死了啊。",	"あたしの名前が何か……？え、伝説のアイドルと同じ？……そうですか。彼女はもう、いないんですね。",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_3",	"0",	"0",	"0"},
[4001900103] = {4001900103,	10019001,	91,	4,	"0",	"idle",	"即使我不在你的身邊了，但是我會通過微風、星辰與大海守望你的。……是什麼？是我以前的歌啦。",	"もしあたしがあなたから離れることがあっても、風と星と海を通して、見守り続ける。……今のですか？昔つくった歌ですよ。",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_5",	"0",	"0",	"0"},
[4001900104] = {4001900104,	10019001,	91,	4,	"0",	"idle",	"我們的故事還沒翻到最後一頁呢，不要太著急結束哦。",	"あたし達の物語はまだ最後のページではありません。そんなに急がなくてもいいですよ。",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_6",	"0",	"0",	"0"},
[4001900105] = {4001900105,	10019001,	94,	4,	"0",	"idle2",	"夏風聽起來、略微夾雜著為我喝彩的聲音。它們在為我加油鼓勁哦。",	"夏のそよ風があたしを元気にしてくれるんです。頑張れって言われてるみたいに……",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_7",	"0",	"0",	"0"},
[4001900106] = {4001900106,	10019001,	94,	5,	"0",	"idle2",	"遮陽傘、就好像是我的舞臺一樣。我們一起躲在這裏吧，我有一段剛想到的旋律、想給領航聽。",	"このビーチパラソルの下、まるであたしのステージみたいですね。ここで一緒に少し休みませんか？新しいメロディを思いついたので、ナビゲーターさんに聞いて欲しいんです。",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_8",	"0",	"0",	"0"},
