[4001900108] = {4001900108,	10019001,	96,	5,	"14_》_0_0.8",	"touch_s2",	"……被會長要求披上這件衣服。在她視線裏的時候還是先這樣穿著吧。",	"この服を着るように、会長に言われてるんです。……少なくとも会長がいる間は、着てた方がいいですよね？",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_10",	"0",	"0",	"0"},
[4001900109] = {4001900109,	10019001,	92,	5,	"14_》_0_0.8",	"touch1",	"我能抓住幸運、改變運氣，但是這是有代價的……我在你的身上賭了一把，拜託了……一定要找到我啊。",	"あたしは幸運をつかむことができます。運命を変えることができます。……でもそれには代償が必要なんです。ナビゲーターさん、お願い……絶対にあたしのことを見つけてくださいね。",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_11",	"0",	"0",	"0"},
[4001900110] = {4001900110,	10019001,	92,	5,	"14_》_0_0.8",	"touch1",	"你能猜到我現在正在想什麼嗎？……總有一天，我會登上這個世界最大的舞臺。如果我的願望實現的話，那一天你能來看我嗎？",	"あたしが今何を考えているのか、分かりますか？……あたしはいつか、この世界で一番大きなステージに立ちたいと思っています。もしあたしの願いが実現したら、見に来てくれますか？",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_12",	"0",	"0",	"0"},
[4001900111] = {4001900111,	10019001,	95,	5,	"14_》_0_0.8",	"touch2",	"……我要把領航好好地記住……在我的周圍多呆一會吧。",	"……ナビゲーターさんのことをちゃんと覚えていたくて……だから、もう少しあたしの側にいてくれませんか？",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_46",	"0",	"0",	"0"},
[4001900112] = {4001900112,	10019001,	95,	5,	"14_》_0_0.8",	"touch2",	"真是一場漫長而又短暫的冒險、謝謝你能回應我的聲音。",	"長くて短い冒険でしたね。あたしの声に応えてくれて、ありがとうございます。",	"0",	"0",	"0",	"0",	"cv_sk_nozomi_sw_47",	"0",	"0",	"0"},
