[4100000103] = {4100000103,	11000001,	4,	4,	"0",	"idle",	"笨領航不要磨磨蹭蹭的，等你在這賞完櫻，上學都快要遲到了……聽到這樣的臺詞你就高興了嗎？",	"ばかナビゲーター！ボーっとお花見なんかしてたら、学校に遅刻しちゃうわよ！……こ、こういうセリフがいいんでしょ？",	"0",	"0",	"喂，那边的家伙。如果有什么要帮忙的就随时联系人家吧，今天也绝对不会让你失望的。",	"0",	"cv_sk_chilyarisa_4",	"0",	"0",	"0"},
[4100000104] = {4100000104,	11000001,	5,	4,	"0",	"idle",	"……為什麼不說話啊？明明是你非要我穿這種衣服的，倒是給點反應啊！",	"……なんで黙ってんの？あんたがこういう服着せたかったんでしょ。なんか言いなさいよ！",	"0",	"0",	"离家出走的千金大小姐？你到底是从哪听到的谣言啊，下次如果再敢提起这事，人家绝对不会放过你。",	"0",	"cv_sk_chilyarisa_5",	"0",	"0",	"0"},
