[4100000106] = {4100000106,	11000001,	7,	5,	"1_》_0_0.8",	"level1",	"喂，不要亂碰我！你說什麼？是想幫我拍掉身上的櫻花？呃，那就，謝、謝謝……",	"ちょっと、触んないでよ！……え？服についた桜を払ってくれたの？そ、そうなんだ。ありがと……",	"0",	"0",	"我就直说了吧，我想要出名，想让全世界的目光都聚焦到我的身上。想要……证明自己才不是什么一无是处任人摆布的千金大小姐。",	"0",	"cv_sk_chilyarisa_7",	"0",	"0",	"0"},
