[4100300102] = {4100300102,	11003001,	3,	3,	"0",	"0",	"我是風林火山的鈴木清風，順帶一提，我可是隊長喔。",	"うちは風林火山の鈴木清風。ちなみに、隊長やで。",	"0",	"0",	"咱是风林火山的铃木清风，顺带一提，咱可是队长哦。",	"0",	"cv_sk_suzuki_3",	"0",	"0",	"0"},
[4100300103] = {4100300103,	11003001,	4,	4,	"0",	"idle",	"“一宵梦黄粱，镜花难折水月荡，徒余泪愁肠。”然后是……啊，又忘了。话剧台词还真是难背呢。",	"一夜の夢、鏡に映し、ただ憂い……あー、また忘れてもうた。舞台のセリフってホンマ覚えられへんわ。",	"0",	"0",	"对咱而言，优先保护好同伴才是最重要的。",	"0",	"cv_sk_suzuki_4",	"0",	"0",	"0"},
[4100300104] = {4100300104,	11003001,	5,	4,	"0",	"idle",	"困了吗？先好好休息下吧。唔……看来咱的演绎还不够吸引人呢，必须要再加把劲了！",	"眠いんか？とりあえずゆっくり休んどき。うー……、やっぱうちの演技はまだまだやな。もっと頑張らなあかんな！",	"0",	"0",	"领航呀，咱很好奇呀，你难道不需要休息吗？",	"0",	"cv_sk_suzuki_5",	"0",	"0",	"0"},
[4100300105] = {4100300105,	11003001,	6,	4,	"0",	"idle",	"没想到在话剧里，咱也要作为“大姐”，照顾不知火、青鸾、鬼之介所扮演的，初来栖野庄的孩子们呢。",	"栖野庄に新しく来た子らを不知火と青鸞と鬼之介が演じるんや。まさか舞台でも姉さんになって世話することになるとは思わんかったわ。",	"0",	"0",	"不知火那孩子，总是用看小孩的目光看着咱呢。呼呼呼，对于咱来说，她才是需要照顾的孩子呢。因为，咱才是这支队伍的队长呀。",	"0",	"cv_sk_suzuki_6",	"0",	"0",	"0"},
[4100300106] = {4100300106,	11003001,	7,	5,	"1_》_0_0.8",	"level1",	"《栖野哀歌》讲述的是关于花魁的故事，而话剧选角全都是驾驶员少女们，咱听说，这么做是为了致敬某个知名歌剧团哦。",	"「栖野哀歌」って花魁のお話やねんけど、キャストがドライバーの女の子だけなんは、有名な歌劇団へのオマージュらしいで。",	"0",	"0",	"咱的梦想？呜，咱可没有精力去想那些。光是照顾队伍里的同伴，就已经耗费咱不少精力了。",	"0",	"cv_sk_suzuki_7",	"0",	"0",	"0"},
[4100300107] = {4100300107,	11003001,	8,	5,	"1_》_0_0.8",	"level1",	"对于这戏服，咱可是很用心制作的，结果整套衣物的层数太多，倒是难以只靠自己穿上了。领航能搭把手、帮咱穿上几件吗？",	"この衣装、ホンマに心を込めて作ったんやけど、重ね着が大変すぎて一人で着られへんねん。ナビゲーター、手伝ってくれるか？",	"0",	"0",	"别……别老是光盯着咱啊，有话快问啦。",	"0",	"cv_sk_suzuki_8",	"0",	"0",	"0"},
[4100300108] = {4100300108,	11003001,	9,	5,	"1_》_100_1.5",	"level2",	"服饰、妆容、舞台道具……呜姆，基本算是周全了。领航觉得这幅场景怎么样？嗯嗯，很漂亮对吧？欸？居然是在说咱吗……！",	"衣装とかメイクとか小道具とか、まあまあ、しっかりと用意したつもりや。ナビゲーター、このシーン、どう思う？……うんうん、キレイやろ？……え？うちのこと言うてんの！？",	"0",	"0",	"哎？想向咱请教该怎么和队员交流。嗯嗯……老实说，咱也不是很清楚哎……",	"0",	"cv_sk_suzuki_9",	"0",	"0",	"0"},
[4100300109] = {4100300109,	11003001,	10,	5,	"1_》_500_2",	"level3",	"再饮半杯浊酒，抚一曲清词，然后今夜……啊不对！领航，咱、咱才没有醉呢，只是入戏有些深而已，不信的话，你揪一下咱的脸看看？",	"にごり酒を一献（いっこん）、無粋はそろそろおさらばえ。今宵は……って、あかん、あかん！ナビゲーター、う、うちは酔ってへんで。ただちょっと役に入り込み過ぎてもうただけや。信じてないなら、ほっぺたつねってみい",	"0",	"0",	"哎？咱喜欢的东西？嗯嗯……寿喜烧吧。当然，咱指得是喜欢制作寿喜烧，而不是吃啦。",	"0",	"cv_sk_suzuki_10",	"0",	"0",	"0"},
[4100300110] = {4100300110,	11003001,	11,	5,	"1_》_1000_2.5",	"level4",	"感觉话剧的结尾有些悲凉呢，毕竟剧名就带有“哀歌”啊。不过，故事所传递的并不只是悲伤，还有与命运抗争的决心，为了咱们的未来，戏外也得更加努力呢！",	"「哀歌」ってタイトルだけあって、ラストはちょっと悲しいねん。せやけど、この物語は悲しみだけやなくて、運命と戦う決意も描いてんねん。うちらの未来のために、舞台の外でももっと頑張らなあかんな！",	"0",	"0",	"真是的，这段时间领航你总是问东问西的，整得就像是咱那个没换牙的弟弟一样。不过……咱觉得这种关系也不错呢。",	"0",	"cv_sk_suzuki_11",	"0",	"0",	"0"},
[4100300111] = {4100300111,	11003001,	12,	6,	"0",	"0",	"不得了啊！領航，我變強了呀！",	"大変、ナビゲーター！うち、強くなったんよ！",	"0",	"0",	"不得了啊！领航，咱变强了呀！",	"0",	"cv_sk_suzuki_12",	"0",	"0",	"0"},
[4100300112] = {4100300112,	11003001,	13,	7,	"0",	"0",	"你就……這麼在意我嗎？",	"そんなに……うちのことが気になる？",	"0",	"0",	"你就……这么在意咱吗？",	"0",	"cv_sk_suzuki_13",	"0",	"0",	"0"},
[4100300113] = {4100300113,	11003001,	14,	8,	"0",	"0",	"喔喔喔喔——領航，你看到了嗎！刀的顏色…刀刃的顏色！！！欸，你說沒啥變化？！",	"おおっ――ナビゲーター！今の見た？刀の色……刃の色！！！えっ？特に変わっとらんって？！",	"0",	"0",	"噢噢噢噢——领航，你看到了吗！刀的颜色…刀刃的颜色！！！哎，你说没啥变化？！",	"0",	"cv_sk_suzuki_14",	"0",	"0",	"0"},
