[4100300131] = {4100300131,	11003001,	33,	25,	"0",	"0",	"在戰場上認錯的話就糟糕了喂。",	"戦場で間違えたらごっついことになるで。",	"0",	"0",	"在战场上认错的话就糟糕了喂。",	"0",	"cv_sk_suzuki_32",	"0",	"0",	"0"},
[4100300132] = {4100300132,	11003001,	34,	26,	"0",	"0",	"呜姆，你回来了！咱正对剧本的一处地方疑惑着呢，能帮咱排练下吗？",	"お、待っとったで！台本のここがちょっとわからへんから、稽古につき合ってくれるか？",	"0",	"0",	"咱在这里恭候多时了，领航！",	"0",	"cv_sk_suzuki_33",	"0",	"0",	"0"},
