[4101400100] = {4101400100,	11014001,	1,	1,	"0",	"0",	"蒼霧殘響。",	"蒼霧残響（ハツリバーブ）。",	"0",	"0",	"苍雾残响。",	"0",	"cv_sk_sikadi_31",	"0",	"0",	"0"},
[4101400101] = {4101400101,	11014001,	2,	2,	"0",	"0",	"哼，你會選擇吾是理所當然的，畢竟吾與汝之間可是存在著不可視的命運紅線在連接著…喂，別走啊，我還沒說完呢！",	"フン、汝が妾を選ぶのは当然だ。汝と妾は、運命の赤い糸で結ばれておるのだからなぁ……ってこら！行くな、まだ話の途中だぁ！",	"0",	"0",	"哼，你会选择吾是理所当然的，毕竟吾与汝之间可是存在着不可视的命运红线在连接着…喂，别走啊，我还没说完呢！",	"0",	"cv_sk_sikadi_2",	"0",	"0",	"0"},
[4101400102] = {4101400102,	11014001,	3,	3,	"0",	"0",	"終於，找到你了，這就是我與你的宿命嗎？我…吾的名字是斯卡蒂，統治著暗之國的女王…“應該是影之國吧？”…不要在意那麼多啦！",	"ようやく見つけたぞ。まさにこれが運命。あた…妾の名はスカディ、影の国を統べる女王なり！……え？冬の女神のほうが正しい？……細かいことを気にするなぁ！",	"0",	"0",	"终于，找到你了，这就是我与你的宿命吗？我…吾的名字是斯卡蒂，统治着暗之国的女王…“应该是影之国吧？”…不要在意那么多啦！",	"0",	"cv_sk_sikadi_1",	"0",	"0",	"0"},
[4101400103] = {4101400103,	11014001,	4,	4,	"0",	"idle",	"哼，吾在夢中預見到了，未來的吾所擁有的驚人可能性。破除詛咒後的斯卡蒂可不會止步於此哦？",	"ふふん。妾は夢で予見したのじゃ。未来の妾が驚異的な可能性を持つことを！呪いを破ったスカディは、ここで立ち止まることはない！",	"0",	"0",	"哈——哈——哈，领航，吾能感觉到汝在想什么…“通感”？不是啦，这是魔法，魔法！",	"0",	"cv_sk_sikadi_3",	"0",	"0",	"0"},
[4101400104] = {4101400104,	11014001,	5,	4,	"0",	"idle",	"領航不在的時候，吾不就能霸佔他的位置了嗎……果然，只有最中間的位置才能凸顯吾的偉大。……領、領航……什麼時候在的？",	"ナビゲーターがおらぬのなら、その席をいただこう……やはり、最も中央の席こそ偉大なる妾に相応しい。……ナ、ナビゲーター……いつからいたの？",	"0",	"0",	"看到了吗，领航，吾的眼睛正在闪闪发光，这是与汝产生共鸣的征兆！",	"0",	"cv_sk_sikadi_4",	"0",	"0",	"0"},
[4101400105] = {4101400105,	11014001,	6,	4,	"0",	"idle",	"以前孤兒院的夥伴麼？吾是有拜託情報部的人一直關注他們的啦……你提他們做什麼……怎麼了，對吾的過去如此在意嗎？哈~哈~哈，領航，終於將手伸向那不可被觸及的……好，告訴你，吾全告訴你……",	"孤児院に居た時の仲間か？情報部に頼んで見守るようしているが、どうしたのじゃ？さては……妾の過去が気になると見える。ははは！ナビゲーターよ……とうとう探ってはならぬことに手を……分かった。教える。教えるから……",	"0",	"0",	"嘘——领航，不要告诉莉莉丝我在这里…真是的，只是一个蛋糕而已，有什么关系嘛……",	"0",	"cv_sk_sikadi_28",	"0",	"0",	"0"},
[4101400106] = {4101400106,	11014001,	7,	5,	"1_》_0_0.8",	"level1",	"我試著穿了這樣的衣服……感覺、感覺怎麼樣？",	"これ、試しに着てみたんじゃが……ど、どうじゃ？",	"0",	"0",	"中二病？不是！吾才不是中二病！听好了，吾是因为被世界选择，被人们需要，所以才会成为影之国的女王，出现在这里的！才不是普通的“中二病”！",	"0",	"cv_sk_sikadi_29",	"0",	"0",	"0"},
[4101400107] = {4101400107,	11014001,	8,	5,	"1_》_0_0.8",	"level1",	"呀——！雖、雖然吾特許你能親近吾，但、但是嚇到我可不好哦。",	"ぎゃー！わ、妾に近づくことは許したが、お、驚かせてるでない！",	"0",	"0",	"想靠近吾的话，倒也无妨，不过要小心被阴影吞噬噢，领航。",	"0",	"cv_sk_sikadi_5",	"0",	"0",	"0"},
[4101400108] = {4101400108,	11014001,	9,	5,	"1_》_100_1.5",	"level2",	"嗯……下面涼颼颼的，是不是加長一下裙子比較好……領航覺得呢？",	"うーむ……下がスースーするな。スカートを長くしてはどうじゃろうか……ナビゲーターはどう思う？",	"0",	"0",	"啊，是领航啊。正好，帮吾去买一份补充黑暗力量的魔力剂吧…就是那个…碳酸饮料啦。",	"0",	"cv_sk_sikadi_6",	"0",	"0",	"0"},
[4101400109] = {4101400109,	11014001,	10,	5,	"1_》_500_2",	"level3",	"慶賀吧，在亙古的極夜中，影之國的王答應了你，來到了你身旁。",	"祝うがよい。古の極夜、影の国の王が汝の声に応じ、ここに君臨したのじゃ。",	"0",	"0",	"不，不要老是摸吾啦，别把吾当成那些爱撒娇的孩子！吾可是最强的影之国女王！咳咳…不过，你真这么喜欢吾的话，吾也不会在意的。",	"0",	"cv_sk_sikadi_7",	"0",	"0",	"0"},
[4101400110] = {4101400110,	11014001,	11,	5,	"1_》_1000_2.5",	"level4",	"領航聽過“葉海珍珠”嗎？不是珠寶哦？那是一種超稀有的魚子醬的稱呼哦，如果有機會的話，我們一起嘗嘗看吧。",	"ナビゲーターは「アリスト海の真珠」って聞いたことはあるか？宝石のことじゃないぞ。とっても珍しいキャビアの名前なんじゃ。今度一緒に食べてみようではないか。",	"0",	"0",	"被阴影与死亡吸引而堕落的人啊，和影之国的女王结下恋…领航！？汝什么时候在这的？",	"0",	"cv_sk_sikadi_8",	"0",	"0",	"0"},
