[4300300110] = {4300300110,	13003001,	11,	5,	"1_》_1000_2.5",	"level4",	"世界上還有很多沒法頓頓都吃飽的人，在我沒有加入艾吉斯前也是他們中的一員。但是我相信，如果只要你能堅持走下去的話，一定可以改變這一切吧。既然如此，我會一直陪在你的身邊，成為你最堅固的後盾。",	"この世界にはね、飢えに苦しむ人々が沢山いるの。アイギスに加入するまでのあたしもそうだった。でも、前に進み続けるあんたなら、きっと全てのことを変えられる。あたしはそう信じてる。だから、あたしはずっと、あんたのそばにいて、あんたの一番の支持者で、理解者になるって決めたの。",	"0",	"0",	"世界上还有很多没法顿顿都吃饱的人，在我没有加入艾吉斯前也是他们中的一员。但是我相信，如果只要你能坚持走下去的话，一定可以改变这一切吧。既然如此，我会一直陪在你的身边，成为你最坚固的后盾。",	"0",	"cv_sk_kurimu_8",	"0",	"0",	"0"},
